(1, '<img src="uploads/rahul/challengePic/2015-01-04_06:50:41pm_1508510_10151906301566840_1226955973_n.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /> <br/> The purpose of this article is to have a look at how mathematics is used in computer games. I<r>ll use examples from computer games you<r>ve probably already played. There are lots of different types of computer games, and I<r>ll talk about how maths is used in some of the following examples:<br/><br/>The First Person Shooter (FPS) is a type of game where you run around 3D levels carrying a big gun shooting stuff. Examples of this sort of game include Doom , Quake , Half Life , Unreal or Goldeneye . There are other games that look very similar, but aren<r>t first person shooters, for instance Zelda: Ocarina of Time or Mario 64 .<br/><br/>The Strategy games are divided into two main types, Real Time Strategy (RTS), and Turn Based Strategy (not usually called TBS for some reason). These games usually involve building and managing a city or civilization and also fighting wars by controlling troops. Examples of real time strategy games are Age of Empires , Command <a>amp;; Conquer , Tiberian Sun . Examples of turn based strategy games are Civilization and Alpha Centauri .<br/><br/>Simulation games are games that try to make something as realistic as possible. For instance, Flight Sims are computer games which try to realistically simulate flying an aeroplane or helicopter. Two games of this sort are Microsoft Flight Simulator and Red Baron . Space sims are like flight sims, but with spaceships instead of planes. For instance, Wing Commander or X-Wing vs. Tie Fighter . Racing games are games which simulate driving different sort of cars. For instance, Need for Speed , NASCAR Racing , Gran Turismo or Driver .<br/><br/>Reff: http://nrich.maths.org/1374'),
(2, '<img src="uploads/rahul/projectPic/2015-01-04_06:46:45pm_collap.gif" style="max-width: 100%;" onError="this.src="img/default.gif"" /> <br/> <br/> <s><br/> Collap is a powerful online platform which enables you to take a dig at problems, big or small, and collaborate with like minded people to make the world a better place. <br/> <s><br/> Identify any problem you want solved and let the world know about it. Assemble your team and have a go at it. Interested Collapers can join your quest and contribute which ever way they can. Collap provides you a wide range of helpful tools which enable hassle-free collaboration. Create and manage projects and be in control with our Project Dashboard all through the process. Share ideas freely and come up with innovative solutions. <br/> <s><br/> Make your realm private and work on that secret project youâ€™ve long been planning. Participate in projects and upgrade your Level. Earn a special place in Collap for each incremental step. Sharpen your skills while lending them to do good. <br/> <s><br/> Challenges to solve your technical problems and help change the world! . Meet people, allows everybody to share their ideas, views, challenges and achievements with the like minded for mutual benefits. In this collap v1 release, we are going to limit to some functionality due to technically liabilities and available resources. <br/> '),
(3, '<iframe class="youtube" src="//www.youtube.com/embed/Mtjatz9r-Vc "frameborder="0" allowfullscreen ></iframe><br/> Guy Kawasaki at TEDxBerkeley 2014: <a>quot;Rethink. Redefine. Recreate.<a>quot; His talk is titled <a>quot;The Art of Innovation.<a>quot;<br/><br/>Guy Kawasaki is a special advisor to the Motorola business unit of Google. He is also the author of APE, What the Plus!, Enchantment, and nine other books. Previously, he was the chief evangelist of Apple. Kawasaki has a BA from Stanford University and an MBA from UCLA as well as an honorary doctorate from Babson College.<br/><br/>In the spirit of ideas worth spreading, TEDx is a program of local, self-organized events that bring people together to share a TED-like experience. At a TEDx event, TEDTalks video and live speakers combine to spark deep discussion and connection in a small group. These local, self-organized events are branded TEDx, where x = independently organized TED event. The TED Conference provides general guidance for the TEDx program, but individual TEDx events are self-organized.* (*Subject to certain rules and regulations)'),
(4, '<img onError="this.src="img/default.gif"" src="uploads/rajnish/challengePic/2014-12-15_07:40:16pm_nerve_gray_free.jpg" style="max-width: 100%;" /> <br/> In the process, some of the brainâ€™s nerve cells change shape or even fire backwards<br/>Musicians, athletes and quiz bowl champions all have one thing in common: training. Learning to play an instrument or a sport requires time and patience. It is all about steadily mastering new skills. The same is true when it comes to learning information â€” preparing for that quiz bowl, say, or studying for a big test.<br/><br/>As teachers, coaches and parents everywhere like to say: Practice makes perfect.<br/>Doing something over and over again doesnâ€™t just make it easier. It actually changes the brain. That may not come as a surprise. But exactly how that process happens has long been a mystery. Scientists have known that the brain continues to develop through our teenage years. But these experts used to think that those changes stopped once the brain matured.<br/>No more.<br/><br/>Recent data have been showing that the brain continues to change over the course of our lives. Cells grow. They form connections with new cells. Some stop talking to others. And itâ€™s not just nerve cells that shift and change as we learn. Other brain cells also get into the act.<br/><br/>Scientists have begun unlocking these secrets of how we learn, not only in huge blocks of tissue, but even within individual cells.<br/>Rewiring<br/><br/>The brain is not one big blob of tissue. Just six to seven weeks into the development of a human embryo, the brain starts to form into different parts. Later, these areas will each take on different roles. Consider the prefrontal cortex. Itâ€™s the region right behind your forehead. Thatâ€™s where you solve problems. Other parts of the cortex (the outer layer of the brain) help process sights and sounds. Deep in the brain, the hippocampus helps store memories. It also helps you figure out where things are located around you.<br/><br/>Scientists can see what part of the brain is active by using functional magnetic resonance imaging, or fMRI. At the heart of every fMRI device is a strong magnet. It allows the device to detect changes in blood flow. Now, when a scientist asks a volunteer to perform a particular task â€” such as playing a game or learning something new â€” the machine reveals where blood flow within the brain is highest. That boost in blood flow highlights which cells are busy working.<br/>Many brain scientists use fMRI to map brain activity. Others use another type of brain scan, known as positron emission tomography, or PET. Experts have performed dozens of such studies. Each looked at how specific areas of the brain responded to specific tasks.<br/><br/>Nathan Spreng did something a little different: He decided to study the studies. Spreng is a neuroscientist at Cornell University in Ithaca, N.Y. A neuroscientist studies the brain and nervous system. Spreng wanted to know how the brain changes â€” how it morphs a little bit â€” as we learn.<br/>He teamed up with two other researchers. Together, they analyzed 38 of those earlier studies. Each study had used an fMRI or PET scan to probe which regions of the brain turn on when people learn new tasks.<br/><br/>Areas that allow people to pay attention became most active as someone began a new task. But those attention areas became less active over time. Meanwhile, areas of the brain linked with daydreaming and mind-wandering became more active as people became more familiar with a task.<br/><br/>â€œAt the beginning, you require a lot of focused attention,â€ Spreng says. Learning to swing a bat requires a great deal of focus when you first try to hit a ball. But the more you practice, Spreng says, the less you have to think about what youâ€™re doing.<br/><br/>Extensive practice can even allow a person to perform a task while thinking about other things â€” or about nothing at all. A professional pianist, for example, can play a complex piece of music without thinking about which notes to play next. In fact, stopping to think about the task can actually interfere with a flawless performance. This is what musicians, athletes and others often refer to as being â€œin the zone.â€<br/>Cells that fire together, wire together<br/><br/>Sprengâ€™s findings involve the whole brain. However, those changes actually reflect whatâ€™s happening at the level of individual cells.<br/><br/>The brain is made up of billions of nerve cells, called neurons. These cells are chatty. They â€œtalkâ€ to each other, mostly using chemical messengers. Incoming signals cause a listening neuron to fire or send signals of its own. A cell fires when an electrical signal travels through it. The signal moves away from what is called the cell body, down through a long structure called an axon. When the signal reaches the end of the axon, it triggers the release of those chemical messengers. The chemicals then leap across a tiny gap. This triggers the next cell to fire. And on it goes.<br/>As we learn something new, cells that send and receive information about the task become more and more efficient. It takes less effort for them to signal the next cell about whatâ€™s going on. In a sense, the neurons become wired together.<br/><br/>Spreng detected that wiring. As cells in a brain area related to some task became more efficient, they used less energy to chat. This allowed more neurons in the â€œdaydreamingâ€ region of the brain to rev up their activity.'),
(6, '<img onError="this.src="img/default.gif"" src="uploads/rajnish/challengePic/2014-12-15_07:37:28pm_IO_banner_free.jpg" style="max-width: 100%;" /> <br/> How smart you are doesnâ€™t depend on how your parents raised you, a new study concludes.<br/><br/>Their reading to you, talking with you at the dinner table and taking an active interest in your life could make you happy. And thatâ€™s important. But it wonâ€™t make you smarter, says Kevin Beaver.<br/><br/>As a criminologist,he studies the causes of crime and ways to prevent it. Beaver works at Florida State University in Tallahassee. His research team wanted to know if different parenting styles influenced a childâ€™s intelligence. After all, Beaver notes, â€œintelligence has been linked to crime.â€<br/><br/>Previous research has suggested different types of parenting could affect a childâ€™s IQ. Short for intelligence quotient, IQ is a score that measures human intelligence.<br/><br/>But those earlier data hadnâ€™t separated out the effect of genetics on IQ. Beaverâ€™s team wanted to know: Are childrenâ€™s IQ scores really affected by how their parents raised them? Or are those scores just a reflection of what genes a child inherited?<br/><br/>To find out, the team pored over information from a study of more than 15,000 U.S. middle- and high-school students. Itâ€™s called the National Longitudinal Study of Adolescent Health.<br/><br/>Starting in the 1994-to-1995 school year, researchers had asked students a series of questions. For instance: How warm and loving are your parents? How much do you talk with them? How close do you feel to your parents? How much do you think they care about you?<br/><br/>Students also were given a list of 10 activities. Then the questionnaire asked how many of those activities students had done with their parents in the previous week. Did they play sports together? Go shopping? Talk with each other over dinner? Watch a movie together?<br/><br/>Students also answered questions about how permissive their parents were. For example, did their parents let them choose their own friends, choose what to watch on TV or choose for themselves when to go to bed?<br/><br/>The researchers then gave the students a test to gauge their IQ. Called a Picture Vocabulary Test, it asked the students to link words and images. Scores on this test have been linked repeatedly to IQ. Later in life, between the ages of 18 and 26, these people were tested again.<br/><br/>Beaverâ€™s group was especially interested in results from a group of about 220 students who had been adopted. The parents who raised them had not passed on any genes to them. So if there was a link between the studentsâ€™ IQs and the way their parents raised them, the researchers should see it most clearly in the adopted studentsâ€™ scores.<br/><br/>But no such link emerged. Whether students reported their parents cared about them and did things with them â€” or reported that they did not â€” it had no impact on the their IQ. This means a personâ€™s IQ is largely the result of the genes we inherit from our biological parents.<br/><br/>What does Beaver make of the new findings?<br/><br/>We all have strengths and weaknesses, he says. That means some of us will have to work harder than others to do well. And in some cases, other people will always be better than us at certain things.<br/><br/>â€œThe key is to find what you are good at and what you enjoy.â€ Then, he says, â€œWork your hardest to become the best you can be.â€<br/><br/>J.C. Barnes is a criminologist who studies how genetics and the environment affect crime. He works at the University of Cincinnati in Ohio. He agrees that the new study shows parentsâ€™ behavior does not affect a childâ€™s IQ. Still, he says, itâ€™s important that all parents provide a nurturing environment for their children. <br/><br/>Parents who do this â€œgive their child the best chance to succeed â€” not because they improve the childâ€™s IQ, but because they allow the child to develop into a healthy individual,â€ he says.<br/>Power words<br/><br/>adolescent <s>A person at a transitional stage of physical and psychological development â€” one that begins at the onset of puberty, typically between the ages of 11 and 13, and ends with adulthood.<br/><br/>criminologist <s>Someone who studies criminal behaviors, their rates among different segments of the population, factors that underlie crime, and ways to limit crime.<br/><br/>gene <s>(adj. genetic) A segment of DNA that codes, or holds instructions, for producing a protein. Offspring inherit genes from their parents. Genes influence how an organism looks and behaves.<br/><br/>IQ <s>Short for intelligence quotient. Through standardized tests, schools and others measure IQ. This score should not change much, if at all, throughout a healthy personâ€™s lifetime. IQ does not measure what someone knows or has learned. Rather it measures oneâ€™s capacity to learn, reason and understand information. That information can be delivered in different ways, such as through written words, or as symbols or numbers. Some aspects of the test measure an individualâ€™s ability to learn by asking someone to recall information presented minutes earlier or in different places over a brief span on a computer screen.<br/><br/>longitudinal <s>(in research) A research project that collects data over a long time; or data representing a long period.'),
(7, '<img src="uploads/rajnish/projectPic/2014-12-09_01:09:24am_asset Mgt system.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> Asset management, broadly defined, refers to any system that monitors and maintains things of value to an entity or group. It may apply to both tangible assets such as buildings and to intangible concepts such as intellectual property and goodwill. Asset management is a systematic process of deploying, operating, maintaining, upgrading, and disposing of assets cost-effectively.<br/>Todayâ€™s Asset Management Challenge:<br/>The fundamental business goal is to utilise capital assets to provide services at<br/>lowest cost, in a safe, secure, sustainable and sufficient manner. Separation of<br/>asset ownership, asset management and asset operation has created new business<br/>models and new challenges in the value chain. The stakeholders in this new<br/>paradigm have different drivers and correspondingly different information<br/>system requirements: <br/>Stakeholder <s> <s> <s> <s> <s> Key Drivers Information <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> System Requirements<br/>Asset Owner <s> <s> <s> <s> <s>â€¢ Long run cost and performance data of <s> <s> <s> <s> <s> Enhance asset value for company owners<br/> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s>o asset providers, system designers<br/> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s>o capital markets, finance providers<br/> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s>o company shareholders.<br/><br/> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s>'),
(8, '<img onError="this.src="img/default.gif"" src="uploads/rajnish/challengePic/2014-12-15_07:35:57pm_kb_footballhelmets_free_web.jpg" style="max-width: 100%;" /> <br/> WASHINGTON, D.C. â€” Adding magnets to football helmets could reduce the risk of concussions, a new study finds. When two players collide, the magnets in each playerâ€™s helmet should repel the otherâ€™s. This should reduce the force of the collision.<br/><br/>Football helmets now work by dispersing the energy as an impact occurs, explains neuroscientist Raymond Colello. Helmets with built-in magnets could put a brake on an impact before it happens, he says. Colello works at Virginia Commonwealth University in Richmond. He shared his teamâ€™s data November 15 at the annual meeting of the Society for Neuroscience.<br/><br/>The magnet idea hasnâ€™t been tested yet in helmets with real players, notes Judy Cameron. â€œBut a lot of thought has gone into it,â€ she says. Indeed, she adds, the data shown on the ability of the magnets to repel each other â€œlooked extremely promising.â€ Cameron is a neuroscientist at Pennsylvaniaâ€™s University of Pittsburgh.<br/><br/>On the field, football players often suffer a concussion. Thatâ€™s a brain injury that can cause headaches â€” or even leave a person unconscious. The blow may cause the head to move quickly or come to a rapid stop.<br/><br/>Each year in the United States, there are 100,000 concussions among the nearly 1.2 million people of all ages that play football. Colello wants to reduce this risk.<br/><br/>To do so, he is testing magnets made from neodymium (NEE-oh-DIM-ee-um), a rare-earth element. Rare earths are a group of metals that tend to be soft, bendable and chemically reactive. Magnets made from them are the most powerful ones you can buy.<br/><br/>Colelloâ€™s new helmet would hold three such magnets. They would add about 0.45 kilogram (1 pound) to the helmet. A normal football helmet weighs about 1.6 to 2.5 kilograms (3.5 to 5.5 pounds). When placed 0.6 centimeter (0.25 inch) away from each other, two of the magnets (with their like poles facing one another) exert nearly 45 kilograms (100 pounds) of repulsive force.<br/><br/>Colello tested his magnets with the same procedure used to evaluate football helmets. First, he placed magnets on the front of a weight. Then he let the weight drop from various heights onto another magnet. The falling magnets created the same range of impact forces that football players can encounter.<br/><br/>â€œAt 48 inches [122 centimeters], if you dropped a standard helmet and it hit a stationary object, it would create 120 gâ€™s of force,â€ Colello said. That acceleration is equal to 120 times the force of gravity. â€œWith the magnets, we drop that to below 100 gâ€™s,â€ Colello says of the collision force. That reduction can be important: Concussions readily occur at impacts greater than 100 gâ€™s.<br/><br/>Colello has ordered customized arc-shaped magnets that can be fitted inside helmets for testing. He plans to send helmeted crash-test dummy heads toward each other down a zip line. When they collide, special sensors called accelerometers will measure the force of the impacts.<br/><br/>Helmets fitted with magnets could reduce the risk of concussions by up to 80 percent, Colelloâ€™s data indicate. Adding the magnet technology could also up the cost of a helmet by $50 to $100.<br/><br/>The magnets do attract metallic objects. However, football leagues often prohibit players from wearing jewelry during games.<br/><br/>Another safety concern is whether the magnets are dangerous to have near human heads. Colello says that a 30- to 60-minute magnetic resonance imaging (MRI) procedure produces magnetic fields 10 to 30 times as strong as those in magnet-bearing helmets.<br/>Power Words<br/><br/>acceleration <s>The rate at which the speed or direction of something changes over time.<br/><br/>accelerometer <s>An instrument for measuring vibrations or a change in the rate of movement. These sensors typically can measure movement changes in all three dimensions (front-to-back, side-to-side and up-and-down).<br/><br/>concussion <s>Temporary unconsciousness, or headache, dizziness or forgetfulness caused by a severe blow to the head.<br/><br/>g force <s> <s>The force of gravity, where 1 g is equal to the average force of gravity on Earthâ€™s surface. Thatâ€™s 9 meters (29.5 feet) per second per second. It is a unit of measure commonly used to describe the force of acceleration in a moving object.<br/><br/>gravity <s>The force that attracts anything with mass, or bulk, toward any other thing with mass. The more mass that something has, the greater its gravity.<br/><br/>magnet <s>A material that usually contains iron and whose atoms are arranged so they attract certain metals.<br/><br/>magnetic resonance imaging(MRI) <s>An imaging technique to visualize soft, internal organs, like the brain, muscles, heart and cancerous tumors. MRI uses strong magnetic fields to record the activity of individual atoms. <br/><br/>neuroscience <s>Science that deals with the structure or function of the brain and other parts of the nervous system. Researchers in this field are known as neuroscientists.<br/><br/>rare earths <s> <s>(in Earth science) These are a group of metal elements that tend to be soft, bendable and chemically reactive.<br/><br/>Reference: Society for Science'),
(9, '<img onError="this.src="img/default.gif"" src="uploads/rajnish/challengePic/2014-12-15_07:41:05pm_yourstory_HappyHustling.jpg" style="max-width: 100%;" /> <br/> <br/>People always hint at the ambiguity that surrounds the role of the non-tech co-founder in a startup. What is his role until the product is ready, is a question asked by many. Well, I was part of the same pool until we started working on our own startup. Letâ€™s just say that the work is abysmal while the product is getting ready but your actions in this period will have a huge effect on your startupâ€™s eventual success. You need to get prospects to pilot, funds to run, a good team to work with, mentors to guide, and so on. Personal experiences are the best teachers, and hereâ€™s a quick list of the important aspects that worked for us while the product was getting ready:<br/>1) Â  Â Spy: <s>â€˜Imitation is the best form of flatteryâ€™ doesnâ€™t hold much meaning from a product creation perspective. However, one can always learn from the competitors. Spy on them, like a cop! Follow them on social media, read their blogs, watch their demos, product videos, pitch decks, clients list, growth, etc....Register as a customer and ask them to provide a demo of their product, ask hell of a lot of questions (which might come handy while answering your own customers), ask them to send help docs, observe how they follow-up to get you onboard.<br/>2) Â  Â Hustle: <s>Startups should hustle to the core, be it getting clients or investors or accelerators or startup competitions. Talk to as many prospects as possible, create a simple PPT, talk to them as if your product is ready and get their feedback or commitments. Same works with accelerators and investors as well. There are numerous examples of startups that have raised funding or got into accelerators with just a PPT. Who knows, people might like your idea on PPT itself! <s>My personal advice to every start-up is to explore and apply to various startup competitions across their niche. Itâ€™s all about hustling; there isnâ€™t a defined process as such.<br/>3) Â  Â Read: <s>If youâ€™re a startup guy, you should be reading a lot every day. Itâ€™s good to learn what fellow entrepreneurs are doing, dos and donâ€™ts, tips and tricks, who raised funding, who got acquired and whatâ€™s happening in entire startup eco-system. Staying ahead of the game is a trick that has never failed. Along with great learnings and insights, it keeps you connected with like-minded people within the startup ecosystem, the place where you belong to.<br/>4) Â  Â Communities: Being active in communities like Hackernews, Quora, ProductHunt, Betalist, Growthhackers.com and other relevant forums adds a lot of value to your profile. Very few people get the requisite response to these highly curated and engaging platforms, and the start-ups gain a lot due to the immense value these platforms add to it. You can submit your own startup once your product is launched or let such platforms reach out to you. I know a few startups who have dedicated community managers to make sure they are active on all these platforms. If the need be, hire one!<br/>5) Â  Â Network: Make a habit to attend almost all the startup events in your vicinity. This is the place where you meet, pitch and network with lot of fellow entrepreneurs and investors. You donâ€™t really need to have a product to pitch, just make an elevator pitch to as many people as possible. This creates a lot of buzz by the time you actually release your product. Even at the time of raising money, people recognize you and they recall that youâ€™re in this startup space for quite a long time. It also important to remember that attending events doesnâ€™t drive you followers or investors, you should make sure to stay in touch with them. Follow them on social media, send them updates and extend your network.<br/>6) Â  Â Share: Sharing is caring! Do share your experiences and observations with fellow entrepreneurs. There are plenty of ways to do it and of the best ways is to have a blog and share your experiences. Another interesting way is through a â€˜guest postâ€™, if you feel it makes more sense to post it somewhere else. Again this builds credibility and would help you reach followers, prospects and future investors in no time.<br/>7) Â  Â Sleep Well: Last but not least, donâ€™t forget to sleep well, and occasionally order a Six-Pack Of Craft Beer for yourself and the team. This is the best time to savor, since the path ahead would constitute many sleepless nights!<br/>FROM yourstory.<br/>Thanks,'),
(10, '<img onError="this.src="img/default.gif"" src="uploads/rajnish/challengePic/2014-12-15_07:42:22pm_ceos common 6 mis .jpeg" style="max-width: 100%;" /> <br/><br/>Remember your last web development project? You went over budget, blew past deadlines and became frustrated with just about everyone involved at some point.<br/>The bad news? It was rough.<br/>The really bad news? It was probably your teamâ€™s fault.<br/>Most CEOs have serious misconceptions about web development. This is a problem because businesses are more reliant than ever on their online presence.<br/>CEOs in companies of all sizes struggle with this. Here are six myths that most CEOs struggle with:<br/>1. Website development is easy:<br/> <s> <s> <s> <s> Clients commonly request a <a>quot;simple<a>quot; 20-page website with a log-in setup, online payment, a blog and other widgets.<br/>Websites such as Facebook and Craigslist may appear simple, but the necessary development work is time-consuming and complicated. The strange thing is that the simpler the design, often the more expensive the siteis. Some requests that seem small could involve complicated development work and require days of programming.<br/><br/>2. Everyone should be involved:<br/> <s> <s> <s> <s> Rather than packing all the staff into a conference room to rattle off ideas involve only the people whoâ€™ll be doing the work.<br/>Compile your content strategy, brand assets, business objectives and user flows. Donâ€™t spend time mulling deep technical planning, database architecture, layouts, designs or widgets.<br/><br/>3. Websites are a commodity:<br/> <s> <s> <s> <s> With the advent of templates, sites like 99designs and offshore development, many businesspeople harbor the misperception that web design is a cheap commodity.<br/>Taking advantage of already created templates might work for some companies, but for those serious about their brand and online presence, such alternatives wonâ€™t suffice long-term.<br/>Consider your website an investment and dedicate appropriate resources toward it. Find a team of designers who understands your business, ask the right questions and have happy customers. A good team will help you manage your goals along with your budget and find optimal solutions. It may seem expensive, but the return on investment will be worth it.<br/><br/>4. Once a site is built, itâ€™s done:<br/> <s> <s> <s> <s> <s>Web development isnâ€™t a once-and-done activity. Once your site is launched, it will need to be maintained. Many midmarket companies have round-the-clock teams monitoring their sites to ensure they remain without glitches.<br/>Even if your website doesnâ€™t handle a high volume of traffic, you still need someone keeping an eye on functionality. Youâ€™ll also need security updates and fresh content for SEO purposes.<br/><br/>5. Anyone can create a great user experience:<br/> <s> <s> <s> <s> You canâ€™t build the website yourself. Focus on leading your business and improving your products. Your intern, cousin or IT guy canâ€™t build it either. A lot more that goes into a site than basic knowledge of web design, especially when building payment systems and ensuring integration with the company<r>s internal systems.<br/>There are free website-building tools that can be great for bootstrapped startup or running a small business site. But they arenâ€™t robust enough for the needs of most established businesses.<br/>For your website, you may need a team to design mostly from scratch, which requires a specific skill set. Let the web design firm hired do what it does best, but make sure its staffers are asking the right questions about the target audiences before they start.<br/><br/>6. Itâ€™s your website, so you dictate the design:<br/> <s> <s> <s> It<r>s natural to want to micromanage your company<r>s website. Unfortunately, unless youâ€™re a web designer, this isnâ€™t the job for you. You need to trust your web designer if you want site visitors to become paying customers.<br/>Web designers will understand your vision, but you need to let them design. Theyâ€™re knowledgeable about structure and what helps visitors convert into customers. <br/>From Entrepreneur,<br/>Thanks.');
