(42, 40, 0, 0, 0, 'Can either of the following be expressed in fixed-point logic plus counting:', '1. Given a graph, does it have a perfect matching, i.e. a set M of edges such that every vertex is incident to exactly one edge from M?<br/>2. Given a square matrix over a finite field (regarded as a structure in the natural way, as described in [BGS02]), what is its determinant ?<br/><br/>It is known that (1) is expressible if restricted to bipartite graphs and that (2) is expressible if the field has only two elements. Both these results are in [BGS02].<br/><br/>[BGS02] A. Blass, Y. Gurevich, and S. Shelah, On polynomial time computation over unordered structures, J. Symbolic Logic 67 (2002) 1093--1125.', 3, 1, 0, 0, '2014-12-17 00:42:12', '2014-12-17 00:42:12'),
(43, 11, 0, 0, 0, 'One Stack, Two Queues', 'Is it possible to implement a stack using two queues, so that both PUSH and POP operations run in amortized time O(1)? If yes, could you tell me how?<br/><br/>Note: The situation is quite easy if we want to implement a queue with two stacks (with corresponding operations ENQUEUE <a>amp; DEQUEUE). Please observe the difference.<br/>It is an open problem.', 3, 1, 0, 0, '2014-12-17 01:08:49', '2014-12-17 01:08:49'),
(44, 11, 2, 0, 0, '10-step-meta-algorithm in solving DS problems', 'Follow 10-step-meta-algorithm in solving DS problems during interviews.<br/>1. Can problem be solved using array?<br/>2. Can problem be solved using linked lists?<br/>3. Can problem be solved using a Stack, queue?<br/>4. Can problem be solved using tree?<br/>5. Can problem be solved using Search tress like binary search tree?<br/>6. Can problem be solved using hash map?<br/>7. Can problem be solves using some graph algorithm?<br/>8. Can problem be solved using priority queue?<br/>9. Can problem be solved using any of above data structure with slight modifications?<br/>10. Can problem be solved using multiple of above structures?<br/><br/>With practice and little innovation you will get most of the problems.', 6, 1, 3, 0, '2014-12-17 01:46:30', '2015-02-06 10:37:29'),
