(72, 11, 12, 0, 0, 'Brief description of Evolution of computers', 'Give brief description of Evolution of computers that describes evolution of computers from start of 300 B.C. to now these days powerful super computers. It should be brief understanding of computers that will help to resolve basic concept about technology used with every generation of computer and new technology, trends, challenges, problems arise till now in world of computer science technology..', 1, 1, 0, 0, '2015-01-06 10:41:32', '2015-01-06 10:41:32'),
