(82, 11, 1, 0, 0, 'Verify meta tags for facebook/twitter/gplus for image/video share.', 'Meta tag for image/video are not set properly on share to facebook. <br/> Sometimes it will take previous image. <br/> Check for size of image accepted by facebook on share.<br/> On share video to facebook, instead of showing video it puts previous image to video meta tag.<br/> Note: Url meta tag working fine.', 1, 5, 0, 0, '2015-01-07 04:45:03', '2015-01-09 19:52:04'),
(83, 8, 1, 0, 0, 'Seperate web from the webfiles', 'as both things site code and file folder are mixed together.<br/> <br/> Challenge is to seperate the file from the code, as result as the code changes still files should be same.', 1, 4, 0, 0, '2015-01-07 06:49:41', '2015-01-10 10:17:25'),
(84, 8, 1, 0, 0, 'Create collap staging', 'There are be 3 levels of testing:<br/> <br/> 1. Local Machine testing: No one is suggested to commit until they have check all the functionalities are working.<br/> 2. Staging : This layer will be online. over the url testing.collap.com. As one pushes a feature one need to pull code to cloud and all need to test it. As it passes there then we will go to next step<br/> 3. to collap.com and testing all the follow.', 1, 5, 0, 0, '2015-01-07 14:31:32', '2015-01-07 14:33:32'),
(85, 8, 1, 0, 0, 'Stop on post reload', 'there should be minimum numbur of reloads inside the website.<br/> Develop are requested to minimize using reload instad use inner funtion on success', 1, 4, 0, 0, '2015-01-07 14:36:08', '2015-01-31 09:10:19'),
(86, 11, 1, 0, 0, 'Add link sharing from other websites', 'Link could be shared from other websites with the help of meta tags for title, description, image, video, author.<br/> Some of featured websites are:<br/> 1. Extract meta tags for newspaper websites like thehindu.com, timesofindia.com etc.<br/> 2. Extract meta tags for article oriented websites like societyforscience.org, wikihow.com etc.<br/> Convert other websites links to article on pasting link to collap.', 1, 2, 0, 0, '2015-01-07 15:50:50', '2015-01-07 15:52:20'),
