(88, 11, 1, 0, 0, 'Issues related to post and link share', 'Some issues are there on posting and sharing website link in between content.<br/> <br/> 1. In Title is prompted to special characters, in ( <r>) it will excludes next character strings.<br/> 2. Website link has not been created in a proper way:<br/> <s> <s> <s>a. In starting of link, it shows ( target=<r>_blank<r>).<br/> <s> <s> <s>b. In end of website link, it added ( <a>lt;br/ ).<br/> 3. On editing content, links area shown as <a>lt;a href = <r>abcdexample.com<r> <a>gt; link example <a>lt;/a<a>gt;<br/> 4. On editing content, link are destroyed.', 1, 5, 0, 0, '2015-01-08 12:33:13', '2015-01-10 10:29:41'),
(89, 11, 12, 0, 0, 'Article on Evolution of wireless technology Generations', 'Hey Neeraj Sharma, It seems to be perfect for assigning this task to you as per your belief and technical liability with Computer/Wireless Networks. Give a brief article on wireless network technologies generations. This article must includes from starting of 0g (Mobile Radio Telephone) to 4g LTE (Long Term Evolution) with including 1g, 2g, 2.5g, 2.75g, 3g, 3.5g, 4g. In answer to submitting task give small introduction an further give link to your article published on collap.<br/> <s>Thanks for contributing collap. <br/> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> ', 5, 4, 0, 0, '2015-01-08 13:08:24', '2015-01-09 19:44:15'),
(90, 11, 1, 0, 0, 'Create a robots.txt ', 'A robots.txt file is a text file that stops web crawler software, such as Googlebot, from crawling certain pages of your site. The file is essentially a list of commands, such Allow and Disallow, that tell web crawlers which URLs they can or cannot retrieve. So, if a URL is disallowed in your robots.txt, that URL and its contents won<r>t appear in Google Search results.<br/> The Robot Exclusion Standard, also known as the Robots Exclusion Protocol or robots.txt protocol, is a convention to advising cooperating web crawlers and other web robots about accessing all or part of a website which is otherwise publicly viewable. Robots are often used by search engines to categorize and archive web sites, or by webmasters to proofread source code. The standard is different from, but can be used in conjunction with, Sitemaps, a robot inclusion standard for websites.<br/> <br/> ', 1, 4, 0, 0, '2015-01-08 16:48:19', '2015-02-07 21:26:23'),
(91, 11, 1, 0, 0, 'Accept / delete link not working', 'Accept / delete link not working, it fails in doing their job, <br/> <s>it shows <r>Invalid Parameters<r>. <br/> <s>Fix the problem.', 1, 4, 0, 0, '2015-01-09 08:17:48', '2015-01-09 12:23:38'),
