(94, 8, 13, 0, 0, 'More young Indians need the right infrastructure to develop skills ', 'By 2020, India<r>s population is expected to become the world<r>s youngest; more than 500 million Indian citizens will be under 25 years of age and more than two thirds of the population will be eligible to work. This means that a growing number of India<r>s youth need the right educational infrastructure to develop skills and adequate opportunities to get employed or become entrepreneurs. <s><br/> <s>Â  <s><br/> <s>Â However, the wide gap between those who have access to education and skill development opportunities and those who do not, is a challenge that has to be overcome. <s><br/> <s>Â more at <s><br/> <s>Â  <s><br/> <s>Â http://timesofindia.indiatimes.com/home/education/news/Empowering-Indian-youth/articleshow/38777444.cms <s> <br/> <s><br/> <s><br/> Collap hands to enpower Indian youths. <br/> collap.com/project.php?project_id=13 <br/> <s><br/> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> ', 6, 1, 0, 0, '2015-01-09 09:50:30', '2015-01-09 09:51:37'),
