(149, 11, 0, 0, 0, 'The Locker Problem', ' <br/> Every day, 100 students enter a school that has 100 lockers. All the lockers are closed when they arrive. <s><br/> <s>Â  <s><br/> <s>Â Student 1 opens every locker. <s><br/> <s>Â Student 2 closes every second locker. <s><br/> <s>Â Student 3 changes the state of every third locker i.e. he opens it if it is closed and closes it if <s> <s>its open. <s><br/> <s>Â Student 4 changes the state of every fourth locker and so on... so that student <r>n<r> changes the state of every <r>nth<r> locker. <s><br/> <s>Â  <s><br/> <s>Â One day, however a few of the students are absent. Regardless, those present complete the procedure and simply skip the students who are absent. For e.g. if student 3 is absent, then nobody changes the state of every third locker. <s><br/> <s>Â  <s><br/> <s>Â At the end of the process, it is found that only locker number 1 is open and all the other 99 lockers are closed... <s><br/> <s>Â  <s><br/> <s>Â How many students were absent that day ?', 3, 3, 0, 0, '2015-01-11 09:57:44', '2015-01-11 10:02:28'),
