(164, 40, 13, 0, 0, 'National youth day, India is celeberating', '<img src="uploads/shruti/projectnotesPic/2015-01-12_07:03:52am_youth day.jpeg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> In 1984, the Government of India declared and decided to observe the Birthday of Swami Vivekananda (12 January) as National Youth Day every year from 1985 on-wards. To quote from the Government of India<r>s Communication, <br/> <s> <br/> <s><a>quot;it was felt that the philosophy of Swamiji and the ideals for which he lived and worked could be a great source of inspiration for the Indian Youth.<a>quot; <br/> <s> <br/> <s>It is the aim of great importance of distributing the ideas and ideals of the Swami Vivekananda among the youths of India. It is the great way to wake up the eternal energy of the youths as well as their big efforts to make the country developed.', 6, 1, 0, 0, '2015-01-12 07:03:52', '2015-01-12 07:03:52'),
