(175, 8, 21, 0, 0, 'Challanges in Distributed Combinational Web Querying for Web People Search.', 'A set of web pages return from search engine when entering query name in to the search engine but in case of WePS it will return the cluster of pages based on name entity of web pages. <br/> <s> <br/> <s>The problem is that clustering is done based on name entities even though still there will be some ambiguity to identify the correct person because if the person is having politician as well as sports man then it will show those two names as different persons that is first problem. <br/> <s> <br/> <s>The second problem is that the two different field persons has the same name then it will shows that those two different persons as a single person or it can show the single person by combining the different person name sakes of different fields of same namesake.', 1, 1, 0, 0, '2015-01-12 15:43:24', '2015-01-12 15:43:24'),
