(181, 40, 0, 0, 0, 'Icosahedron of Resistors', '<img src="uploads/shruti/challengePic/2015-01-13_08:08:22am_icosahedron.png.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /> <br/> Each edge of an icosahedron is a 1Â­ ohm resistor. If the effective resistance between two adjacent vertices can be represented as a/b ohm where a and b are co-prime positive integers, find a b. <br/> <s> <br/> <s>An icosahedron consists of 20 equilateral triangles. It has 12 vertices and 30 edges, with 5 edges meeting at each vertex. <br/> <s>', 3, 1, 0, 0, '2015-01-13 08:07:01', '2015-01-13 08:08:22'),
