(185, 12, 15, 0, 0, 'Apple store rings in 2015 with new records', '<img src="uploads/neeraj/projectnotesPic/2015-01-13_01:39:26pm_apple.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> Recently Apple announced that the first week of January set a new record for billings from the App Store with customers around the world spending nearly half a billion dollars on apps and in-app purchases. The New Yearâ€™s Day 2015 marked the single biggest day ever in App Store sales history. <br/> <s> <br/> <s>These milestones follow a record-breaking 2014, in which billings rose 50 percent and apps generated over $10 billion in revenue for developers. <br/> <s> <br/> <s>Up till now, App Store developers have earned a cumulative $25 billion from the sale of apps and games. The introduction of iOS 8, the most significant iOS update ever, gave developers the ability to create amazing new apps and offers innovative features which proved wildly popular with App Store customers around the world.', 6, 1, 0, 0, '2015-01-13 13:39:26', '2015-01-13 13:39:26'),
