(187, 12, 24, 0, 0, 'Google is going to start selling auto insurance in the U.S.', '<img src="uploads/neeraj/projectnotesPic/2015-01-13_01:45:16pm_googlesurance.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> Keeping up the good work, the biggest search giant in the world, Google has decided to open up its insurance services in U.S. Prior to that Google was already rendering its insurance services under the company called Google Compare Auto Insurance Services Inc. <br/> <s> <br/> <s>This company is already helping users buy insurance in Europe since 2012, and now Google Compare goes beyond simple auto insurance, using the same technology to help users compare mortgage quotes and credit card offers.', 6, 1, 0, 0, '2015-01-13 13:45:16', '2015-01-13 13:45:16'),
(188, 12, 24, 0, 0, 'Apple might kill iPod shuffle', '<img src="uploads/neeraj/projectnotesPic/2015-01-13_01:47:20pm_2012-ipodshuffle-gallery3-zoom.jpeg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> The iPod shuffle is a digital audio player designed and marketed by Apple Inc. It is the smallest model in Apple<r>s iPod family, and was the first to use flash memory. Earlier, Apple has reportedly confirmed that iPod shuffle will be in short supply and is uncertain of specifying when it will come back in stocks. <br/> <s> <br/> <s>A shortage in the supply indicates two things; either it will get shutdown or launching of any upgraded version.', 6, 1, 0, 0, '2015-01-13 13:47:20', '2015-01-13 13:47:20'),
(189, 12, 24, 0, 0, 'Alcatel OneTouch Watch Launched', '<img src="uploads/neeraj/projectnotesPic/2015-01-13_01:49:06pm_alcatel-onetouch-watch_w_600.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> Alcatelâ€™s watches are some of the best you can get in the market. The company has joined the race of digital watches with their very own oneTouch wrist watch. This watch comes with 1.22 inch circular touch screen display with a body that is made from stainless steel. The oneTouch watch comes with a heart rate sensor and 210mAh battery. It is water resistant, but the USP about this phone is that although it does not run on android it uses an iOS android app, and runs on Alcatelâ€™s OS.', 6, 1, 0, 0, '2015-01-13 13:49:06', '2015-01-13 13:49:06'),
