(195, 12, 15, 0, 0, '3Doodler 2.0 ', '<img src="uploads/neeraj/projectnotesPic/2015-01-13_02:03:26pm_33.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> 3Doodler 2.0 is the new and improved version of the original 3Doodler, which allows you to â€œdrawâ€ physical objects in midair. Yes, really. Basically, the pen works by extruding a special thermoplastic that solidifies into a stable form within seconds of exiting the nozzle thanks to a built-in fan. Itâ€™s almost like a hot glue gun, but with fine lines of plastic instead of glue, allowing you to craft three-dimensional objects in space without the need for blueprints, or the exorbitant cost of a 3D printer. The 3Doodler 2.0 also touts dual speeds and a slimmer, lighter profile than its predecessor. At 50 grams, it weighs less than half the weight of your average apple. <br/> <s> <br/> <s>Read more: http://www.digitaltrends.com/cool-tech/awesome-tech-you-cant-buy-yet-ces-2015-edition/#ixzz3Oi5QSlGD <br/> <s>', 6, 1, 0, 0, '2015-01-13 14:03:27', '2015-01-13 14:03:26'),
(196, 12, 15, 59, 0, 'Prynt â€” Smartphone printer', '', 6, 1, 0, 0, '2015-01-13 14:05:09', '2015-01-13 14:05:08'),
(197, 12, 15, 0, 0, 'Lyteshot â€” Live, action-augmented reality game', '<img src="uploads/neeraj/projectnotesPic/2015-01-13_02:07:29pm_lyteshot-1024x347.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/>  <br/> <s>LyteshotIn a nutshell, LyteShot is a new kind of mobile, live-action gaming system. Using sensor-based peripherals that work with your mobile phone, the system allows you to take gaming out of the living room and bring it into the real world. Itâ€™s sort of like laser tag, but smarter, more dynamic, more connected, and built in a way that enables a broader range of gametypes. Right now the platform only supports one gametype (assassin) but others are currently in development. We got a chance to fiddle with some of the peripherals theyâ€™re building, and theyâ€™re already pretty far along. The augmented-reality glasses were pretty mind blowing. <br/> <s> <br/> <s>Read more: http://www.digitaltrends.com/cool-tech/awesome-tech-you-cant-buy-yet-ces-2015-edition/#ixzz3Oi6BXMcj <br/> <s>', 6, 1, 0, 0, '2015-01-13 14:07:29', '2015-01-13 14:07:29'),
