(221, 40, 0, 0, 0, 'Solve a mechanic problem of Green Wave', '<img src="uploads/shruti/challengePic/2015-01-14_06:53:54pm_detais about question.png.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> A green wave is a synchronized pattern of traffic lights that helps reduce gridlock. When there is a major thoroughfare with a lot of traffic lights, often the lights turn green sequentially so that cars can travel a long way before they have to stop. This is a <a>quot;wave of green lights,<a>quot; or green wave. Â  <s><br/> <s>Â  <br/> <s>Consider a horizontal road with such a set of traffic lights, each spaced Â apart. A car sits at the first traffic light. At the light turns green and the car accelerates. Â  <s><br/> <s>Â Â  Â  <br/> <s>What is the maximum time Â in seconds the next light must turn green by so the driver of the car does not start braking? <s><br/> A brilliant.org Question. <br/> Accept the challenge and solve it, give your answer. ', 3, 1, 0, 0, '2015-01-14 18:53:54', '2015-01-14 18:59:54'),
