(234, 40, 0, 0, 0, ' How Many Squares Does the Diagonal Cross ?', '<img src="uploads/shruti/challengePic/2015-01-16_05:48:34am_diagnol problem set.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> Â  Â  Â  <br/> <s>Â Â Â Â Â A diagonal is drawn on the floor from 1 corner to the opposite corner of a rectangular room covered with square tiles 1<r> x 1<r>. Â  Â  <s><br/> <s>Â Â Â Â Â  Â  Â  <s><br/> <s>Â Â Â Â Â A number of tiles are crossed by the diagonal. This depends on the size of the room and the relation of the width and the length. Â  Â  <s><br/> <s>Â Â Â Â Â  Â  Â  <s><br/> <s>Â Â Â Â Â Let A = # of tiles crossed in a room 32<r> x 48<r>, Â  Â  <s><br/> <s>Â Â Â Â Â  Â  Â  <s><br/> <s>Â Â Â Â Â B = # of tiles crossed in a room 32<r> x 47<r>, Â  Â  <s><br/> <s>Â Â Â Â Â  Â  Â  <s><br/> <s>Â Â Â Â Â and C = # of tiles crossed in a room 32<r> x 46<r> Â  Â  <s><br/> <s>Â Â Â Â Â  Â  Â  <s><br/> <s>Â Â Â Â Â Find the sum of <s>A, B, C Â  Â  <s><br/> <s>Â Â Â Â Â Brilliant.org question', 3, 1, 0, 0, '2015-01-16 05:48:34', '2015-01-16 05:53:22'),
(235, 40, 0, 0, 0, 'What is output of this program??', '//What value will this print out, rounded to the nearest hundredths? <s><br/> <s>Â void main () <s><br/> <s>Â { <s><br/> <s>Â  Â  Â int x=1; <s><br/> <s>Â  Â  Â float kittens=0; <s><br/> <s>Â  Â  Â while (x <a>lt; 600000000000) { <s><br/> <s>Â  Â  Â  Â  if (x%2 == 1) { <s><br/> <s>Â  Â  Â  Â  Â  Â kittens = kittens (1.0/(2*x-1)); <s><br/> <s>Â  Â  Â  Â  } <s><br/> <s>Â  Â  Â  Â  else { <s><br/> <s>Â  Â  Â  Â  Â  Â kittens=kittens - (1.0/(2*x-1)); <s><br/> <s>Â  Â  Â  Â  } <s><br/> <s>Â  Â  Â  Â  x <s>; <s><br/> <s>Â  Â  Â } <s><br/> <s>Â  Â  Â kittens=4*kittens; <s><br/> <s>Â  Â  Â printf(<a>quot;%f\n<a>quot;,kittens); <s><br/> <s>Â }', 3, 1, 0, 0, '2015-01-16 06:10:09', '2015-01-16 06:12:08'),
