(237, 12, 24, 0, 0, 'Hans Vestberg to take charge of Ericsson', '<img src="uploads/neeraj/projectnotesPic/2015-01-16_06:53:30am_Ericsson.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> Ericsson chief executive Hans Vestberg will take on the added responsibility of leading the group<r>s key networks division, the Swedish telecoms gear maker said on Thursday. Johan Wibergh, Ericsson<r>s previous Networks boss, has been appointed chief technology officer at Vodafone. Â  <s><br/> <s>Â Â Ericsson<r>s Networks segment consists of two business units, Cloud <a>amp; IP and Radio, with separate heads. Â  <br/> <s>Â  <br/> <s>Scource: http://goo.gl/XTmOid', 6, 1, 0, 0, '2015-01-16 06:53:30', '2015-01-16 06:55:54'),
(238, 12, 24, 0, 0, 'Google to launch DIY Project-Ara phones this year', '<img src="uploads/neeraj/projectnotesPic/2015-01-16_07:01:48am_Project_Ara_scattered_parts.png.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> Project Ara is the codename for an initiative by Google that aims to develop an open hardware platform for creating highly modular smartphones. The platform will include a structural frame (endoskeleton that holds smartphone modules of the owner<r>s choice), such as a display, camera or an extra battery. It would allow users to swap out malfunctioning modules or upgrade individual modules as innovations emerge, providing longer lifetime cycles for the handset, and potentially reducing electronic waste. <br/> <s> <br/> <s>Google plans to launch a <a>quot;market pilot<a>quot; of Project Ara modular phone in Puerto Rico later this year, the company announced at a developers conference. <br/> <s>', 6, 1, 0, 0, '2015-01-16 07:01:49', '2015-01-16 07:01:49'),
(239, 12, 24, 0, 0, 'Google to Discontinue consumer sales of Glass', '<img src="uploads/neeraj/projectnotesPic/2015-01-16_07:09:54am_Google_Glass_with_frame.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> Google has announced that it will discontinue the consumer sales of Google Glass untill a newmore polished and affordable version is developed. <br/> <s>Hope glass comes back with a bang.', 6, 1, 0, 0, '2015-01-16 07:09:55', '2015-01-16 07:09:55'),
