(241, 12, 24, 0, 0, 'Hike to add Voice Call in App', '<img src="uploads/neeraj/projectnotesPic/2015-01-16_07:21:00am_hike2.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> After reports that WhatsApp will be launching a voice-calling feature soon, weâ€™ve managed to get screenshots of how India-based instant messenger Hike will also be adding such a feature to its service. <br/> <s> <br/> <s>The news comes after Hike recently acquired US-based voice-calling company Zip Phone for an undisclosed amount. Zip Phone, a one-man startup founded by Anuj Jain in the US, is a voice-calling app that works globally. <br/> <s> <br/> <s>According to sources, Hike Messengerâ€™s voice-calling feature could be coming very soon to the app, within the next few days. The service will be optimised for 2G networks in India as well as trying to ensure minimum bandwidth usage so that data costs donâ€™t go through the roof. <br/> <s>Scource: http://goo.gl/eiLeMy', 6, 1, 0, 0, '2015-01-16 07:21:00', '2015-01-16 07:21:00'),
