(243, 11, 0, 0, 0, 'Solve the puzzle if you dare to solve ?', 'An automatic card shuffles always shuffles the cards in the same way. A set of twelve cards bearing the letters GOLDENBINARY was placed into the machine. After being shuffled once, the cards were placed into the machine a second time. After that, the cards read ANINOYGREDBL. <s><br/> <s> <br/> <s>What did the cards read after it was placed in the machine the first time? <s><br/> <s>Type a=01, b=02 and so on, so if your answer is GZJ, type it in as 072610. <br/> <s>Accept the challenge to solve this puzzle and submit your answer. Challenge yourself to solve this problem. <br/> <s>A puzzle from The Puzzle Mountain,', 3, 1, 0, 0, '2015-01-16 07:41:16', '2015-01-16 07:41:16'),
(244, 12, 9, 0, 0, 'Network Functions Virtualization (NFV): Engine of the Virtual Revolution ', '<iframe class="youtube" src="//www.youtube.com/embed/AP3jRmdaHRE "frameborder="0" allowfullscreen ></iframe><br/> To stay profitable, service providers need to launch customizable services, but rapid innovation requires a level of agility that can only come from service virtualization and automation. Find out how Contrail Cloud, Juniperâ€™s NFV platform, can help service providers simplify service provisioning operations, scale with elastic infrastructure, and create custom combinations to launch new services at lower cost and lower risk.', 8, 1, 0, 0, '2015-01-16 08:00:36', '2015-01-16 08:00:36'),
