(268, 12, 27, 0, 0, 'Arctic Warfare Magnum L115A1 Long Range Rifle', '<img src="uploads/neeraj/projectnotesPic/2015-01-17_02:47:45pm_sniper.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> The AWM is based on the AW rifle with minimal changes to accommodate Magnum length cartridges. Its detachable box magazine holds 5 rounds. Normal calibers are .300 Winchester Magnum and .338 Lapua Magnum. Designated L115A1 Long Range Rifle within the British military, the latter as the AWSM (Arctic Warfare Super Magnum) or L115A3 LRR. It is described by Guiness World Records to be the most advanced sniper rifle of all time and was used by Cpl. Craig Harrison of the British Army to establish a new record distance for a confirmed kill shot in Afghanistan in November 2009, surpassing the previous record held by a McMillan TAC-50 fired by Cpl. Rob Furlong of the Canadian Armed Forces. The .300 Win Mag version (AWM-F), equipped with a folding stock and Zeiss 3-12x56 SSG scope, is used by the German Bundeswehr as the G22. ', 6, 1, 0, 0, '2015-01-17 14:47:46', '2015-01-17 14:47:45'),
