(274, 11, 17, 0, 0, 'How sugar affects the brain- Explained by Nicole Avena at TED-ED', '<iframe class="youtube" src="//www.youtube.com/embed/lEXBxijQREo "frameborder="0" allowfullscreen ></iframe><br/>  <br/> <s>When you eat something loaded with sugar, your taste buds, your gut and your brain all take notice. This activation of your reward system is not unlike how bodies process addictive substances such as alcohol or nicotine -- an overload of sugar spikes dopamine levels and leaves you craving more. Nicole Avena explains why sweets and treats should be enjoyed in moderation.', 8, 1, 0, 0, '2015-01-18 21:32:13', '2015-01-18 21:32:13'),
(275, 11, 0, 0, 0, 'The science of spiciness', '<iframe class="youtube" src="//www.youtube.com/embed/qD0_yWgifDM "frameborder="0" allowfullscreen ></iframe><br/> When you take a bite of a hot pepper, your body reacts as if your mouth is on fire -- because that<r>s essentially what you<r>ve told your brain! Rose Eveleth details the science and history behind spicy foods, giving insights into why some people continue to pay the painful price for a little spice.', 8, 1, 0, 0, '2015-01-18 21:36:45', '2015-01-18 21:36:45'),
(276, 11, 0, 0, 0, ' How to understand power', '<iframe class="youtube" src="//www.youtube.com/embed/c_Eutci7ack "frameborder="0" allowfullscreen ></iframe><br/>  <br/> <s>Every day, we move and operate within systems of power that other people have constructed. But weâ€™re often uncomfortable talking about power. Why? Eric Liu describes the six sources of power and explains how understanding them is key to being an effective citizen. ', 8, 1, 0, 0, '2015-01-18 21:45:09', '2015-01-18 21:45:09'),
