(282, 40, 0, 0, 0, 'How many of ways can you reach the top stair.', ' There are n(from input) steps and given another input x i.e. <s>you can climb 1,2,3â€¦.x steps at a time. <s><br/> <s>How many of ways can you reach the top stair. <br/> <s>For example, given n = 3, x = 4 <br/> <s>you can go 1,1,1 or 1,2 or 2,1 or 0,3 etc. So, itâ€™s should be 4. <br/> <s> <br/> <s>note: Dynamic Prog. is applicable <s><br/> <s> <s> <s> <s> <s> <s> Check boundary condition carefully. <br/> <s>', 3, 1, 0, 0, '2015-01-19 10:57:24', '2015-01-19 10:57:24'),
(283, 40, 0, 0, 0, 'Maximize the total amount.', 'There are 2 sets of countries. One set will donate clothes (something of this sort) and another set will accept clothes. A country can be in only 1 of the sets. The amount of clothes donated is also given. <s><br/> <s>The problem is to maximize this amount of clothes. <s><br/> <s> <br/> <s>Condition: One-to-One relationship must be there between countries in different sets. <s><br/> <s> <br/> <s>Test Cases are like this: <s><br/> <s> <s> <s> <s> {4,4,5,{1,3,7},{1,2,6},{2,1,5},{3,4,6},{4,2,4}} <br/> <s> <s> <s> <s> {r1,r2,tc,{c1,c2,a},....} <br/> <s> <s> <s> r1 = no. of countries in set1 <br/> <s> <s> <s> r2 = no. of countries in set2 <br/> <s> <s> <s> tc = no. of test-cases - followed by that no.of test-cases <br/> <s> <s> <s> {c1,c2,a} = c1 country is giving â€˜aâ€™ amount of clothes to c2 country. <s><br/> <s>Maximize the total amount donated, following the condition that one country can donate to only one country and one country can accept from only one country', 3, 1, 0, 0, '2015-01-19 11:09:56', '2015-01-19 11:09:56'),
(284, 11, 0, 0, 0, 'How many days she can do this or how many such arrangements is possible ?', 'Sara has 6 flower pots, each <s>having a unique flower. Pots are arranged in a row. Sara rearrange the sequence each day <s>but no two pots should be arranged adjacent to each other which were already <s>adjacent to each other in previous arrangements. How many days she can do this or how many such arrangements is possible ?', 3, 1, 0, 0, '2015-01-19 11:41:09', '2015-01-19 11:41:09'),
(285, 62, 0, 0, 0, 'What is the maximum data rate ?', 'If a network has a maximum packet data size of 128 bytes, a maximum packet time-to-live of 30 seconds and an 8 bit sequence number, what is the maximum data rate per connection for this network? <br/> <s>', 3, 1, 0, 0, '2015-01-19 11:44:22', '2015-01-19 11:44:22'),
(286, 11, 0, 0, 0, 'What is your strategy? Explain it.', 'Betting on the World Series. You are a broker; your job is to accommodate your clientâ€™s wishes without placing any of your personal capital at risk. Your client wishes to place an even $1,000 bet on the outcome of the World Series, which is a baseball contest decided in favor of whichever of two teams ï¬rst wins 4 games. That is, the client deposits his $1,000 with you in advance of the series. At the end of the series he must receive from you either $2,000 if his team wins, or nothing if his team loses. <s><br/> <s>No market exists for bets on the entire world series. However, you can place even bets, in any amount, on each game individually. <s><br/> <s> <br/> <s>What is your strategy for placing bets on the individual games in order to achieve the cumulative result demanded by your client? <br/> <s> <br/> <s>Accept the challenge if your dare to solve. <br/> <s>', 3, 1, 0, 0, '2015-01-19 11:48:06', '2015-01-19 11:48:06'),
