(289, 11, 24, 0, 0, 'BPG Motors: UNO Development', '<iframe class="youtube" src="//www.youtube.com/embed/x2DgwY5QQBk "frameborder="0" allowfullscreen ></iframe><br/>  <br/> <s>This wild new motorcycle, invented by 19-year-old Ben J. Poss Gulak, is among the latest inventions to capture attention. <br/> <s> <br/> <s>Debuting at the National Motorcycle Show in Toronto, the <a>quot;Uno<a>quot; uses gyro technology for balance and acceleration. <br/> <s> <br/> <s>It<r>s a battery charged machine that accelerates by leaning forward and slowing down by leaning backwards. <br/> <s> <br/> <s>The Uno weighs approximately 129 pounds (58 kg.) and has a top speed of 25 mph (40 klms). <br/> <s>See more at: http://www.inventor-strategies.com/latest-inventions.html#sthash.m7XMKedt.dpuf', 8, 1, 0, 0, '2015-01-19 14:30:29', '2015-01-19 14:30:29'),
