(296, 40, 30, 0, 0, 'What is the number of elements that are compared to k, in the worst case?', 'A 2-d array of size nxn is given with the following property: Â  <br/> <s>Â Â all rows and columns are in ascending sorted order. Â  <br/> <s>Â  <br/> <s>To find a given element k in the array, this procedure is given: Â  <br/> <s>Â Â  Â  <br/> <s>Â  1. Start at top right element Â  <br/> <s>Â  2. For current element e Â  <br/> <s> <s> <s> <s> <s>1. if e = k Â  <br/> <s>Â Â  <s> <s> <s> <s> <s> <s>1. return true Â  <br/> <s>Â  <s> <s> <s> 2. if k <a>lt; element e Â  <br/> <s>Â Â 	 <s> <s> <s> 1. move to left, if possible. If array<r>s left bound reached, quit. Â  <br/> <s>Â Â  <s> <s> <s>3. if k <a>gt; element e Â  <br/> <s>Â Â 	 <s> <s> <s> 1. move to bottom, if possible. If array<r>s bottom bound reached, quit.	 Â  <br/> <s>Â Â  Â  <br/> <s>Â Â What is the number of elements that are compared to k, in the worst case? Â  <br/> <s>Â Â For more interview questions, stay in touch at http://collap.com/project.php?project_id=30', 1, 1, 0, 0, '2015-01-20 06:30:46', '2015-01-20 06:34:51'),
(297, 40, 30, 0, 0, 'Find the minimum number of steps, an algorithmic problem', 'Given two containers having n and m gallons initially find the minimum number of steps required to correctly measure l gallons. <br/> <s>	Only allowed operations: <br/> <s>		- empty a container <br/> <s>		- fill a container completely <br/> <s>		- transfer contents of one into other completely or till the other <br/> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> container fills up. <br/> <s>	output minimum number of steps to get l gallons. <s><br/> <s> <s> <s> <s> <s>output -1 if can<r>t be done. <br/> <s> <br/> <s>For more interview questions, stay in touch at: http://collap.com/project.php?project_id=30', 1, 1, 0, 0, '2015-01-20 06:41:43', '2015-01-20 06:41:43'),
(298, 8, 14, 0, 0, 'Big-O Complexity Chart', '<img src="uploads/rahul/projectnotesPic/2015-01-20_07:16:11am_Screenshot from 2015-01-20 12:44:22.png.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> Hi there! Â This webpage covers the space and time Big-O complexities of common algorithms used in Computer Science. Â When preparing for technical interviews in the past, I found myself spending hours crawling the internet putting together the best, average, and worst case complexities for search and sorting algorithms so that I wouldn<r>t be stumped when asked about them. Â Over the last few years, I<r>ve interviewed at several Silicon Valley startups, and also some bigger companies, like Yahoo, eBay, LinkedIn, and Google, and each time that I prepared for an interview, I thought to myself <a>quot;Why oh why hasn<r>t someone created a nice Big-O cheat sheet?<a>quot;. Â So, to save all of you fine folks a ton of time, I went ahead and created one. Â Enjoy! <br/> <s><br/> http://bigocheatsheet.com/ <br/> ', 6, 1, 0, 0, '2015-01-20 07:16:12', '2015-01-20 07:16:55'),
(299, 8, 0, 0, 0, 'Big-O notation explained by a self-taught programmer by Justin Abrahms', '<img src="uploads/rahul/articlePic/2015-01-20_07:32:57am_Screenshot from 2015-01-20 13:02:12.png.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> Big-O notation used to be a really scary concept for me. I thought this is how <a>quot;real<a>quot; programmers talked about their code. It was all the more scary because the academic descriptions (such as Wikipedia) made very little sense to me. This is frustrating because the underlying concepts aren<r>t actually that hard. <br/> <s> <br/> <s>Read more at: <s>https://justin.abrah.ms/computer-science/big-o-notation-explained.html <br/> <s>', 7, 1, 0, 0, '2015-01-20 07:32:58', '2015-01-20 07:32:58'),
(300, 40, 30, 0, 0, 'Make an algorithm to analyse run time complexity and memory required. ', ' gcd(a,b,c)=gcd(a,gcd(b,c)) <br/> <s>gcd (a)=a; <br/> <s>An array containing n elements with k bit of each number. <s><br/> <s>Given array is [a1,a2,...an]. q(=O(n)) queries come which specify i and j for which we have to take out gcd of [ai,a(i 1),....aj]. <s><br/> <s>Make an algorithm to analyse run time complexity and memory required. <s><br/> <s>', 1, 1, 0, 0, '2015-01-20 07:34:14', '2015-01-20 07:34:14'),
(301, 40, 30, 105, 0, 'Add two numbers represented by linked lists', ' ', 1, 4, 0, 0, '2015-01-20 07:38:43', '2015-01-20 12:58:36'),
(302, 11, 30, 0, 0, 'Find the greatest submatrix', 'Given a square matrix of size n containing positive integers. Find the greatest submatrix (square or otherwise) which is sorted both row-wise and column-wise in increasing order. A matrix is sorted row-wise, if all the elements in any row are sorted in increasing order. And similarly, a matrix is sorted column-wise, if all the elements in any column are sorted in increasing order. Greatest submatrix is defined as the submatrix containing the maximum number of elements. <s><br/> <s> <br/> <s>eg <br/> <s> <br/> <s>2 5 3 8 3 <s><br/> <s>1 4 6 8 4 <br/> <s>3 6 7 9 5 <br/> <s>1 3 6 4 2 <s><br/> <s>2 6 4 3 1 <br/> <s> <br/> <s>has the greatest submatrix as <s><br/> <s> <br/> <s>1 4 6 8 <br/> <s>3 6 7 9 <br/> <s> <br/> <s>Accept challenge and submit your answer. <s><br/> <s>For more interview questions, stay in touch at: http://collap.com/project.php?project_id=30 ', 1, 1, 0, 0, '2015-01-20 07:43:03', '2015-01-20 07:43:03'),
(303, 11, 30, 0, 0, 'Cracking the Coding Interview with Author Gayle Laakmann McDowell', '<iframe class="youtube" src="//www.youtube.com/embed/aClxtDcdpsQ "frameborder="0" allowfullscreen ></iframe><br/> Software engineers typically face a double whammy when it comes to the interview process, they not only have to ace the interview with a company<r>s hiring manager and team members but also score well on coding tests. Dice.com recently interviewed Gayle Laakmann McDowell, author of Cracking the Coding Interview, who gave a white board demonstration.', 8, 1, 0, 0, '2015-01-20 07:47:08', '2015-01-20 07:47:08'),
