(314, 62, 0, 0, 0, 'What is the 15th bottom-right corner number?', '<img src="uploads/mridula/challengePic/2015-01-20_01:19:55pm_NEWImage.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /> <br/> The integers from 0 to 1000000 are written in order in a spiral pattern, as shown above. Â  Â  Â  <br/> <s>Â Â Â Â Â Â  Â  Â  Â  <br/> <s>Â Â Â Â Â Â A number is considered to be in a bottom-right corner if it has a downward arrow pointing into it and a leftward pointing arrow coming out of it. As we can see from the spiral, the first bottom-right corner number is 2 and the second is 12. Â  Â  Â  <s><br/> <s>Â Â Â Â Â Â What is the 15th bottom-right corner number? Â  Â  Â  <br/> <s>Â Â Â Â Â Â Explain it.', 3, 1, 0, 0, '2015-01-20 13:08:12', '2015-01-20 13:20:20'),
