(326, 7, 0, 0, 0, 'What were the yields per tree in the orchards of the third and fourth farmers ?', 'Five farmers have 7, 9, 11, 13 <a>amp; 14 apple trees, respectively in their orchards. <br/> <s>Last year, each of them discovered that every tree in their own orchard bore <br/> <s>exactly the same number of apples. Further, if the third farmer gives one apple <br/> <s>to the first, and the fifth gives three to each of the second and the fourth, they <br/> <s>would all have exactly the same number of apples. What were the yields per <br/> <s>tree in the orchards of the third and fourth farmers? <br/> <s>Explain it.', 3, 1, 0, 0, '2015-01-21 07:23:54', '2015-01-21 07:23:54'),
