(328, 40, 30, 0, 0, 'Gibberize string<r>s eligible characters under the constraints', 'You are given a string. Gibberize itâ€™s eligible characters under the constraints: <br/> <s> <s> <s>- eligible characters are: a, A, e, E, i, I, o, O, u, U <br/> <s> <s> <s>- similarly you will have one gibberized character corresponds to each eligible character. <br/> <s> <s> <s>- you can assume one function is given to gibberize these characters <br/> <s> <s> <s>- at most 4 eligible characters from the rear of the string can be gibberized <br/> <s> <s> <s>- exempt first 3 eligible characters of the string from any gibberization. <br/> <s>', 1, 1, 0, 0, '2015-01-21 08:54:20', '2015-01-21 08:54:20'),
(329, 40, 30, 0, 0, 'What will be the value of counter in the end?', 'There are 5 nested loops written as follows, <br/> <s> <s><br/> <s> <s>int counter = 0; <br/> <s> <s>for (int loop_1=0; loop_1 <a>lt; 10; loop_1  ) { <br/> <s> <s> <s> <s>for (int loop_2=loop_1   1; loop_2 <a>lt; 10; loop_2  ) { <br/> <s> <s> <s> <s> <s> <s>for (int loop_3=loop_2   1; loop_3 <a>lt; 10; loop_3  ) { <br/> <s> <s> <s> <s> <s> <s> <s> <s>for (int loop_4=loop_3   1; loop_4 <a>lt; 10; loop_4  ) { <br/> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s>for (int loop_5=loop_4   1; loop_5 <a>lt; 10; loop_5  ) { <br/> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s>counter  ; <br/> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s>} <br/> <s> <s> <s> <s> <s> <s> <s> <s>} <br/> <s> <s> <s> <s> <s> } <br/> <s> <s> <s> } <br/> <s>} <br/> <s> <br/> <s>What will be the value of counter in the end (after all the loops finished running)? <br/> <s>a) 15C5 <br/> <s>b) 14C5 <br/> <s>c) 10C5 <br/> <s>d) 10 * 9 * 8 * 7 * 6 * 5', 1, 1, 0, 0, '2015-01-21 08:59:49', '2015-01-21 08:59:49'),
(330, 40, 30, 0, 0, 'Which statements is true about NP, NP-Complete, NP-Hard ??', 'Let S be an NP-complete problem and Q and R be two other problems not known to be in NP. <br/> <s>Q is polynomial time reducible to S and S is polynomial-time reducible to R. <s><br/> <s> <br/> <s>Which one of the following statements is true? <br/> <s> <br/> <s>a) R is NP-complete <br/> <s>b) R is NP-hard <br/> <s>c) Q is NP-complete <br/> <s>d) Q is NP-hard <br/> <s>', 1, 4, 0, 0, '2015-01-21 09:03:17', '2015-01-22 05:25:26'),
(331, 11, 22, 0, 0, 'Add ongoing projects list on index page', 'As new user comes to collap.com on first time, it is very difficult to analyze about website. So, adding public project within boxes like 4 in a row with at-least 3 columns would be helpful to give about one idea. Website description is there, its good but if we add picture representation it would be more attractive. Â As we see on other websites, some content of website is always there on index page. Add ongoing project list with picture, title/statement within boxes on index page. Â  <s><br/> <s>Â Â Not similar as shown in picture but we can conclude some idea from it.', 6, 1, 2, 0, '2015-01-21 20:38:36', '2015-01-22 11:36:18'),
(332, 11, 0, 0, 0, 'Sarah Bergbreiter: Why I make robots the size of a grain of rice', '<iframe class="youtube" src="//www.youtube.com/embed/PtBKP4fVAvI "frameborder="0" allowfullscreen ></iframe><br/> By studying the movement and bodies of insects such as ants, Sarah Bergbreiter and her team build incredibly robust, super teeny, mechanical versions of creepy crawlies â€¦ and then they add rockets. See their jaw-dropping developments in micro-robotics, and hear about three ways we might use these little helpers in the future.', 8, 1, 0, 0, '2015-01-22 06:44:53', '2015-01-22 06:44:53'),
(333, 11, 0, 0, 0, 'The rise of personal robots', '<iframe class="youtube" src="//www.youtube.com/embed/eAnHjuTQF3M "frameborder="0" allowfullscreen ></iframe><br/> Cynthia Breazeal wonders: Why can we use robots on Mars, but not in our living rooms? The key, she says, is in training robots to interact with people. Now she dreams up and builds robots that teach, learn â€” and play. Watch for amazing demo footage of a new interactive game for kids.', 8, 1, 0, 0, '2015-01-22 06:46:57', '2015-01-22 06:46:57'),
(334, 9, 31, 0, 0, 'Profile Page/ User', '1) Location of Collaper <br/> <s>2) Current employment status of the Collaper (Company/Oganisation and Full time/Part employment) <br/> <s>3) Arrangement and view of skills. Must be justified and streamlined. <s><br/> <s>4) Verify Collapers identity (using mobile number like incase of WhatsApp etc) to ensure there are no bot-Collapers or Fake profiles. <s><br/> <s>IMPORTANT: Fake profiles are be detrimental to Collap since Collaboration is based on mutual trust and transparency. <s><br/> <s>5) Collapers searchable based on location, skills, employment etc. ', 9, 1, 0, 0, '2015-01-22 09:50:37', '2015-01-22 09:50:37'),
(335, 9, 31, 0, 0, 'Challenges and Teams', '1) Adding a new team requires e-mail ID of the Collaper. We need to provide the option of adding existing Collapers directly by searching him in addition to the current email system. ', 9, 1, 0, 0, '2015-01-22 09:52:42', '2015-01-22 09:52:42'),
(336, 9, 31, 0, 0, 'User Interface', '1) Customisability of the site. <s><br/> <s>We must offer the website to be customisable to at-least a little extent. Like Gmail for instance. It allows for basic customisation. <s><br/> <s>In the long run we<r>re looking at customisation options of the look and feel of the website. Just like many people like to arrange their desk/table or office in a certain way, we should give them the ability to customise the site to suit their needs. Like changeable position and placement of the various tiles. ', 9, 1, 0, 0, '2015-01-22 09:58:46', '2015-01-22 09:58:45'),
(337, 9, 31, 0, 0, 'Storage Option', '1) Offer Collapers the ability to store their important info or documents to store in the cloud like Google Drive so they can work on the go from anywhere. ', 9, 1, 0, 0, '2015-01-22 09:59:45', '2015-01-22 09:59:45'),
