(344, 7, 0, 0, 0, 'What is the shortest distance in kilometers you will need to walk to correctly identify and label ea', ' Â A 120 wire cable has been laid firmly underground between two telephone exchanges located 10km apart. <s><br/> <s>Â  <s><br/> <s>Â Unfortunately after the cable was laid it was discovered to be the wrong type, the problem is the individual wires are not labeled. There is no visual way of knowing which wire is which and thus connections at either end is not immediately possible. <s><br/> <s>Â  <s><br/> <s>Â You are a trainee technician and your boss has asked you to identify and label the wires at both ends without ripping it all up. You have no transport and only a battery and light bulb to test continuity. You do have tape and pen for labeling the wires. <s><br/> <s>Â  <s><br/> <s>Â What is the shortest distance in kilometers you will need to walk to correctly identify and label each wire? <s><br/> <s>Â  <s><br/> <s>Â Explain it.', 3, 1, 0, 0, '2015-01-22 11:32:02', '2015-01-22 12:36:15'),
