(354, 8, 33, 0, 0, 'Why Remote Access?', '<img src="uploads/rahul/challengePic/2015-01-23_05:58:07pm_ch354.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /> <br/> Remote Access lets use into different benefit at client side as well as the server side. Both <s>have there own advantages and that lead to different advantages and disadvantages. But here we are only focusing on the client side benefits. <br/> <s> <br/> <s>Client benefits: <br/> <s> <br/> <s> <s> <s>1. To enjoy remote computation. <br/> <s> <s> <s>2. To enjoy remote storage. <br/> <s> <s> <s>3. Anyways use latest codes. <br/> <s> <s> <s>4. High portability over devices. <br/> <s> <s> <s>5. To get access anywhere anytime. <br/> <s> <br/> <s>Provider benefits: <br/> <s> <br/> <s> <s> <s> 1. Command owner software program. <br/> <s> <s> <s> 2. High portability over devices. <br/> <s> <s> <s> 3. Decrease cost <br/> <s> <s> <s> 4. Increase efficiency <br/> <s>', 6, 1, 0, 0, '2015-01-23 17:36:00', '2015-01-23 17:58:07'),
