(356, 8, 0, 0, 0, 'Social Empowerment, Growing society to next level.', 'In India or in any other country. There are many social categories based on their economic conditions, lower class, medium class or higher class etc. As per as rule of genetic, smart people can exist in any above mentioned classes of society. People, in our case students of medium and higher class, find their path. But this is found that the lower class rarely grow up and reach the stars. As result poor becoming power and rich richer. <s><br/> <s> <br/> <s>Idea: <br/> <s> <br/> <s>People who belong to lower economical class of the society and have talent <s>should be given best environment, motivation, education and guidance. If from every city choose 3 student of 8th -12th standard and start working on them. As result, students which are gone through this process will make there life good and also they will improve their community and make our society balanced and beautiful place. <s><br/> <s> <br/> <s>â€œFree Home, Motivation, Education and Guidance to poor brilliant studentsâ€', 4, 1, 0, 0, '2015-01-24 08:00:12', '2015-01-24 08:00:12'),
