(380, 7, 0, 0, 0, 'Find type of polynomial equation??', 'Ram and Shyam have been asked to show that a certain problem Î  is NP-complete. <br/> <s>Ram shows a polynomial time reduction from the 3-SAT problem to Î , <br/> <s>and Shyam shows a polynomial time reduction from Î  to 3-SAT. Which of the <br/> <s>following can be inferred from these reductions? <br/> <s> <br/> <s> (A) Î  is NP-hard but not NP-complete <br/> <s> (B) Î  is in NP, but is not NP-complete <br/> <s> (C) Î  is NP-complete <s><br/> <s>(D) Î  is neither NP-hard, nor in NP', 3, 1, 0, 0, '2015-01-26 09:42:38', '2015-01-26 09:42:38'),
