(382, 7, 0, 0, 0, 'In which case function f returns 1 ??', ' <s>function f defined below. <br/> <s> struct item { <br/> <s> <s> <s> <s> <s> <s> <s> int data; <br/> <s> <s> <s> <s> <s> <s> <s> struct item * next; <br/> <s> <s> <s> }; <br/> <s> int f(struct item *p) { <br/> <s> <s> <s> <s> <s> <s> <s>return ((p == NULL) || (p -<a>gt;next == NULL) || <br/> <s> <s> <s> <s> <s> <s> <s>((p-<a>gt;data <a>lt;= p -<a>gt; next -<a>gt; data) <a>amp;<a>amp; <br/> <s> <s> <s> <s> <s> <s> <s>f(p-<a>gt; next))); <br/> <s> <s> <s>} <br/> <s> <br/> <s> For a given linked list p, the function f returns 1 if and only if <s><br/> <s> <br/> <s> (A) the list is empty or has exactly one element <br/> <s> <br/> <s> (B) the elements in the list are sorted in non-decreasing order of data value <br/> <s> <br/> <s> (C) the elements in the list are sorted in non-increasing order of data value <br/> <s> <br/> <s> (D) not all elements in the list have the same data value', 3, 1, 0, 0, '2015-01-26 10:18:11', '2015-01-26 10:18:11'),
(383, 7, 0, 0, 0, 'Find total execution time of the program ??', 'A CPU has a five-stage pipeline and runs at 1 GHz frequency. Instruction fetch happens in the first stage of the pipeline. A conditional branch instruction <s>computes the target address and evaluates the condition in the third stage of the pipeline. The processor stops fetching new instructions following a conditional branch until the branch outcome is known. A program executes 9 10 instructions out of which 20% are conditional branches. <s><br/> <s> <br/> <s>If each instruction takes one cycle to complete on average, the total execution time of the program is: <br/> <s> <br/> <s> (A) 1.0 second <br/> <s> <br/> <s> (B) 1.2 seconds <br/> <s> <br/> <s> (C) 1.4 seconds <br/> <s> <br/> <s> (D) 1.6 seconds ', 3, 1, 0, 0, '2015-01-26 10:31:27', '2015-01-26 10:31:27'),
(384, 7, 0, 0, 0, 'What is printed by Â C program??', 'What is printed by the following C program ? <s><br/> <s>Â int f (int x, int * py, int * *ppz) { <s><br/> <s>Â  Â  Â  Â  Â  int y, z; <s><br/> <s>Â  Â  Â  Â  Â  * *ppz <s>  = 1; Â  z = Â *ppz; <s><br/> <s>Â  Â  Â  Â  Â  * py <s>  = Â 2; Â  Â y Â = *py; <s><br/> <s>Â  Â  Â  Â  Â  x <s> = Â 3; <s><br/> <s>Â  Â  Â  Â  Â  return Â x <s>  Â y <s>  Â z; <s><br/> <s>Â  } Â  <br/> <s>Â  <s><br/> <s>Â void main () { <s><br/> <s>Â  Â  Â  Â  Â  Â  Â int c, Â  * b, Â  * *a; <s><br/> <s>Â  Â  Â  Â  Â  Â  Â c = Â 4; Â b = <a>amp;c; a = <a>amp;b; <s><br/> <s>Â  Â  Â  Â  Â  Â  Â printf (<a>quot;%d<a>quot;, f (c,b, a)) ; <s><br/> <s>Â  } <s><br/> <s>Â  <s><br/> <s>Â  (A) 18 <s><br/> <s>Â  (B) 19 Â  <br/> <s>Â  (C) 21 <s><br/> <s>Â  (D) 22 ', 3, 3, 0, 0, '2015-01-26 10:44:37', '2015-01-26 10:45:19'),
(385, 7, 0, 0, 0, 'What will be the number of first-level and second-level blocks in the multi-level index ?? ', ' <br/> <s>Consider a file of 16384 records. Each record is 32 bytes long and its key field is of size 6 bytes. The file is ordered on a non-key field, and the file organization is unspanned. The file is stored in a file system with block size 1024 bytes, and the size of a block pointer is 10 bytes. If the secondary index is built on the key field of the file, and a multi-level index scheme is used to store the secondary index, the number of first-level and second-level blocks in the multi-level index are respectively <br/> <s> <br/> <s>(A) 8 and 0 <s><br/> <s> <br/> <s>(B) 128 and 6 <s><br/> <s> <br/> <s>(C) 256 and 4 <s><br/> <s> <br/> <s>(D) 512 and 5 <s>', 3, 1, 0, 0, '2015-01-26 10:57:38', '2015-01-26 10:57:38'),
(386, 7, 0, 0, 0, 'What will be the mean effective pressure (in kPa) of the Otto cycle??', 'In an air-standard Otto cycle, the compression ratio is 10. The condition at the beginning of the compression process is 100kPa and 27Â°C. Heat added at constant volume is 1500kJ/kg, while 700kJ/kg of heat is rejected during the other constant volume process in the cycle. Specific gas constant for air=0.287 kJ/kgK. <br/> <s> <br/> <s>The mean effective pressure (in kPa) of the cycle is <s><br/> <s>(A) 103 <s><br/> <s>(B) 310 <s><br/> <s>(C) 515 <s><br/> <s>(D) 1032 ', 3, 1, 0, 0, '2015-01-26 11:11:15', '2015-01-26 11:11:15'),
(387, 7, 0, 0, 0, 'Find engine speed??', 'An automotive engine weighing 240kg is supported on four springs with linear characteristics. Each of the front two springs have a stiffness of 16MN/m while the stiffness of each rear spring is 32MN/m. <s><br/> <s> <br/> <s>The engine speed (in rpm), at which resonance is likely to occur, is <s><br/> <s> <br/> <s>(A) 6040 <s><br/> <s>(B) 3020 <s><br/> <s>(C) 1424 <s><br/> <s>(D) 955 ', 3, 1, 0, 0, '2015-01-26 11:27:47', '2015-01-26 11:27:47'),
(388, 7, 0, 0, 0, 'Find standard free-energy change in kJ/mol for the formation of G-3-P ??', 'Triose phosphate isomerase converts dihydroxy acetone phosphate (DHAP) to glyceraldehyde-3-phosphate (G-3-P) in a reversible reaction. At 298 K and pH 7.0, the equilibrium mixture contains 40 mM DHAP and 4 mM G-3-P. Assume that the reaction started with 44 mM DHAP and no G-3-P. Â  <br/> <s>Â  <s><br/> <s>Â The standard free-energy change in kJ/mol for the formation of G-3-P [R = 8.315 J/mol.K] is. <s><br/> <s>Â (A) Â 5.704 kJ /mol. <s><br/> <s>Â (B) Â 2.462 kJ /mol. <s><br/> <s>Â (C) Â 2.504 kJ /mol. <s><br/> <s>Â (D) Â 5.326 kJ /mol. <s><br/> <s>Â ', 3, 1, 0, 0, '2015-01-26 11:57:17', '2015-01-26 11:57:44'),
(389, 7, 0, 0, 0, 'Which is the most likely cause for <s>change in frequency of the PP genotype??', 'In a relatively large but finite and closed population of sexually reproducing diploid organisms, the frequency of homozygous genotype PP changes from 0.40 to 0.50 and that of pp changes from 0.40 to 0.41 in a span of 10 generations. <s><br/> <s> <br/> <s> <br/> <s>Which of the following is the most likely cause for the above change in frequency of the PP genotype? <br/> <s> <br/> <s>(A) Non-random mating <br/> <s>(B) Random genetic drift <br/> <s>(C) Selection <br/> <s>(D) Combination of non-random mating and random genetic drift ', 3, 1, 0, 0, '2015-01-26 12:14:43', '2015-01-26 12:14:43'),
(390, 7, 0, 0, 0, 'Which of the following is correct about F2 progeny??', 'In a genetic cross between the genotypes WWXX and wwxx, the following phenotypic distributions were observed among the F2 progeny: WX, 562; wx, 158; Wx, 38; and wX, 42. Likewise, a cross between XXYY and xxyy yielded the following results: XY, 675; xy, 175; Xy, 72; and xY, 78. Similarly, a cross between WWYY and wwyy yielded: WY, 292; wy, 88; Wy, 12; and wY, 8. In all the genotypes, capital letters denote the dominant allele. Assume that the F1 progeny were self-fertilized in all three crosses. Also, double cross-over does not <br/> <s>occur in this species. <s><br/> <s> <br/> <s> <br/> <s>Which of the following is correct? <s><br/> <s> <br/> <s>(A) Relative position: W-X-Y Distances: W-X = 5 map units, X-Y = 17 map units <br/> <s>(B) Relative position: X-Y-W Distances: X-Y = 15 map units, Y-W = 11 map units <br/> <s>(C) Relative position: Y-W-X Distances: Y-W = 5 map units, W-X = 11 map units <br/> <s>(D) Relative position: X-W-Y Distances: X-W = 5 map units, W-Y = 10 map units ', 3, 1, 0, 0, '2015-01-26 12:19:03', '2015-01-26 12:19:03'),
