(415, 11, 0, 0, 0, 'Ideasthesia: How do ideas feel?', '<iframe class="youtube" src="//www.youtube.com/embed/GIF2tssedLI "frameborder="0" allowfullscreen ></iframe><br/> The traditional model of our mental function is that first our senses provide data to our brain, which then translates those senses into the appropriate mental phenomena: light into visual images, air vibrations into auditory experiences, etc. But what if that process is actually occurring simultaneously? Danko NikoliÄ‡ describes the theory of ideasthesia.', 8, 1, 0, 0, '2015-01-27 13:10:22', '2015-01-27 13:10:22'),
