(425, 40, 30, 0, 0, 'Puzzle: To Catch A Pirate, solve it', 'You<r>re on a government ship, looking for a pirate ship. You know that the pirate ship travels at a constant speed, and you know what that speed is. Your ship can travel twice as fast as the pirate ship. Moreover, you know that the pirate ship travels along a straight line, but you don<r>t know what that line is. It<r>s very foggy, so foggy that you see nothing. But then! All of a sudden, and for just an instant, the fog clears enough to let you determine the exact position of the pirate ship. Then, the fog closes in again and you remain (forever) in the thick fog. Although you were able to determine the position of the pirate ship during that fog-free moment, you were not able to determine its direction. <s><br/> <s>How will you navigate your government ship so that you will capture the pirate ship?', 1, 1, 0, 0, '2015-01-29 06:06:32', '2015-01-29 06:06:31'),
