(442, 12, 6, 0, 0, 'Key areas for standardization in Smart Grids', '<img src="uploads/neeraj/projectnotesPic/2015-01-30_04:23:28pm_smartgridstandards_png.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/>  As shown in the Figure, key areas for Smart Grid standards include: <br/> <s> <br/> <s>1. Technologies for automated energy management and decentralized power generation in customer premises, including home, building, and factories; <br/> <s> <br/> <s>2. Intelligent grid management at the power transport and distribution level; <br/> <s> <br/> <s>3. Smart meters and AMI; <br/> <s> <br/> <s>4. Information and communication infrastructure to provide energy intelligence, control and security; <br/> <s> <br/> <s>5. Applications and services for the coordination the energy system on the business level; <br/> <s> <br/> <s>6. Security control and management with the different level of requirements for Smart Grid. <br/> <s>', 6, 1, 0, 0, '2015-01-30 16:23:28', '2015-01-30 16:23:28'),
