(444, 12, 0, 0, 0, 'Software Upgrade on Martian Soil', '<img src="uploads/neeraj/articlePic/2015-01-30_05:47:23pm_Curosity.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> Yes, you read it correct recently there was a software upgrade that happened for harware on Mars. <br/> <s> <br/> <s>NASA<r>s Mars rover Curiosity has been upgraded with software update after a pause and engineers said the rover is back to work drilling the Martian crystal-rick rock <a>quot;Mojave<a>quot; at Gale Crater and sending back information. <br/> <s>Earlier this month, Curiosity rover drilled into a crystal-rich rock called <a>quot;Mojave<a>quot; at Gale Crater on Mars to find out salt mineral left behind when lake water evaporated. <br/> <s>Currently, the rover is exploring the lower regions of Mount Sharp known as Aeolis Mons. <br/> <s>In the month of December, the rover accomplished the task of finding carbon-containing compounds and spurts of methane gas in Gale.', 7, 1, 0, 0, '2015-01-30 17:47:23', '2015-01-30 17:47:23'),
