(454, 9, 25, 0, 0, 'User Log in using keyboard. ', 'When the user enters the login credentials and hits <a>quot;enter key<a>quot; the site does not sign in. It is a feature in FB, Google, Linkedin, etc. <s><br/> <s>Accustomed to the same way, I entered the credentials and hit enter and expected to logged in, but it did not. At first I thought there was something wrong then I realised that the website does not yet support <a>quot;enter key<a>quot; login. I had to click login/submit. <s> <br/> <s>Please address the same.', 9, 1, 0, 0, '2015-01-31 15:21:36', '2015-02-02 06:23:12'),
(455, 11, 0, 0, 0, 'Two boys at the merry go round!: Classical Mechanics Problem', '<img src="uploads/rajnish/challengePic/2015-02-01_04:02:04am_twoboys.jpeg" style="max-width: 100%;" onError="this.src="img/default.gif"" /> <br/>In Figure above, a 30kg child stands on the edge of a stationary merry-go-round of radius 2.0m. The rotational inertia of the merry-go-round about its rotation axis is 150 kgm^2. The child catches a ball of mass 1.0kg thrown by a friend. Just before the ball is caught, it has a horizontal velocity v of magnitude 12m/s, at angle <s>fie = 37degree with a line tangent to the outer edge of the merry-go-round, as shown. <br/> What is the angular speed (in rad/sec) of the merry-go-round just after the ball is caught?', 3, 1, 0, 0, '2015-02-01 03:40:39', '2015-02-01 04:07:10'),
(456, 11, 0, 0, 0, 'The story of a ball and a slope: A Classical Mechanics problem', '<img src="uploads/rajnish/challengePic/2015-02-01_04:17:54am_quesstrikingnewimage.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /> <br/> As shown in the figure above, a ball slides along a friction-less ramp of length L. As it reaches the bottom, it hits the board and slides up along the slope again. If the speed of the ball after the collision is 4/5 times the speed of the ball just before the collision, find the total distance traveled by the ball when it comes to a complete stop. <br/> <s>The distance traveled can be expressed as (a/b)L what is (a b) ', 3, 1, 0, 0, '2015-02-01 03:51:47', '2015-02-01 04:17:55'),
(457, 11, 0, 0, 0, ' Fill the squares', '<img src="uploads/rajnish/challengePic/2015-02-01_03:55:45am_fillthesquare.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> Using all the digits from 1 to 9 fill in the squares to fit the stated totals. <br/> <s>What is the sum of the digits in 2 diagonals?', 3, 4, 0, 0, '2015-02-01 03:55:46', '2015-02-02 09:24:31'),
(458, 11, 0, 0, 0, 'Solve it: <s>An algebra complex root problem.', '<img src="uploads/rajnish/challengePic/2015-02-01_04:12:23am_secondquestionforupload.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> .', 3, 1, 0, 0, '2015-02-01 04:12:23', '2015-02-01 04:16:10'),
