(460, 11, 30, 0, 0, 'WAP to find the highest occurring digit in the prime numbers.', 'Given two numbers L and R, find the highest occurring digit in the prime numbers present between L and R (both inclusive). <s><br/> <s>If multiple digits have the same highest frequency print the largest of them. <s><br/> <s>If there are no prime no.s between L and R, print -1. <br/> <s>Testcases: <br/> <s> <s> <s> <s>L=1, R=30, Ans=1 <br/> <s> <s> <s> <s>L=13, R=13, Ans=3 <br/> <s> <s> <s> <s>L=4, R=4, Ans= -1 <br/> <s>Practice more and improve your coding skills.', 1, 1, 0, 0, '2015-02-01 05:51:07', '2015-02-01 05:51:07');
