(462, 8, 58, 0, 0, 'Can anyone improve the model', 'Current model: <br/> <s>1. Teacher can create cources over examIgniter.com. <br/> <s> <s> <s>Cources: will contain Chapters and practices matrial. <br/> <s> <s> <s>Chapters will contain topics and every topic will contain objective question with answer. <br/> <s> <s> <s>To go to next chapter student need to pass through one objective question session. <br/> <s> <br/> <s> <s> Result: So teachers can: create cources, chapter, material and ojective question for topic and finally the chapter. <br/> <s> <br/> <s>2. Student can prepare cources by website. <br/> <s> <br/> <s>Suggestion are welcome, Pleace accept the challage and give your improved model <br/> <s>Thank you. <br/> <s> ', 2, 2, 0, 0, '2015-02-01 10:19:30', '2015-02-06 11:40:22'),
(463, 8, 0, 0, 0, 'Know you Toothpaste!!!', '<img src="uploads/rahul/articlePic/2015-02-01_11:00:54am_10849790_322364494635817_4759315176596013531_n.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> Check the buttom of its, Be careful and aware, http://collap.com <s><br/> <s> <br/> <s>Green : Natural. <br/> <s>Blue : Natural   Medicine. <br/> <s>Red : Natural   Chemical composition. <br/> <s>Black : pure chemical.', 7, 1, 1, 0, '2015-02-01 11:00:55', '2015-02-01 11:40:14'),
(464, 9, 25, 0, 0, 'How to view all active Projects on Collap?', 'I wanted to find a particular Project on Collap but I could not search it since I do not remember the name of the Project. <s><br/> <s>I could not find any place which lists out all the Projects on Collap in once place. <s><br/> <s>Please share the link if such a feature exists or create such an option/feature if it does not exist. <s><br/> <s>It will be very convenient to browse through the projects on Collap on a single page in a list or something. <s><br/> <s>A category wise listing and searching of Projects will be even more useful. <s>', 9, 1, 0, 0, '2015-02-02 06:28:29', '2015-02-02 06:28:29'),
(465, 11, 30, 0, 0, 'WAP to find the minimum number of moves to convert a given string into all <r>H<r>s.', 'Given a string s of â€˜Hâ€™s and â€˜Tâ€™s denoting heads and tails, there are 2 possible moves at every point: <br/> <s> <s> <s> <s>a. Flipping a â€˜Tâ€™ by <s>â€˜Hâ€™ or â€˜Hâ€™ by â€˜Tâ€™ is a valid move <br/> <s> <s> <s> <s>b. Switching every character of a prefix of s, i.e., for any 1<a>lt;=m<a>lt;=n, replace all Hs with Ts and all Ts with Hs in s[1...m] is also valid. <br/> <s> <br/> <s>Find the min. no. of moves to convert a given string into all â€˜Hâ€™s. <br/> <s>eg: HHTH =<a>gt;flip 3rd position =<a>gt; HHHH <br/> <s>HTTT =<a>gt;(flip prefix) =<a>gt; THHH =<a>gt; HHHH <br/> <s>', 1, 1, 0, 0, '2015-02-02 09:30:53', '2015-02-02 09:30:52'),
(466, 11, 30, 181, 0, 'What would be output of these programs?', 'What is the output: Â  <br/> <s>Â Â  <s><br/> <s>Q1. <s><br/> <s>Â Â  Â  unsigned int x = -1; Â  <br/> <s>Â Â  Â  int y = ~0; Â  <br/> <s>Â Â  Â  printf(â€œ%u,%dâ€,x,)y; Â  <br/> <s>Â Â  Â  if(x==y) Â  <br/> <s>Â Â  Â  Â  Â  Â printf(â€œsameâ€); Â  <br/> <s>Â Â  Â  else Â  <br/> <s>Â Â  Â  Â  Â  printf(â€œnot sameâ€); Â  <br/> <s>Â Â  Â  <br/> <s>Â Â a. compilation error. Â  <br/> <s>Â Â b. 45â€¦.,-1 same Â  <br/> <s>Â Â c. 45â€¦.,-1 not same Â  <br/> <s>Â Â d. i donâ€™t remember <s><br/> <s>Â  <br/> <s>Q2. Â  <br/> <s>Â  int fun(int num) { Â  <br/> <s> <s> <s> <s> if(num<a>lt;3) <s><br/> <s> <s> <s> <s> <s> <s> <s> return 3; <s><br/> <s> <s> <s> <s> return num fun(num-2); Â  <br/> <s>Â  } <s><br/> <s>Â  main() { Â  <br/> <s> <s> <s> <s> int x=fun(12); <s><br/> <s> <s> <s> <s> int y=fun(13); <s><br/> <s> <s> <s> <s> printf(â€œ%d %dâ€,x,y); Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  <br/> <s>Â  }', 1, 1, 0, 0, '2015-02-02 09:38:54', '2015-02-02 10:04:44'),
(467, 11, 30, 0, 0, 'WAP and pseudo-code. An coding and algorithmic problem. <s>', 'With a specific color denoted by single character eg. for blue -â€˜Bâ€™. If one position is clicked (x,y), color present at that position would be deleted. If the same color is present in neighborhood <s>(up/down/left/right) then it would also be deleted. After deletion blank spaces will be replaced by the value present in the cell <s>above that. In case no value present above the1. <s><br/> <s>Given a 2D matrix. Each cell was filled cell then blank entry will be replaced by 0. <br/> <s> <br/> <s>Input (x:1 y:1) <s> <s> <s> <s> <s> Output <br/> <s> <s>B G B <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> B 0 0 <br/> <s> <s>B G G <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> B 0 B <br/> <s> <s>B B B <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> B B B <br/> <s> <br/> <s>WHAT SHOULD BE OUTPUT OF THIS ????? <br/> <s> <br/> <s> <s>B G B B <br/> <s> <s>B G G B <br/> <s> <s>G G B B <br/> <s> <s>B G G B', 1, 1, 0, 0, '2015-02-02 09:53:11', '2015-02-02 09:53:11'),
(468, 11, 0, 0, 0, 'How augmented reality will change sports and build empathy', '<iframe class="youtube" src="//www.youtube.com/embed/AgMOJC5R4F8 "frameborder="0" allowfullscreen ></iframe><br/> A video by Chris Kluwe. Chris wants to look into the future of sports and think about how technology will help not just players and coaches, but fans. Here the former NFL punter envisions a future in which augmented reality will help people experience sports as if they are directly on the field â€” and maybe even help them see others in a new light, too.', 8, 1, 1, 0, '2015-02-02 10:32:17', '2015-02-03 08:26:15'),
(469, 40, 0, 0, 0, 'Solveit, Galliv-Ant up the Pyramid: A Geometry problem.', '<img src="uploads/shruti/challengePic/2015-02-02_11:11:26am_pyramid_png.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> A right pyramid is having a square base ABCD of length 2 units. Its apex point E is such that the vertical height is 1 unit. An ant climbs up the surface from the point on the base A to the mid-point of slanted edge CE taking the shortest route. Â  <br/> <s>Â If the square of the distance traversed by the ant is given by a proper ratio m/n, <s><br/> <s>Â then what would be addition of m, <s>n ?', 3, 1, 0, 0, '2015-02-02 11:11:26', '2015-02-02 11:13:06'),
(470, 40, 0, 0, 0, 'Determine the sum of all non-coinciding primes p', 'A prime p is said to be non-coinciding if there exists a positive integer k such that no two powers of p have their rightmost k digits the same, in the same order. <br/> <s> <br/> <s>Determine the sum of all non-coinciding primes p.', 3, 1, 0, 0, '2015-02-02 11:16:50', '2015-02-02 11:16:50'),
