(472, 40, 0, 0, 0, 'Find out the value of p(0). A polynomial problem,,', 'A monic polynomial p(x) of degree 6 leaves the remainder:- <s><br/> <s>Â  <s><br/> <s>Â 3 when divided by x-1 <s><br/> <s>Â 9 when divided by x-2 <s><br/> <s>Â 19 when divided by x-3 <s><br/> <s>Â 33 when divided by x-4 <s><br/> <s>Â 51 when divided by x-5 <s><br/> <s>Â 73 when divided by x-6 <s><br/> <s>Â  <s><br/> <s>Â Find out the value of p(0)', 3, 1, 0, 0, '2015-02-02 11:40:19', '2015-02-02 11:40:56'),
