(474, 40, 17, 0, 0, 'Protecting the brain against concussion', '<iframe class="youtube" src="//www.youtube.com/embed/VC0taBVUF2o "frameborder="0" allowfullscreen ></iframe><br/> In a lively talk, neuropsychologist Kim Gorgens makes the case for better protecting our brains against the risk of concussion â€” with a compelling pitch for putting helmets on kids. <br/> <s>A video by Kim Gorgens - Neuropsychologist. <br/> <s>Know more about speaker: http://www.ted.com/speakers/kim_gorgens', 8, 1, 0, 0, '2015-02-02 11:56:51', '2015-02-02 14:56:12'),
(475, 8, 0, 0, 0, 'Fight more battle by new Rasberray Pi 2.', '<img src="uploads/rahul/articlePic/2015-02-03_03:44:32am_rasp3.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> The Raspberry Pi is a credit card-sized computer that makers can use to create smart devices for tasks such as home automation, gaming, or music. The newest version is a sizable improvement over its popular earlier version. It swaps out the single-core 700 MHz ARM processor for a more capable quad-core 900 MHz processor using the new ARMv7 instruction set. In layman<r>s terms, that means much better performance, as multiple cores can operate separate tasks in parallelâ€”and, in this case, at a faster speed. The new Raspberry Pi 2 also sports 1GB of RAM, doubling the previous version<r>s 512MB. And as any computer user will tell you, you can never have too much memory. But still this new version is 6 time faster the older version', 7, 1, 0, 0, '2015-02-03 03:44:32', '2015-02-03 03:44:32'),
