(479, 8, 2, 0, 0, 'Easy 4 steps to Install Redis.', '1. Setting up the system: <br/> <s> <s> <s> a. $sudo apt-get update <br/> <s> <s> <s> b. $sudo apt-get install build-essential <br/> <s> <s> <s> c. $sudo apt-get install tcl8.5 <br/> <s> <br/> <s>2. Making Redis. <br/> <s> <s> <s> a. $cd ~ <s><br/> <s> <s> <s> b. $wget http://download.redis.io/releases/redis-2.8.9.tar.gz <br/> <s> <s> <s> c. $tar xzf redis-2.8.9.tar.gz <br/> <s> <s> <s> d. $cd redis-2.8.9 <br/> <s> <s> <s> e. $make <br/> <s> <s> <s> f. $make test <br/> <s> <br/> <s>3. Installing and Checking Redis <br/> <s> <s> <s> a. $sudo make install <br/> <s> <s> <s> b. $cd utils <br/> <s> <s> <s> c. $sudo ./install_server.sh <br/> <s> <br/> <s> <s> <s> d. $sudo service redis_6379 start <br/> <s> <s> <s> e. $sudo service redis_6379 stop <br/> <s> <br/> <s>Cheerzzzzzz', 6, 1, 0, 0, '2015-02-03 10:01:20', '2015-02-03 10:01:18'),
