(498, 62, 15, 0, 0, 'Now, drones to click couples at weddings', '<iframe class="youtube" src="//www.youtube.com/embed/Q7fWrFo16Fo "frameborder="0" allowfullscreen ></iframe><br/> A number of couples are opting for these hovering copters to get the best shots on their special day. With Valentine<r>s Day approaching, and many marriages being planned around the time, the demand for drone cameras is at an all-time high. <s><br/> <s>As for the cost, charges for hiring a drone vary between Rs 12 to 15K. <a>quot;The drone is given a total of five flights in the entire duration of a marriage function. Each flight is for 10 minutes and the cost of five such flights usually comes to around Rs 15,000,<a>quot;.', 8, 1, 0, 0, '2015-02-04 07:02:22', '2015-02-04 07:02:21'),
