(538, 62, 0, 0, 0, 'The Magic Is in The Process: By Jane ni Dhulchaointigh', '<iframe class="youtube" src="//www.youtube.com/embed/NKjyXtLVs20 "frameborder="0" allowfullscreen ></iframe><br/> Inventor Jane ni Dhulchaointigh recounts the roller coaster journey from having a crazy idea about being able to hack everyday objects to the creation and launch of Sugru, an incredible self-setting rubber. Or, as Jane puts it: the six-year process of going from â€œhmmâ€ to â€œyayâ€ via â€œeurekaâ€ and â€œwow.â€ Her takeaway? Itâ€™s not about focusing on the end goal or product, itâ€™s about enjoying the beauty and the magic that happens in the process of creation.', 8, 1, 0, 0, '2015-02-07 22:26:55', '2015-02-07 22:26:55'),
