(551, 11, 0, 0, 0, 'Get it Done: How to be productive, check with infographic.', '<img src="uploads/rajnish/photoPic/2015-02-10_05:05:45am_35productive.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> You know those people who get so much done it seems like they have 30 hours in every day while the rest of us mere mortals have a measly 24? You know, the ones who seem to get more accomplished before breakfast than you do all day? <s><br/> <s>Â  <s><br/> <s>Â You can actually become one of them. For starters, spend one minute replying to each email â€“ max -- and donâ€™t feel compelled to respond to everything. Also, take a play from Steve Jobs, Hillary Clinton, President Obama and Mark Zuckerberg and wear the same thing every day. It saves time that you spend trying on different outfits every day, says Anna Vital, the co-founder of the San Francisco-based startup organization Funders and Founders <s><br/> ( http://anna.vc/post/64187007171/how-to-be-productive ) who compiled the tips and made the infographic in picture.', 3, 6, 1, 0, '2015-02-10 05:05:45', '2015-02-10 14:55:10'),
