(559, 7, 0, 0, 0, 'How many tiles are there to complete figure 3?', '<img src="uploads/anil/challengePic/2015-02-12_01:47:35pm_tile.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /> <br/> Figure 1 shows a tile in the form of a trapezium, where Î± = 83 .33 Â°. Several copies of the tile are placed together to form a symmetrical pattern, part of which is shown in Figure 2. The outer border of the complete pattern is a regular â€˜star polygonâ€™. Figure 3 shows an example of a regular â€˜star polygonâ€™. <s><br/> <s>Â  <s><br/> <s>Â How many tiles are there in the complete pattern? <s><br/> <s>Â A 48 <s><br/> <s>Â B 54 <s><br/> <s>Â C 60 <s><br/> <s>Â D 66 <s><br/> <s>Â E 72', 3, 1, 0, 0, '2015-02-11 13:46:14', '2015-02-12 13:47:35'),
