(563, 11, 30, 0, 0, 'How to compute factorial of 100 using a C/C   program?', 'Factorial of 100 has 158 digits. It is not possible to store these many digits even if we use long long int. Following is a simple solution where we use an array to store individual digits of the result. The idea is to use basic mathematics for multiplication. <br/> <s>This question is taken from http://www.geeksforgeeks.org/ <br/> <s>You can easily find answer to this question on internet by just google it. Just try to think, imagine and solve it.', 1, 1, 0, 0, '2015-02-11 16:56:49', '2015-02-11 16:56:48'),
(564, 11, 30, 0, 0, 'Find length of period in decimal value of 1/n: A mathematical algorithmic problem.', 'Given a positive integer n, find the period in decimal value of 1/n. Period in decimal value is number of digits (somewhere after decimal point) that keep repeating. <br/> <s> <br/> <s>Examples: <br/> <s> <br/> <s>Input: <s>n = 3 <br/> <s>Output: 1 <br/> <s>The value of 1/3 is 0.333333... <br/> <s> <br/> <s>Input: n = 7 <br/> <s>Output: 6 <br/> <s>The value of 1/7 is 0.142857142857142857..... <br/> <s> <br/> <s>Input: n = 210 <br/> <s>Output: 6 <br/> <s>The value of 1/210 is 0.0047619047619048.....', 1, 1, 0, 0, '2015-02-11 16:59:35', '2015-02-11 16:59:35'),
(565, 40, 30, 0, 0, 'Populate array for sorted order. Find combination.', 'We are given an array A with 8 distinct elements. Arrays B and C have 5 and 3 <s><br/> <s>Â elements respectively and they are populated with elements from A. (The union of <s><br/> <s>Â elements in B and C give the elements in A) <s><br/> <s>Â In how many ways can the arrays B <a>amp; C be populated such that both B and C have <s><br/> <s>Â elements in sorted (ascending) order. <s><br/> <s>Â  <s><br/> <s>Â Explain it: <s><br/> <s>Â a) 56 <s><br/> <s>Â b) 128 <s><br/> <s>Â c) 256 <s><br/> <s>Â d) None', 1, 1, 0, 0, '2015-02-11 17:03:48', '2015-02-11 17:04:13'),
(566, 7, 0, 0, 0, 'Find shortest distance covered by Rajnish if he walk all paths?? <s>', '<img src="uploads/anil/challengePic/2015-02-12_01:44:58pm_rajjowalk.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /> <br/> In park , 4 rows of 5 trees are linked by 31 paths. <br/> <s>Each path is 10 meters long. <s><br/> <s>When Rajnish starts walking, he likes to go along each path atleast once. <br/> <s>He can start walking from any tree and end at any tree. <br/> <s> <br/> <s>How long is the shortest route can Rajnish take?? ', 3, 1, 0, 0, '2015-02-11 17:04:20', '2015-02-12 13:44:59'),
