(568, 40, 0, 0, 0, 'The physics of popcorn: Watch the explosion in slow motion', '<iframe class="youtube" src="//www.youtube.com/embed/PnPKxzCxpY4 "frameborder="0" allowfullscreen ></iframe><br/> Uncovering the physics of popcorn -- what makes it pop, what makes it jump, and why it makes a sound <br/> <s>Itâ€™s one of the most dramatic transformations in science, and it happens in your microwave. <br/> <s>Most popcorn lovers take for granted that a simple kernel of corn can metamorphose into a fluffy treat. But to a pair of French researchers, the popping of corn presents a powerful demonstration of how the laws of physics apply to everything â€” even a snack food.', 8, 1, 0, 0, '2015-02-11 17:32:54', '2015-02-11 17:32:54'),
