(615, 62, 15, 0, 0, 'Cicret bracelet will turn your arm into a tablet', '<iframe class="youtube" src="//www.youtube.com/embed/9J7GpVQCfms "frameborder="0" allowfullscreen ></iframe><br/> The <r>Cicret<r> bracelet projects the screen of your smartphone directly onto your wrist. <br/> <s>A new Cicret bracelet can detect your gestures and projects a screen onto the skin, so you can take calls, check your emails, read books, all from your arm. <br/> <s>The device will be packed with an accelerometer and a vibration module, along with an LED for notifications. The device will support Wi-Fi, Bluetooth and a Micro USB port for connectivity. <br/> <s>Cicret is expected to hit the mass market in June 2015 and will be available in 16GB and 32GB models, costing upwards of $400 (Â£250, INR 25K). The company aims to raise the money for the device through crowdfunding and is asking users to donate directly through their website.', 8, 1, 0, 0, '2015-02-16 09:22:50', '2015-02-16 09:22:50'),
