(664, 40, 0, 0, 0, 'Combinatorics : Â Minimum Number Of Rooks ', 'Find the smallest positive integer k for which the following statement is true. <s><br/> <s> Â  <s><br/> <s> Â Suppose k rooks are placed on a 2014 x 2014 chessboard. Then, there must exist three rooks, call them r1, r2, r3, such that r1 attacks r2, r3, also attacks r2, but r1 doesn<r>t attack r3. <s><br/> <s> Â  <s><br/> <s> Â Details and assumptions: <s><br/> <s> Â  <s><br/> <s> Â Two rooks are said to attack each other if they lie on the same row or same column. <s><br/> <s> Â The k rooks are placed on distinct cells, i.e. a cell contains at most one rook. <s><br/> <s> Â The given condition must hold for any configuration of k rooks.', 3, 1, 0, 0, '2015-02-18 19:02:11', '2015-02-18 19:02:25'),
