(684, 40, 0, 0, 0, 'What is the probability that the person, chosen as the leader is a boy?', 'In a game there are 70 people in which 40 are boys and 30 are girls, out of which 10 people are selected at random. One from the total group, thus selected is selected as a leader at random. <s><br/> <s> <br/> <s>What is the probability that the person, chosen as the leader is a boy? <br/> <s> <br/> <s>a) 4/7 <br/> <s>b) 4/9 <br/> <s>c) 5/7 <br/> <s>d) 2/7', 3, 1, 0, 0, '2015-02-19 18:32:57', '2015-02-19 18:32:57'),
