(686, 40, 0, 0, 0, 'Solve it: How earlier than the usual time were they home on Tuesday?', 'Laila drives to the station each day to pick up her husband Majnu, who usually arrives on a train at 6oâ€™clock. Last Monday, Majnu finished work earlier, caught an earlier train and arrived at the station at 5 â€˜o clock. <s><br/> <s>He started to walk home and eventually met Laila who drove him the rest of the way, getting home 20 minutes earlier than usual. <s><br/> <s>On Tuesday, he again finished early and found himself at the station at 5:30. <s><br/> <s>Again he began to walk home, again he met Laila on the way, and she drove him home the rest of the way, Assume constant speed throughout with no wasted time for waiting, backing of the car etc. <s><br/> <s> <br/> <s>How earlier than the usual time were they home on Tuesday? <br/> <s> <br/> <s>a) 6 min <br/> <s>b) 8 min <br/> <s>c) 10 min <br/> <s>d) 12 min', 3, 1, 0, 0, '2015-02-19 18:37:46', '2015-02-19 18:37:46'),
(687, 40, 0, 282, 0, 'An Innovative Way to Harness Wind Power With a Tree', ' ', 8, 1, 0, 0, '2015-02-19 19:37:42', '2015-02-19 19:37:42'),
(688, 40, 0, 0, 0, 'The Current State of Medical Research is Unacceptable', '<iframe class="youtube" src="//www.youtube.com/embed/DdnY8rjlXlU "frameborder="0" allowfullscreen ></iframe><br/> By Michael Vassar: <br/> <s>Michael Vassar is co-founder and chief science officer of MetaMed Research, a medical consulting firm that conducts personalized medical research for clients. In this video interview, Vassar explains why the impetus for founding the company and dissects the many faults of modern medical research. Most notably, Vassar decries the fact that we have <a>quot;essentially banned the sort of research which has given us all of our successes in medicine from the entire history of medicine.<a>quot; Hospitals are factories, says Vassar, in which thinkers are instructed not to think, but to execute protocol. And that<r>s the opposite of progress. You can<r>t make important medical discoveries when you<r>re just pushing buttons.', 8, 1, 0, 0, '2015-02-19 19:42:27', '2015-02-19 19:42:27'),
(689, 62, 24, 283, 0, 'Google Capital set to open office in India', '', 6, 1, 0, 0, '2015-02-20 04:53:51', '2015-02-20 04:53:50'),
(690, 40, 0, 0, 0, 'First Look: The Rs. 4 lakh Tonino Lamborghini 88 Tauri smartphone', '<img src="uploads/shruti/articlePic/2015-02-20_05:26:13am_4lacks.jpeg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> Money may not be able to buy you happiness, but it sure can give you some exclusivity. Take the Tonino Lamborghini 88 Tauri for example, which costs a mere Rs. 4 lakhs, which is enough buy a car and still have plenty left over. It<r>s meant for a very exclusive section of society, that being those who have the money to buy it. The phone has specs to rival the most expensive flagships today and a price tag that will make them look very cheap. If that weren<r>t enough, the company is making only 1947 units of the phone, in honor of Antonio Lamborghini, son of the founder of Lamborghini, who was born in 1947. <br/> <s>So, without further ado, here<r>s what a phone worth Rs. 4 lakh looks like. <br/> <s>See more detail at: http://www.digit.in/slideshows/first-look-tonino-lamborghini-88-tauri-1.html', 7, 1, 0, 0, '2015-02-20 05:26:14', '2015-02-20 05:26:14'),
(691, 62, 27, 284, 0, 'Next-generation all-in-one smart gun for armed forces unveiled', '', 6, 1, 0, 0, '2015-02-20 05:40:06', '2015-02-20 05:40:06'),
(692, 11, 0, 0, 0, 'A Live Interaction Between Humans and Quadcopters', '<iframe class="youtube" src="//www.youtube.com/embed/6C8OJsHfmpI "frameborder="0" allowfullscreen ></iframe><br/> .', 8, 1, 0, 0, '2015-02-20 06:20:14', '2015-02-20 06:20:14'),
(693, 11, 0, 0, 0, 'SPARKED: Behind the Technology', '<iframe class="youtube" src="//www.youtube.com/embed/7YqUocVcyrE "frameborder="0" allowfullscreen ></iframe><br/> Get an exclusive look at the story behind the short film SPARKED: a collaboration between Cirque du Soleil, ETH Zurich, and Verity Studios. SPARKED demonstrates how state of-the-art technology can be used to combine human actors and quadcopters in a symbiotic, choreographed performance. This collaboration has opened a new door to the future of technology in the world of live entertainment.', 8, 1, 0, 0, '2015-02-20 06:21:14', '2015-02-20 06:21:14'),
(694, 11, 0, 0, 0, 'Crazy Engineering: Mars Helicopter', '<iframe class="youtube" src="//www.youtube.com/embed/vpBsFzjyRO8 "frameborder="0" allowfullscreen ></iframe><br/> By NASA Jet Propulsion Laboratory: JPL engineers are working on a small helicopter that could â€˜scoutâ€™ a trail for future Mars rovers, but getting a chopper that could fly in the Martian atmosphere is tricky.', 8, 1, 0, 0, '2015-02-20 06:25:57', '2015-02-20 06:25:57'),
(695, 11, 0, 0, 0, 'Introducing Spot: By Boston Dynamics, must watch it spot', '<iframe class="youtube" src="//www.youtube.com/embed/M8YjvHYbZ9w "frameborder="0" allowfullscreen ></iframe><br/> Spot is a four-legged robot designed for indoor and outdoor operation. It is electrically powered and hydraulically actuated. Spot has a sensor head that helps it navigate and negotiate rough terrain. Spot weighs about 160 lbs.', 8, 1, 0, 0, '2015-02-20 06:32:37', '2015-02-20 06:32:37'),
(696, 11, 69, 285, 0, 'Man of day: Paul A.M. Dirac: One of the fathers of quantum physics', '', 6, 1, 0, 0, '2015-02-20 08:38:59', '2015-02-20 08:38:59'),
(697, 7, 0, 0, 0, 'Find the probability ??', 'The probability of obtaining atleast two â€œSIXâ€ in throwing a fair dice 4 time is <s><br/> <s> Â  <s><br/> <s> Â 1. ( 425/ 432) <s><br/> <s> Â 2. ( 19/ 144) <s><br/> <s> Â 3. ( 13/ 144) <s><br/> <s> Â 4. ( 125/ 432)', 3, 1, 0, 0, '2015-02-20 09:10:12', '2015-02-20 09:52:56'),
(698, 7, 0, 0, 0, 'Find the Â stiffness ??', 'A precision instrument package (m = 1 kg) needs to be mounted on a surface vibrating at 60Hz. It is desired that only 5% of the base surface vibration amplitude be transmitted to the instrument. Assuming that the isolatio is designed with its natural frequency significantly lesser than 60 Hz, so that the effect of damping may be ignored. Â  <br/> <s> Â  <s><br/> <s> Â Find the Â stiffness Â (in N/m) of the required mounting pad ?', 3, 1, 0, 0, '2015-02-20 09:18:21', '2015-02-20 09:52:36'),
(699, 7, 0, 0, 0, 'Find the shear angle in the turning process ??', 'An orthogonal turning operation is carried out under the following conditions: <br/> <s>rake angle = 5Â°, <s><br/> <s>spindle rotational speed = 400 rpm; <s><br/> <s>axial feed = 0.4 m/min <br/> <s>and radial depth of cut = 5mm. <s><br/> <s>The chip thickness tc, is found to be 3 mm. <s> <br/> <s> <br/> <s>Find the shear angle in this turning process??', 3, 1, 0, 0, '2015-02-20 09:51:57', '2015-02-20 09:51:57'),
(700, 7, 0, 0, 0, 'Find the value of the one-way propagation delay ?? ', 'A link has a transmission speed of 10^6 bits/sec. It uses data packets of size 1000 bytes each. <br/> <s>Assume that the acknowledgement has negligible transmission delay, and that its propagation delay is the same as the data propagation delay. <s><br/> <s>Also assume that the processing delays at the nodes are negligible. The efficiency of the stop-and-wait protocol in this setup is exactly 25%. <br/> <s> <br/> <s>Find the value of the one-way propagation delay (in milliseconds) ?', 3, 1, 0, 0, '2015-02-20 09:57:35', '2015-02-20 09:57:35'),
(701, 62, 0, 286, 0, 'Ray<r>s Super remote: A universal remote that belongs in 2015', ' ', 7, 1, 0, 0, '2015-02-20 09:57:57', '2015-02-20 09:57:57'),
(702, 7, 0, 0, 0, 'Find the return value of function ??', ' Consider the following C function. <s><br/> <s> Â  <s><br/> <s> Â  int fun (int n) { <s><br/> <s> Â  Â  Â  Â  Â int x = 1, k; <s><br/> <s> Â  Â  Â  Â  Â if (n == 1) return x; <s><br/> <s> Â  Â  Â  Â  Â for (k = 1; k <a>lt; n; <an> <an> k) <s><br/> <s> Â  Â  Â  Â  Â  Â  Â  Â  x = x <an> fun (k) * fun (n - k) ; <s><br/> <s> Â  Â  Â  Â  Â  return x; <s><br/> <s> Â } <s><br/> <s> Â  <s><br/> <s> Â Find the return value of fun (5) ?', 3, 1, 0, 0, '2015-02-20 10:06:38', '2015-02-20 10:34:24'),
(703, 7, 0, 0, 0, ' Find the new weight of a minimum spanning tree ??', 'Let G be a connected undirected graph of 100 vertices and 300 edges. The weight of a minimum spanning tree of G is 500. When the weight of each edge of G is increased by five, find the new weight of a minimum spanning tree ? ', 3, 1, 0, 0, '2015-02-20 10:13:09', '2015-02-20 10:13:09'),
(704, 7, 0, 0, 0, 'Find the minimum size in bits of the sequence number field ??', ' Consider a network connected two systems located 8000 kilometers apart. The bandwidth of the network is 500 Ã— 10^6 bits per second. The propagation speed of the media is 4 Ã— 10^6 meters per second. It is needed to design a Go-Back-N sliding window protocol for this network. The average packet size is 10^7 bits. The network is to be used to its full capacity. Assume that processing delays at nodes are negligible. <s><br/> <s> Â  <s><br/> <s> Â Find the minimum size in bits of the sequence number field has to be ?', 3, 1, 0, 0, '2015-02-20 10:20:08', '2015-02-20 10:20:35'),
(705, 7, 0, 0, 0, 'Find the fourth octact ( in decimal ) of the last IP address ?? ', 'Find the fourth octact ( in decimal ) of the last IP address of the network ( 200.20.11.144/27 ) which can be assigned to a host ?', 3, 1, 0, 0, '2015-02-20 10:26:49', '2015-02-20 10:26:49'),
(706, 11, 70, 0, 0, 'India vs South Africa CWC15: Who will be winner?', '<img src="uploads/rajnish/projectnotesPic/2015-02-20_10:26:53am_India-vs-South-Africa.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> Wait wait wait, One more nail biting time. This time India v/s South Africa on 22 Feb. <s><br/> <s> Â  <s><br/> <s> Â India is consistent for making win against Pakistan in Cricket World Cup with 6-0. <s><br/> <s> Â  <s><br/> <s> Â What will do India against South Africa? <s><br/> <s> Â Would India shows his consistency with loss to South Africa in World Cup as like Pakistan. Or something other happens this time. <br/> <s> <br/> <s>Prediction: This should be an enthralling contest that could go right down to the wire, with the evidence of this World Cup so far suggesting whoever bats first could have a key advantage. But South Africaâ€™s batting may just be too strong for the Indian bowling attack. <br/> <s> <br/> <s>What you think, who will win this match and why? <br/> <s>India with batting or South Africa with Bowling?', 6, 1, 0, 0, '2015-02-20 10:26:53', '2015-02-20 10:30:55'),
(707, 7, 0, 0, 0, 'Find the number of times printf statement is executed ??', ' Consider the following C program <s><br/> <s>#inclue <a>lt; stdio.h <a>gt; <br/> <s>int main () { <br/> <s> <s> <s> int i, j, k = 0; <br/> <s> <s> <s> j = 2 * 3/4 <an> 2.0/5 <an> 8/5; <br/> <s> <s> <s> k - = -- j; <br/> <s> <s> <s> for ( i = 0; i <a>lt; 5; i <an><an>) { <br/> <s> <s> <s> <s> <s> <s> <s>Switch (i <an> k) { <br/> <s> <s> <s> <s> <s> <s> <s> <s> <s> case 1: <br/> <s> <s> <s> <s> <s> <s> <s> <s> <s> case 2 : printf ( <a>quot; n % d<a>quot;, i <an> k) <br/> <s> <s> <s> <s> <s> <s> <s> <s> <s> case 3 : printf (<a>quot; n % d<a>quot;, i <an> k ) ; <br/> <s> <s> <s> <s> <s> <s> <s> <s> <s> default : printf (<a>quot; n%d<a>quot;, i <an> k ) ; <br/> <s> <s> <s> <s> <s> <s> <s>} <br/> <s> <s> <s> <s> <s> <s>Return 0: <br/> <s> <s> <s> <s>} <br/> <s> <br/> <s>Find the number of times printf statement is executed ? <br/> <s>', 3, 3, 0, 0, '2015-02-20 10:43:27', '2015-02-20 10:43:27'),
(708, 7, 30, 0, 0, ' Find the number of times printf statement is executed ?? ', 'Consider the following C program <s> <br/> <s> #inclue <a>lt; stdio.h <a>gt; <br/> <s> int main () { <br/> <s> <s> <s> <s>int i, j, k = 0; <br/> <s> <s> <s> <s>j = 2 * 3/4 <an> 2.0/5 <an> 8/5; <br/> <s> <s> <s> <s>k - = -- j; <br/> <s> <s> <s> <s>for ( i = 0; i <a>lt; 5; i <an><an>) { <br/> <s> <s> <s> <s> <s> <s> <s> Switch (i <an> k) { <br/> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s>case 1: <br/> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s>case 2 : printf ( <a>quot; n % d<a>quot;, i <an> k) <br/> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s>case 3 : printf (<a>quot; n % d<a>quot;, i <an> k ) ; <br/> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s>default : printf (<a>quot; n%d<a>quot;, i <an> k ) ; <br/> <s> <s> <s> <s> <s> <s> <s> } <br/> <s> <s> <s> <s> <s> <s> <s> Return 0: <br/> <s> <s> <s> <s> } <br/> <s> <s><br/> <s> Find the number of times printf statement is executed ? ', 1, 2, 0, 0, '2015-02-20 10:46:06', '2015-02-20 11:56:06'),
(709, 7, 30, 0, 0, 'Find the lowest average turnaround time scheduling scheme ??', '<img src="uploads/anil/projectchalPic/2015-02-20_11:02:52am_process.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/>  <br/> <s>For the processes listed in the above table, which of the following scheduling schemes will the lowest average turnaround time? <s><br/> <s> <br/> <s> (A) First Come First Serve <br/> <s>(B) Non-preemptive Shortest Job First <br/> <s>(C) Shortest Remaining Time <br/> <s>(D) Round Robin with Quantum value two ', 1, 1, 0, 0, '2015-02-20 11:02:55', '2015-02-20 11:02:53'),
(710, 7, 2, 0, 0, 'Find the effective inductance ??', 'The self inductance of the primary winding of a single phase, 50 Hz, Â  <br/> <s> Â transformer is 800mH, Â  <br/> <s> Â and that of the secondary winding is 600 mH. Â  <br/> <s> Â The mutual inductance between these two windings is 480 mH. Â  <br/> <s> Â The secondary winding of this transformer is short circuited and the primary winding is connected to a 50 Hz, single phase, sinusoidal voltage source. Â  <br/> <s> Â The current flowing in both the winding is less than their respective rated currents. Â  <br/> <s> Â The resistance of both windings can be neglected. Â  <br/> <s> Â  <s><br/> <s> Â In this connection, what is the effective inductance (in mH) seen by the source ? <br/> <s>(A) 416 <br/> <s>(B) 440 <br/> <s>(C) 200 <br/> <s>(D) 920 ', 1, 1, 0, 0, '2015-02-20 11:17:23', '2015-02-20 11:19:00'),
(711, 7, 2, 0, 0, 'Find the output torque ??', 'A DC motor has the following specifications: Â  <br/> <s> Â 10 hp, Â  <br/> <s> Â 37.5 A, Â  <br/> <s> Â 230V ; Â  <br/> <s> Â flux/pole = 0.01 Wb, Â  <br/> <s> Â number of poles = 4, <s><br/> <s> Â number of conductors = 666, Â  <br/> <s> Â number of parallel paths = 2. Â  <br/> <s> Â Armature resistance = 0.267 ohm. Â  <br/> <s> Â The armature reaction is negligible and rotational losses are 600W. <s><br/> <s> Â The motor operates from a 230V DC supply. Â  <br/> <s> Â If the motor runs at 1000 rpm, <s><br/> <s> Â  find the output torque produced in (in Nm) ? ', 1, 1, 0, 0, '2015-02-20 11:28:14', '2015-02-20 11:32:50'),
(712, 7, 2, 0, 0, 'Find the contribution of T2 ??', 'Two single-phase transformers T1 and T2 each rated at 500 kVA are operated in parallel. <br/> <s>Percentage impedances of T1 and T2 are (1<an>j6) and (0.8<an>j4.8), respectively. <s><br/> <s>To share a load of 1000 kVA at 0.8 lagging power factor, <s><br/> <s>find the contribution of T2 (in kVA) ? ', 1, 1, 0, 0, '2015-02-20 11:31:37', '2015-02-20 11:31:36'),
(713, 7, 2, 0, 0, 'Find the value of equivalent load resistance ??', 'A 200/400V, 50 Hz, two-winding transformer is rated at 20 kVA. <s><br/> <s>Its windings are connected as an auto-transformer of rating 200/600V. <s><br/> <s>A resistive load of 12 ohm is connected to the high voltage (600V) side of the auto-transformer. <s><br/> <s> <br/> <s>Find the value of equivalent load resistance (in Ohm) as seen from low voltage side ?', 1, 1, 0, 0, '2015-02-20 11:36:35', '2015-02-20 11:36:34'),
(714, 7, 2, 0, 0, 'Find the full load armature current ??', 'A separately excited DC motor runs at 1000 rpm on no load when its armature terminals are connected to a 200V DC source and the rated voltage is applied to the field winding. <br/> <s>The armature resistance of this motor is 1 ohm . <s><br/> <s>The no-load armature current is negligible. <br/> <s>With the motor developing its full load torque, the armature voltage is set so that the rotor speed is 500 rpm. When the load torque is reduced to 50% of the full load value under the same armature voltage conditions, the speed rises to 520 rpm. <s><br/> <s> <br/> <s>Neglecting the rotational losses, find the full load armature current (in Ampere) ?', 1, 1, 0, 0, '2015-02-20 11:40:46', '2015-02-20 11:40:45'),
(715, 11, 2, 287, 0, 'Difference between API<r>s, Plug-In and Framework', '', 6, 1, 0, 0, '2015-02-20 11:43:38', '2015-02-20 11:43:38');
INSERT INTO `challenges` (`id`, `user_id`, `project_id`, `blob_id`, `org_id`, `title`, `stmt`, `type`, `status`, `likes`, `dislikes`, `creation_time`, `last_update_time`) VALUES
(716, 7, 2, 0, 0, 'Find the output of ADC ??', 'An 8 bit unipolar Successive Approximation Register type ADC is used to convert 3.5V to digital equal output. The reference voltage is <an>5V. <s><br/> <s> <br/> <s>Find the output of ADC at end of third clock pulse after the start of conversion ? <br/> <s>(A) 1010 0000 <br/> <s>(B) 1000 0000 <br/> <s>(C) 0000 0001 <br/> <s>(D) 0000 0011', 1, 1, 0, 0, '2015-02-20 11:44:37', '2015-02-20 11:44:36'),
(717, 7, 2, 0, 0, 'Find the ratio of equivalent horizontal and equivalent vertical permeability of the deposit ??', ' A non-homogenous oil deposit consists of a silt layer sandwiched between a fine-sand layer at top and a clay layer below. <s><br/> <s>Permeability of the silt layer is 10 times the permeability of the clay layer and one-tenth of the permeability of the sand layer. <s><br/> <s>Thickness of the silt layer is 2 time the thickness of the sand layer and two-third of the thickness of the clay layer. <s><br/> <s> <br/> <s>Find the ratio of equivalent horizontal and equivalent vertical permeability of the deposit ?', 1, 1, 0, 0, '2015-02-20 11:50:29', '2015-02-20 11:50:29'),
(718, 7, 2, 0, 0, 'Find the observed precipitation ??', 'In a catchment, there are four rain-gauge stations, P, Q, R, and S. <s><br/> <s>Normal annual precipitation values at these stations are 780 mm, 850 mm, 920 mm , and 980 mm, respectively. <s><br/> <s>In the year 2013, stations Q, R, and S, were operative but P was not. <s><br/> <s>Using the normal ratio method, the precipitation at station P for the year 2013 has been estimated as 860 mm. <s><br/> <s>If the observed precipitation at stations Q and R for the year 2013 were 930 mm and 1010 mm, respectively; <br/> <s>find the observed precipitation (in mm) at station S for that year? ', 1, 1, 0, 0, '2015-02-20 11:57:29', '2015-02-20 11:57:28'),
(719, 7, 2, 0, 0, 'Find the output frequency ??', 'The output frequency of an LC tank oscillator employing a capacitive sensor acting as the capacitor of the tank is 100 kHz. <s><br/> <s>If the sensor capacitance increases by 10%, what will be the output frequency in kilohertz ?', 1, 1, 0, 0, '2015-02-20 12:07:34', '2015-02-20 12:07:33'),
(720, 7, 2, 0, 0, 'Find the percentage changes in the hysteresis loss and eddy current loss ??', 'For a single phase, two winding transformer, the supply frequency and voltage are both increased by 10%. <s><br/> <s> <br/> <s>What will be the percentage changes in the hysteresis loss and eddy current loss, respectively ? <br/> <s>(A) 10 and 21 <s><br/> <s>(B) -10 and 21 <s><br/> <s>(C) 21 and 10 <s><br/> <s>(D) -21 and 10 ', 1, 1, 0, 0, '2015-02-20 12:20:29', '2015-02-20 12:20:28'),
(721, 11, 0, 288, 0, 'What it takes to Connect the developing world', ' ', 7, 1, 0, 0, '2015-02-20 14:35:22', '2015-02-20 14:35:22'),
(722, 7, 2, 0, 0, 'Find the reactive power (Q) in pu supplied by the generator <s>to the bus ??', 'A synchronous generator is connected to an infinite bus with excitation voltage Ef = 1.3 pu. <br/> <s>The generator has a synchronous reactance of 1.1 pu and is delivering real power (P) of 0.6 pu to the bus. Assume the infinite bus voltage to be 1.0 pu. <s><br/> <s>Neglect stator resistance. <s><br/> <s>What wil be the reactive power (Q) in pu supplied by the generator to the bus under this condition ? ', 1, 1, 0, 0, '2015-02-20 14:57:42', '2015-02-20 14:57:41'),
(723, 7, 2, 0, 0, 'What will be the frequency of the power system in Hz in the steady state??', ' There are two generators in a power system. <s><br/> <s>No-load frequencies of the generators are 51.5Hz and 51Hz, respectively, and both are having droop constant of 1 Hz/MW. <s><br/> <s>Total load in the system is 2.5 MW. <s><br/> <s>Assuming that the generators are operating under their respective droop characteristics, <br/> <s> what will be the frequency of the power system in Hz in the steady state?', 1, 1, 0, 0, '2015-02-20 15:02:49', '2015-02-20 15:02:48'),
(724, 7, 2, 0, 0, 'Find the capacitance to ground per kilometer of each line??', 'The horizontally placed conductors of a single phase line operating at 50 Hz are having outside diameter of 1.6 cm, and the spacing between centers of the conductors is 6 m. <s><br/> <s>The permittivity of free space is 8.854 x 10^(-12). <s><br/> <s> <br/> <s>The capacitance to ground per kilometer of each line is <br/> <s>A) 4.2 Ã— 10^(-9) F <s><br/> <s> B) 8.4 Ã— 10^(-9) F <s><br/> <s>(C) 4.2 Ã— 10^(-12) F <s><br/> <s>(D) 8.4 Ã— 10^(-12) F ', 1, 1, 0, 0, '2015-02-20 15:10:23', '2015-02-20 15:10:22'),
(725, 7, 2, 0, 0, 'Find the fault current in amperes??', 'A three phase, 100 MVA, 25 kV generator has solidly grounded neutral. <s><br/> <s>The positive, negative, and the zero sequence reactances of the generator are 0.2 pu, 0.2 pu, and 0.05 pu, <br/> <s>respectively, at the machine base quantities. <s><br/> <s> <br/> <s>If a bolted single phase to ground fault occurs at the terminal of the unloaded generator, <s><br/> <s>find the fault current in amperes immediately after the fault.', 1, 1, 0, 0, '2015-02-20 15:13:43', '2015-02-20 15:13:43'),
(726, 7, 2, 0, 0, 'What will be the tolerance of resistor??', 'Suppose that resistors R1 and R2 are connected in parallel to give an equivalent resistor R. <s><br/> <s>If resistors R1 and R2 have tolerance of 1% each., <s><br/> <s>what will be the tolerance of <s>equivalent resistor R for resistors R1 = 300 â„¦ and R2 = 200 â„¦ ? <br/> <s>(A) 0.5% <s><br/> <s>(B) 1% <s><br/> <s>(C) 1.2% <s><br/> <s>(D) 2%', 1, 1, 0, 0, '2015-02-20 15:24:06', '2015-02-20 15:24:05'),
(727, 7, 2, 0, 0, 'Find the current in amperes indicated in ammeter X ??', ' Two ammeters X and Y have resistances of 1.2 â„¦ and 1.5 â„¦ respectively and they give full scale deflection with 150 mA and 250 mA respectively. <s><br/> <s>The ranges have been extended by connecting shunts so as to give full scale deflection with 15 A. <s><br/> <s>The ammeters along with shunts are connected in parallel and then placed in a circuit in which the total current flowing is 15A. <s><br/> <s>Find the current in amperes indicated in ammeter X ?', 1, 1, 0, 0, '2015-02-20 15:28:58', '2015-02-20 15:28:57'),
(728, 7, 2, 0, 0, 'Find the maximum firing angle ??', 'A single-phase SCR based ac regulator is feeding power to a load consisting of 5 â„¦ resistance and 16 mH inductance. <s><br/> <s>The input supply is 230 V, 50 Hz ac. <s><br/> <s>The maximum firing angle at which the voltage across the device becomes zero all throughout and the rms value of current through SCR, <s><br/> <s>under this operating condition, are <s><br/> <s> (A) 30 degree and 46 A <s><br/> <s>(B) 30 degree and 23 A <s><br/> <s>(C) 45 degree and 23 A <s><br/> <s>(D) 45 degree and 32 A ', 1, 1, 0, 0, '2015-02-20 15:36:49', '2015-02-20 15:36:49'),
(729, 7, 0, 0, 0, 'Find the speed of vehicle stream on the road ??', 'A student riding a bicycle on a 5 km one-way street takes 40 minutes to reach home. <s><br/> <s>The student stopped for 15 minutes during this ride. <s><br/> <s>60 vehicles overtook the student (assume the number of vehicles overtaken by the student is zero ) during the ride and 45 vehicles while the student stopped. <s><br/> <s> <br/> <s>Find the speed of vehicle stream on that road (in km/hr) ? ', 3, 1, 0, 0, '2015-02-20 17:55:08', '2015-02-20 17:55:08'),
(730, 7, 0, 0, 0, 'Find the effective green time ??', 'A pre-timed four phase signal has critical lane flow rate for the first three phases as 200, 187 and 210 veh/hr with saturation flow rate of 1800 veh/hr/lane for all phases. <s><br/> <s>The lost time is given as 4 seconds for each phase. <s><br/> <s> <br/> <s>If the cycle length is 60 seconds, find the effective green time (in seconds) of the fourth phase?', 3, 1, 0, 0, '2015-02-20 17:57:35', '2015-02-20 17:57:35'),
