(751, 62, 0, 0, 0, 'This tiny device creates a 3D map showing where your Wi-Fi sucks', '<iframe class="youtube" src="//www.youtube.com/embed/aqqEYz38ens "frameborder="0" allowfullscreen ></iframe><br/> Using a Wi-Fi module, an LED, and a small battery pack, YouTube user CNLohr built a device that can measure the strength of a Wi-Fi network signal in all three dimensions and render out a color-coded map to show you where that network is strongest and weakest. <br/> <s>It<r>s not much to look at, but it works well enough to effectively troubleshoot dodgy spots in one<r>s own Wi-Fi network.', 8, 1, 0, 0, '2015-02-21 18:55:37', '2015-02-21 18:55:37'),
