(760, 62, 0, 0, 0, 'Scientists Have Designed a Literal <a>quot;Thinking Cap<a>quot;', '<iframe class="youtube" src="//www.youtube.com/embed/on4L-JdlE6M "frameborder="0" allowfullscreen ></iframe><br/> Many K-12 teachers suggest to students that they should â€œput your thinking caps on,â€ and one day, students might just do that for real. Vanderbilt University psychologist Geoffrey Woodman says thatâ€™s because scientists are being equipped with more and more tools they can use to better understand the brain, and now, they can even eavesdrop on individual neurons. <br/> <s> <br/> <s>Initial support from the National Science Foundation (NSF) allowed Woodman and his team at the Vanderbilt University Visual Cognitive Neuroscience Laboratory to study memory and perception. Then, the researchers tested their theory that electrical stimulation of the medial frontal cortex can boost learning and improve decision-making.', 8, 1, 0, 0, '2015-02-21 23:22:15', '2015-02-21 23:22:15'),
(761, 62, 0, 0, 0, 'The Future of One-on-One Education', '<iframe class="youtube" src="//www.youtube.com/embed/FcjIMNeaPVM "frameborder="0" allowfullscreen ></iframe><br/> It<r>s been proven that students taught by a personal tutor perform two standard deviations higher than those in a classroom. Luis von Ahn wants to replicate this effect with technology. He explains how Duolingo, the free language-learning app he helped create, continues to evolve in pursuit of that idea. <a>quot;We would like to make it so that everybody has access to the absolute best type of education, regardless of whether you<r>re wealthy or not. So we want to be as good as a one-on-one tutor.<a>quot;', 8, 1, 0, 0, '2015-02-21 23:24:45', '2015-02-21 23:24:45'),
