(764, 62, 0, 0, 0, 'Jolly Jam is Rovioâ€™s answer to Candy Crush Saga', '<iframe class="youtube" src="//www.youtube.com/embed/vsQsita4Q9o "frameborder="0" allowfullscreen ></iframe><br/> With the new Jolly Jam Android and iOS offering, Angry Birds-maker Rovio is looking to cash in on the match 3 genre of mobile gaming that has been popularized by Candy Crush Saga. <s><br/> <s>However it same to its competitors, among them is the new box mechanic which allows you to pop jellies by enclosing them in boxes. You also need to battle monsters in certain levels moreover. <s><br/> <s>Another things also there for enjoyment. These include combo attacks, power-ups and more. Jolly Jam has been laced with hundreds of levels, but thereâ€™s no word on whether new ones will ever be added to it or not.', 8, 1, 0, 0, '2015-02-22 05:56:02', '2015-02-22 05:56:02'),
(765, 62, 0, 0, 0, 'Motorola gets ready to launch expensive Moto Maxx smartphone in India', '<iframe class="youtube" src="//www.youtube.com/embed/26C_O6hDMjQ "frameborder="0" allowfullscreen ></iframe><br/> One of the most advanced smartphones out in the market right now is the Motorola Moto Maxx, and it seems all set to make an entry into India through the companyâ€™s trusted retail partner, Flipkart. <s><br/> <s>The words â€˜Turbochargedâ€™ and â€˜Ballistic Nylonâ€™ reflects with Moto Maxx give away the fact that itâ€™s indeed the Motorola Moto Maxx thatâ€™s being talked about. Thatâ€™s because the phone is called Droid Turbo in the US and its rear shell is made from ballistic nylon for added protection. <br/> <s>Check out complete specifications http://www.motorola.com/us/consumers/shop-all-mobile-phones/DROID-Maxx/m-droid-maxx.html', 8, 1, 0, 0, '2015-02-22 06:03:38', '2015-02-22 06:03:38'),
(766, 7, 30, 0, 0, 'Find the latency of retrieving a cache block starting at address zero from main memory ??', ' <s>A CPU has a cache with block size 64 bytes. Â  <br/> <s> Â The main memory has k banks, each bank being c bytes wide. Â  <br/> <s> Â Consecutive câˆ’byte chunks are mapped on consecutive banks with wrap-around. Â  <br/> <s> Â All the k banks can be accessed in parallel, but two accesses to the same bank must be serialized. Â  <br/> <s> Â A cache block access may involve multiple iterations of parallel bank accesses depending on the amount of data obtained by accessing all the k banks in parallel. Â  <br/> <s> Â Each iteration requires decoding the bank numbers to be accessed in parallel and this takes k/2 ns . <s><br/> <s> Â The latency of one bank access is 80 ns. Â  <br/> <s> Â If c = 2 and k = 24, the latency of retrieving a cache block starting at address zero from main memory is: Â  <br/> <s> Â (A) 92 ns <s><br/> <s> Â (B) 104 ns <s><br/> <s> Â (C) 172 ns Â  <br/> <s> Â (D) 184 ns', 1, 1, 0, 0, '2015-02-22 06:15:47', '2015-02-22 06:16:52'),
(767, 7, 30, 0, 0, 'Find the total execution time of the program??', ' CPU has a five-stage pipeline and runs at 1 GHz frequency. <s><br/> <s>Instruction fetch happens in the first stage of the pipeline. <s><br/> <s>A conditional branch instruction computes the target address and evaluates the condition in the third stage of the pipeline. <s><br/> <s>The processor stops fetching new instructions following a conditional branch until the branch outcome is known. <s><br/> <s>A program executes 10^9 instructions out of which 20% are conditional branches. <s><br/> <s>If each instruction takes one cycle to complete on average, <s><br/> <s>the total execution time of the program is: <s><br/> <s>(A) 1.0 second <br/> <s>(B) 1.2 seconds <br/> <s>(C) 1.4 seconds <br/> <s>(D) 1.6 seconds <s>', 1, 1, 0, 0, '2015-02-22 06:20:45', '2015-02-22 06:20:44'),
(768, 11, 70, 0, 0, 'Wonderkid Martin Odegaard scores his first goal for Real Madrid', '<iframe class="youtube" src="//www.youtube.com/embed/JpibqIF0SQ0 "frameborder="0" allowfullscreen ></iframe><br/> The 16-year-old has scored his first for Real Madridâ€™s B-team after he had earlier provided two assists in a friendly after joining the Galacticos this winter. <br/> <s>Martin Odegaardâ€™s goal came against Barakaldo during Castillaâ€™s Segunda Division B match against Barakaldo at the Alfredo di StÃ©fano Stadium and was his teamâ€™s first goal in the match as he slotted the ball inside the net following some good work from striker RaÃºl de TomÃ¡s.', 8, 1, 0, 0, '2015-02-22 07:41:18', '2015-02-22 07:41:18'),
(769, 7, 30, 0, 0, 'Find <s>the number of packets <s>transmit for sending ??', 'Station A needs to send a message consisting of 9 packets to Station B using a sliding window (window size 3) and go-back-n error control strategy. <s><br/> <s>All packets are ready and immediately available for transmission. <s><br/> <s>If every 5th packet that A transmits gets lost (but no acks from B ever get lost), <s><br/> <s>then what is the number of packets that A will transmit for sending the message to B? <s><br/> <s>(A) 12 <br/> <s>(B) 14 <br/> <s>(C) 16 <br/> <s>(D) 18 ', 1, 1, 0, 0, '2015-02-22 07:44:10', '2015-02-22 07:44:09'),
(770, 7, 30, 0, 0, 'Find which statements is true??', 'Two computers C1 and C2 are configured as follows. <s><br/> <s>C1 has IP address 203.197.2.53 and netmask 255.255.128.0. <s><br/> <s>C2 has IP address 203.197.75.201 and netmask 255.255.192.0. <s><br/> <s>which one of the following statements is true? <br/> <s>(A) C1 and C2 both assume they are on the same net work <br/> <s>(B) C2 assumes C1 is on same network, but C1 assum es C2 is on a different network <br/> <s>(C) C1 assumes C2 is on same network, but C2 assumes C1 is on a different network <br/> <s>(D) C1 and C2 both assume they are on different networks. <s>', 1, 1, 0, 0, '2015-02-22 07:55:31', '2015-02-22 07:55:30'),
(771, 7, 30, 0, 0, 'What is the optimal window size that A should use?? ', 'Station A uses 32 byte packets to transmit messages to Station B using a sliding window protocol. <s><br/> <s>The round trip delay between A and B is 80 milliseconds and the bottleneck bandwidth on the path between A and B is 128 kbps. <s><br/> <s>What is the optimal window size that A should use? <s><br/> <s>(A) 20 <br/> <s>(B) 40 <br/> <s>(C) 160 <br/> <s>(D) 320', 1, 1, 0, 0, '2015-02-22 08:04:12', '2015-02-22 08:04:11'),
