(775, 7, 30, 0, 0, 'Find the minimum size of the TLB tag ??', ' CPU generates 32-bit virtual addresses. The page size is 4 KB. <s><br/> <s>The processor has a translation look-aside buffer (TLB) which can hold a total of 128 page table entries and is 4-way set associative. <s><br/> <s>Find the minimum size of the TLB tag?', 1, 1, 0, 0, '2015-02-22 08:39:30', '2015-02-22 08:39:29'),
(776, 7, 30, 0, 0, ' <s> For what percentage of time does the CPU remain idle??', 'Consider three processes, all arriving at time zero, with total execution time of 10, 20 and 30 units, respectively. <s><br/> <s>Each process spends the first 20% of execution time doing I/O, the next 70% of time doing computation, and the last 10% of time doing I/O again. <s><br/> <s>The operating system uses a shortest remaining compute time first scheduling algorithm and schedules a new process either when the running process gets blocked on I/O or when the running process finishes its <br/> <s>compute burst. <s><br/> <s>Assume that all I/O operations can be overlapped as much as possible. <s><br/> <s> <br/> <s>For what percentage of time does the CPU remain idle? ', 1, 1, 0, 0, '2015-02-22 08:44:09', '2015-02-22 08:44:08'),
(777, 7, 30, 0, 0, 'Which one of the following is false??', 'Consider the following C code segment. <br/> <s> <s> for (i â€“ 0, i<a>lt;n; i<an><an>) { <br/> <s> <s> <s> <s> <s> <s>for (j=0; j<a>lt;n; j<an><an>) { <br/> <s> <s> <s> <s> <s> <s> <s> <s> <s> if (i%2) { <br/> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s>x <an>= (4*j <an> 5*i); <br/> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s> <s>y <an>= (7 <an> 4*j); <s><br/> <s> <s> <s> <s> <s> <s> <s> <s> <s> } <br/> <s> <s> <s> <s> <s> <s>} <br/> <s> <s> <s> } <br/> <s>Which one of the following is false? <br/> <s>(A) The code contains loop invariant computation <br/> <s>(B) There is scope of common sub-expression elimination in this code <br/> <s>(C) There is scope of strength reduction in this code <br/> <s>(D) There is scope of dead code elimination in this code ', 1, 1, 0, 0, '2015-02-22 08:50:00', '2015-02-22 08:49:59'),
(778, 7, 30, 0, 0, 'Find the average turn around time??', 'Consider three processes (process id 0, 1, 2 respectively) with compute time bursts 2, 4 and 8 time units. <s><br/> <s>All processes arrive at time zero. <s><br/> <s>Consider the longest remaining time first (LRTF) scheduling algorithm. <s><br/> <s>In LRTF ties are broken by giving priority to the process with the lowest process id. <s><br/> <s>Find the average turn around time?', 1, 1, 0, 0, '2015-02-22 08:53:10', '2015-02-22 08:53:09'),
(779, 11, 17, 0, 0, 'Programming your mind for success | Carrie Green', '<iframe class="youtube" src="//www.youtube.com/embed/MmfikLimeQ8 "frameborder="0" allowfullscreen ></iframe><br/> Carrie Green started her first online business at the age of 20, whilst studying Law at the University of Birmingham. Within a few years she took the business global, selling throughout the UK, USA, Canada, Australia and Europe and receiving over 100,000 hits on the website every month. In 2011 Carrie launched the Female Entrepreneur Association as a way to help inspire and connect female entrepreneurs from around the world. The network has grown to over 140,000 women and they now produce a digital magazine, This Girl Means Business, weekly videos, free online classes and more.', 8, 1, 0, 0, '2015-02-22 08:59:35', '2015-02-22 08:59:34'),
(780, 11, 30, 0, 0, 'Gayle Laakmann McDowell - Cracking the Coding Interview', '<iframe class="youtube" src="//www.youtube.com/embed/rEJzOhC5ZtQ "frameborder="0" allowfullscreen ></iframe><br/> Gayle Laakmann McDowell is the founder and CEO of CareerCup.com, a site offering thousands of programming interview questions as well as interview videos, resume review, and mock interviews. Gayleâ€™s first book, Cracking the Coding Interview, is the #1 book for preparing for software engineering interviews. Her second book, The Google Resume, is the leading book offering candidates a start-to-end guide at how to land a job at a top tech company. <br/> <s>Gayle has worked as a Software Engineer for Google, Microsoft and Apple and has extensive interviewing experience on both sides of the table. She was a member of Google<r>s Engineering Hiring Committee and has interviewed over 150 candidates at Google. Gayle holds a BSE and MSE from the University of Pennsylvania in Computer Science, and an MBA from the Wharton School.', 8, 1, 0, 0, '2015-02-22 09:06:00', '2015-02-22 09:05:59'),
(781, 11, 30, 303, 0, '15 Pieces of Career Advice Software Developers Should Follow', '', 6, 1, 0, 0, '2015-02-22 09:16:51', '2015-02-22 09:16:51'),
(782, 7, 20, 0, 0, 'Apply KIRCHOFF`s law <s>in this', '<img src="uploads/anil/projectnotesPic/2015-02-22_11:10:49am_krrichoff.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> .', 6, 1, 0, 0, '2015-02-22 11:10:50', '2015-02-22 11:10:49'),
(783, 62, 69, 0, 0, 'Princess of the day: Patricia Arquette Wins Oscar', '<img src="uploads/mridula/projectnotesPic/2015-02-23_05:09:27am_patricia-arquette-1-1024.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> Patricia Arquette spiced things up a bit when she won the Oscar for Best Supporting Actress for her role in <a>quot;Boyhood,<a>quot; a movie shot over a 12-year span. <br/> <s> <br/> <s>Bleeped for a curse word early in her acceptance speech, Arquette thanked everyone from friends and family and cast to her favorite painter, before getting political. Arquette dedicated her win to <a>quot;to every woman who gave birth,<a>quot; saying <a>quot;it<r>s our time to have wage equality once and for all and equal rights for women in the United States of America.<a>quot; <br/> <s>Check here list of all winners: http://oscar.go.com/nominees', 6, 1, 0, 0, '2015-02-23 05:09:28', '2015-02-23 05:09:27'),
(784, 40, 0, 304, 0, 'Having the <a>quot;Smart Gene<a>quot; is related to longevity and increased brain function', ' ', 7, 1, 0, 0, '2015-02-23 06:15:35', '2015-02-23 06:15:35'),
(785, 11, 0, 0, 0, 'Sleep Deprivation Can Be A Dangerous Thing â€“ Find Out Why', '<img src="uploads/rajnish/articlePic/2015-02-23_06:23:23am_sleepdp.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> People arenâ€™t sleeping enough anymore. That much is clear. <s><br/> <s> Â  <s><br/> <s> Â Most people in the west live a hurried lifestyle, which tends to deprive us of sleep. But the negative effects of sleep deprivation or more than just tiredness. <s><br/> <s> Â  <s><br/> <s> Â It can ruin your entire day! <s><br/> <s> Â  <s><br/> <s> Â Check out the infographic below to see exactly how sleep deprivation can be harmful to your health, and why you should really make the time to catch those Zâ€™s. http://www.iheartintelligence.com/2014/10/10/sleep-deprivation-can-dangerous-thing-find/', 7, 1, 0, 0, '2015-02-23 06:23:24', '2015-02-23 06:23:50'),
(786, 40, 17, 0, 0, 'How your brain reacts to texting and driving', '<iframe class="youtube" src="//www.youtube.com/embed/JQKELDNnzUQ "frameborder="0" allowfullscreen ></iframe><br/> We all know itâ€™s bad to multitask while driving, but why? <br/> <s> <br/> <s>You probably think you are quite good at multitasking and you probably are. You can walk and eat, and mop the floor, dance and sing or even run on the treadmill and watch TV. Those particular things are okay to multitask, because they do not require a lot of brainpower. <br/> <s> <br/> <s>Unfortunately, when it comes to tasks that require more attention there is a higher probability for our brains to let us down. When youâ€™re doing two dissimilar activities each one demanding a significant amount of focus, multitasking breaks down. Your gray matter <s>just canâ€™t process two separate streams of information going on at the same time and run them trough your short-term memory. <br/> <s> <br/> <s>Driving is an activity that requires a very high attention-span.', 8, 1, 0, 0, '2015-02-23 06:29:22', '2015-02-23 06:29:22'),
(787, 7, 2, 0, 0, 'What will be the average bit rate ??', 'A source generates three symbols with probabilities 0.25, 0.25, 0.50 at a rate of 3000 symbols per second. Assuming independent generation of symbols, the most efficient source encoder would have average bit rate as <s><br/> <s>(A) 6000 bits/sec <br/> <s>(B) 4500 bits/sec <br/> <s>(C) 3000 bits/sec <br/> <s>(D) 1500 bits/sec ', 1, 1, 0, 0, '2015-02-23 07:28:30', '2015-02-23 07:28:29'),
(788, 7, 2, 0, 0, 'Find the radiation resistance of the antenna in Ohms??', 'A mast antenna consisting of a 50 meter long vertical conductor operates over a perfectly conducting ground plane. <s><br/> <s>It is base-fed at a frequency of 600 kHz. <s><br/> <s>The radiation resistance of the antenna in Ohms is: <s><br/> <s> (A) 2(Ï€^2)/5 <br/> <s>(B) (Ï€^2)/5 <br/> <s>(C) 4(Ï€^2)/5 <br/> <s>(D) 20(Ï€^2)', 1, 1, 0, 0, '2015-02-23 07:36:17', '2015-02-23 07:36:16'),
(789, 7, 2, 0, 0, ' Find the load resistance and steady-state current through the load resistance ??', 'A 30-Volts battery with zero source resistance is connected to a coaxial line of characteristic impedance of 50 Ohms at t = 0 second terminated in an unknown resistive load. <s><br/> <s>The line length is that it takes 400 Î¼s for an electromagnetic wave to travel from source end to load end and vice-versa. <s><br/> <s>At t = 400Î¼s the voltage at the load end is found to be 40 Volts. <s><br/> <s>Find the load resistance and steady-state current through the load resistance?', 1, 1, 0, 0, '2015-02-23 07:41:16', '2015-02-23 07:41:16'),
(790, 7, 2, 0, 0, 'Find value of outside radius of the friction lining ??', 'A disk clutch is required to transmit 5 kW at 2000 rpm. <s><br/> <s>The disk has a friction lining with coefficient of friction equal to 0.25. <br/> <s>Bore radius of friction lining is equal to 25 mm. <s><br/> <s>Assume uniform contact pressure of 1 MPa. <s><br/> <s>The value of outside radius of the friction lining is: <s><br/> <s>(A) 39.4 mm <br/> <s>(B) 49.5 mm <br/> <s>(C) 97.9 mm <s><br/> <s>(D) 142.9 mm ', 1, 1, 0, 0, '2015-02-23 07:50:06', '2015-02-23 07:50:05'),
(791, 7, 2, 0, 0, 'What will be estimated life of shaft ??', ' A cylindrical shaft is subjected to an alternating stress of 100 MPa. <s><br/> <s>Fatigue strength to sustain 1000 cycle is 490 MPa. <s><br/> <s>If the corrected endurance strength is 70 MPa, <s><br/> <s>estimated shaft life will be <br/> <s>(A) 1071 cycles <br/> <s>(B) 15000 cycles <br/> <s>(C) 281914 cycles <br/> <s>(D) 928643 cycles ', 1, 1, 0, 0, '2015-02-23 07:53:22', '2015-02-23 07:53:21'),
(792, 7, 2, 0, 0, 'Find the elongation of the bar ??', ' A steel bar of 40 mm Ã— 40 mm square cross-section is subjected to an axial compressive load of 200 kN. <s><br/> <s>If the length of the bar is 2m and E = 200 GPa, <s><br/> <s>the elongation of the bar will be: <br/> <s>(A) 1.25 mm <br/> <s>(B) 2.70 mm <br/> <s>(C) 4.05 mm <br/> <s>(D) 5.40 mm ', 1, 1, 0, 0, '2015-02-23 07:55:34', '2015-02-23 07:55:33'),
(793, 7, 2, 0, 0, 'Find the partial derivatives of total potential energy ??', ' If a system is in equilibrium and the position of the system depends upon many independent variables, the principle of virtual work states that the partial derivatives of its total potential energy with respect to each of the independent variable must be <br/> <s>(A) -1.0 <br/> <s>(B) 0 <br/> <s>(C) 1.0 <br/> <s>(D) âˆž', 1, 1, 0, 0, '2015-02-23 07:58:23', '2015-02-23 07:58:22'),
(794, 7, 2, 0, 0, 'Find the <s>transmissibility ratio ??', 'A machine of 250 kg mass is supported on springs of total stiffness 100 kN/m. <br/> <s>Machine has an unbalanced rotating force of 350 N at speed of 3600 rpm. <br/> <s>Assuming a damping factor of 0.15, the value of transmissibility ratio is: <br/> <s>(A) 0.0531 <br/> <s>(B) 0.9922 <br/> <s>(C) 0.0162 <br/> <s>(D) 0.0028 ', 1, 1, 0, 0, '2015-02-23 08:00:15', '2015-02-23 08:00:14'),
(795, 7, 2, 0, 0, 'Find the minimum possible thickness of the sheet that can be produced in a single pass ??', 'A 4 mm thick sheet is rolled with 300 mm diameter rolls to reduce thickness without any change in its width. The friction coefficient at the work-roll interface is 0.1. <s><br/> <s>The minimum possible thickness of the sheet that can be produced in a single pass is: <br/> <s>(A) 1.0 mm <br/> <s>(B) 1.5 mm <br/> <s>(C) 2.5 mm <br/> <s>(D) 3.7 mm ', 1, 1, 0, 0, '2015-02-23 08:07:15', '2015-02-23 08:07:14'),
(796, 7, 2, 0, 0, 'What will be the net heat input (in J/mm) ??', 'In an arc welding process, the voltage and current are 25 V and 300 A respectively. <s><br/> <s>The arc heat transfer efficiency is 0.85 and welding speed is 8mm/sec. <s><br/> <s>the net heat input (in J/mm) is: <br/> <s>(A) 64 <br/> <s>(B) 797 <br/> <s>(C) 1103 <br/> <s>(D) 79700 ', 1, 1, 0, 0, '2015-02-23 08:11:30', '2015-02-23 08:11:30'),
(797, 7, 2, 0, 0, ' What will be the value of critical damping of the system and the value of logarithmic decrement ??', 'A vibratory system consists of a mass 12.5 kg, a spring of stiffness 1000 N/m, and a dashpot with damping coefficient of 15 Ns/m. <s><br/> <s>What will be the value of critical damping of the system and the value of logarithmic decrement ?', 1, 1, 0, 0, '2015-02-23 08:15:05', '2015-02-23 08:15:04'),
(798, 7, 2, 0, 0, 'What will be the power generated by the model ??', 'A large hydraulic turbine is to generate 300 kW at 1000 rpm under a head of 40m. <s><br/> <s>For initial testing, a 1:4 scale model of the turbine operates under a head of 10 m. <s><br/> <s>The power generated by the model (in kW) will be <br/> <s>(A) 2.34 <br/> <s>(B) 4.68 <br/> <s>(C) 9.38 <br/> <s>(D) 18.75 ', 1, 1, 0, 0, '2015-02-23 08:19:30', '2015-02-23 08:19:29'),
(799, 11, 70, 0, 0, 'Incredible Goal: Ecuador winger scores winning goal from half-way line', '<iframe class="youtube" src="//www.youtube.com/embed/uep45NvKoZo "frameborder="0" allowfullscreen ></iframe><br/> Christian Marquez of Ecuadorian club El Nacional scored a sensational match-winning goal during their 2-1 win against Barcelona SC that left fans and pundits alike in awe. <br/> <s>And why wouldnâ€™t it? What separates the goal from the rest is the lengthy distance that it travels to get into the net. After winning the ball from the oppositionâ€™s half, Marquez unleashed a shot from 50-yards-out, as the ball flew over the keeper, giving his team the much-needed winning goal in the 92nd minute of the match.', 8, 1, 0, 0, '2015-02-23 08:37:28', '2015-02-23 08:37:28'),
(800, 7, 20, 0, 0, 'Pulling a lion by it<r>s feet ??', '<img src="uploads/anil/projectnotesPic/2015-02-23_08:39:07am_dd.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> .', 6, 1, 0, 0, '2015-02-23 08:39:08', '2015-02-23 08:39:08'),
(801, 7, 2, 0, 0, 'Find the force on rods ??', ' A rigid bar is suspended by three rods made of the same material. <s><br/> <s>The area and length of the central rod are 3A and L, respectively while that of the two outer rods are 2A and 2L respectively. <s><br/> <s>If a downward force of 50kN is applied to the rigid bar, <s><br/> <s>the forces in the centraland each of the outer rods will be <br/> <s>(A) 16.67 kN each <s><br/> <s>(B) 30kN and 15kN <br/> <s>(C) 30kN and 10kN <s><br/> <s>(D) 21.4kN and 14.3kN ', 1, 1, 0, 0, '2015-02-23 09:54:44', '2015-02-23 09:54:43'),
(802, 7, 2, 0, 0, 'Find the stresses at the top and bottom fibres of the section ??', ' A concrete beam of rectangular cross-section of size 120mm (width) <s><br/> <s>and 200mm (depth) is prestressed by a straight tendon to an effective force of 150kN <s><br/> <s>at an eccentricity of 20mm (below the centroidal axis in the depth direction). <s><br/> <s> <br/> <s>Find the stresses at the top and bottom fibres of the section ?', 1, 1, 0, 0, '2015-02-23 09:59:46', '2015-02-23 09:59:45'),
(803, 7, 2, 0, 0, 'Find the classification of soil ??', ' Sieve analysis on a dry soil sample of mass 1000g showed that <br/> <s> 980g and 270g of soil pass through 4.75mm and 0.075mm sieve, respectively. <s><br/> <s>The liquid limit and plastic limits of the soil fraction passing through 425Î¼ <br/> <s>sieves are 40% and 18% respectively. <s><br/> <s> <br/> <s>The soil may be classified as <br/> <s>(A) SC <s><br/> <s>(B) MI <s><br/> <s>(C) CI <s><br/> <s>(D) SM ', 1, 1, 0, 0, '2015-02-23 10:03:26', '2015-02-23 10:03:25'),
(804, 7, 2, 0, 0, 'Find the length of long chord and mid-ordinates in metres of the curve ??', ' Two straight lines intersect at an angle of 60. <br/> <s> The radius of a curve joining the two straight lines is 600m. <s><br/> <s>The length of long chord and mid-ordinates in metres of the curve are <br/> <s>(A) 80.4, 600.00 <s><br/> <s>(B) 600.0, 80.4 <s><br/> <s>(C) 600.0, 39.89 <s><br/> <s>(D) 40, 89,300 ', 1, 1, 0, 0, '2015-02-23 13:40:35', '2015-02-23 13:40:34'),
(805, 7, 2, 0, 0, 'Find the limiting value of the moment of resistance and limiting area of tension steel ??', 'A singly reinforced rectangular concrete beam has a width of 150mm <s><br/> <s>and an effective depth of 330mm. <s><br/> <s>The characteristic compressive strength of concrete is 20 MPa. <s><br/> <s>Adopt the stress block for concrete as given in IS 456-2000 <s><br/> <s>and take limiting value of depth of neutral axis as 0.48 times the effective depth of the beam. <s><br/> <s>Find the limiting value of the moment of resistance of the beam is kN.m <s><br/> <s>and limiting area of tension steel ?', 1, 1, 0, 0, '2015-02-23 13:46:29', '2015-02-23 13:46:29'),
(806, 7, 0, 0, 0, 'Find the probability ??', 'A person on a trip has a choice between private car and public transport. <s><br/> <s>The probability of using a private car is 0.45. <s><br/> <s>While using the public transport, further choices available are bus and metro, <s><br/> <s>out of which the probability of commuting by a bus is 0.55. <s><br/> <s> <br/> <s>In such a situation, the probability (rounded up to two decimals) <br/> <s>of using a car, bus and metro, respectively would be <br/> <s> <br/> <s>(A) 0.45, 0.30 and 0.25 <s><br/> <s>(B) 0.45, 0.25 and 0.30 <br/> <s>(C) 0.45, 0.55 and 0.00 <s><br/> <s>(D) 0.45, 0.35 and 0.20 ', 3, 1, 0, 0, '2015-02-23 13:51:26', '2015-02-23 13:51:26'),
(807, 7, 2, 0, 0, 'Find the design moment ??', ' Un-factored maximum bending moments at a section of a reinforced concrete <s><br/> <s> Â beam resulting from a frame analysis are 50, 80, 120 and 180kNm under dead, <s><br/> <s> Â live, wind and earthquake loads respectively. Â  <br/> <s> Â The design moment (kNm) as per IS: 456- 2000 for the limit state of collapse (flexure) is <s><br/> <s> Â (A) 195 Â  <br/> <s> Â (B) 250 Â  <br/> <s> Â (C) 345 Â  <br/> <s> Â (D) 372 ', 1, 1, 0, 0, '2015-02-23 13:55:40', '2015-02-24 12:38:06'),
(808, 7, 2, 0, 0, 'Find the discharge <s>requird??', ' An outlet irrigates an area of 20ha. <s><br/> <s>The discharge (I/s) required at this outlet to meet the evapotranspiration requirement of 20mm occurring uniformly in 20 days neglecting other field losses is <br/> <s>(A) 2.52 <s><br/> <s>(B) 2.31 <s><br/> <s>(C) 2.01 <s><br/> <s>(D) 1.52 ', 1, 1, 0, 0, '2015-02-23 14:05:58', '2015-02-23 14:05:58'),
(809, 7, 2, 0, 0, 'Find the cumulative standard axles ??', ' It is proposed to widen and strengthen an existing 2-lane NH section as a divided highway. <s><br/> <s>The existing traffic in one direction is 2500 commercial vehicles (CV) per day. <br/> <s> The construction will take 1 year. <s><br/> <s>The design CBR of soil subgrade is found to be 5 percent. <s><br/> <s>Given: traffic growth rate for CV = 8 percent, <s><br/> <s>vehicle damage factor = 3.5 (standard axles per CV), <s><br/> <s>design life = 10 years <s><br/> <s>and traffic distribution factor = 0.75. <s><br/> <s>The cumulative standard axles (msa) computed are <br/> <s>(A) 35 <s><br/> <s>(B) 37 <s><br/> <s>(C) 65 <s><br/> <s>(D) 70 ', 1, 1, 0, 0, '2015-02-23 14:16:48', '2015-02-23 14:16:47'),
(810, 7, 2, 0, 0, 'What will be the maximum flow expected on this section and <s>the speed of the maximum flow', ' A linear relationship is observed between speed and density on a certain section of a highway. <s><br/> <s>The free flow speed is observed to be 80 km per hour and <br/> <s> the jam density is estimated as 100 vehicles per km length. <s><br/> <s>Based on the above relationship, <s><br/> <s>the maximum flow expected on this section and <br/> <s> the speed at the maximum flow will respectively be <br/> <s> <br/> <s>(A) 8000 vehicles per hour and 80km per hour <br/> <s>(B) 8000 vehicles per hour and 25km per hour <br/> <s>(C) 2000 vehicles per hour 80km per hour. <br/> <s>(D) 2000 vehicles per hour and 40km per hour ', 1, 1, 0, 0, '2015-02-23 14:22:07', '2015-02-23 14:22:06'),
(811, 8, 25, 0, 0, 'How to see reference url', 'cat collap_access.log|awk <r>{print $11}<r>|sort |uniq <br/> <s>', 6, 1, 0, 0, '2015-02-23 19:26:25', '2015-02-23 19:26:24'),
(812, 7, 0, 0, 0, 'Strategic Defense: Military Uses of the Moon <a>amp; Asteroids (1983) | WIRED', '<span><a href="http://www.wired.com/2015/02/strategic-defense-military-uses-moon-asteroid-resources-1983/" target="_blank"><img src="http://www.wired.com/wp-content/uploads/2015/02/near_far_topo2-200x100.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /> <br/>On the evening of 23 March 1983, President Ronald Reagan addressed the people of the United States from the Oval Office. Citing aggressive moves on the part of the Soviet Union, he defended proposed increases in U.S. military spending and the introduction of new missiles and bombers. He then called for a revolution in U.S.â€¦  .. more  \n				<p style="text-align:right;"> By : Wired <br/> At : www.wired.com</p></a></span>', 10, 1, 0, 0, '2015-02-24 03:35:36', '2015-02-24 03:35:36'),
(813, 11, 69, 305, 0, 'Chris Gayle: Man of the day, Slams Fastest ODI Double Century, Ist Double Century of Cricket World C', '<img src="uploads/rajnish/projectnotesPic/2015-02-24_07:32:01am_Gayle.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> Chris Gayle smashed record-equalling 16 sixes in his knock which came off 138 balls, beating the previous-best held by Virender Sehwag (140 balls).', 6, 1, 0, 0, '2015-02-24 07:32:02', '2015-02-24 07:52:28');
