(815, 7, 2, 0, 0, 'Find the speed of the gear ??', 'The speed of a gear having 60 teeth is measured using a proximity sensor. <s><br/> <s>The output of the proximity sensor is fed to a counter with a gating time of 1s. <s><br/> <s>The counter indicates a value of 120. <s><br/> <s> <br/> <s>The speed at which the gear is rotating is <br/> <s>(A) 60 rpm <br/> <s>(B) 120 rpm <br/> <s>(C) 600 rpm <br/> <s>(D) 1200 rpm', 1, 1, 0, 0, '2015-02-24 09:16:23', '2015-02-24 09:16:22'),
(816, 7, 2, 0, 0, 'Find the steady state output of the transducer ??', 'A piezoelectric type accelerometer has a sensitivity of 100mV/g. <s><br/> <s>The transducer is subjected to a constant acceleration of 5g. <s><br/> <s> <br/> <s>The steady state output of the transducer will be <br/> <s>(A) 0V <br/> <s>(B) 100mV <br/> <s>(C) 0.5V <br/> <s>(D) 5V', 1, 1, 0, 0, '2015-02-24 09:19:24', '2015-02-24 09:19:23'),
(817, 7, 2, 0, 0, 'Find the magnitude of the bridge output ??', 'A strain gauge has a nominal resistance of 600 ohm and a gauge factor of 2.5. <s><br/> <s>The strain gauge is connected in a dc bridge with three other resistances of 600 ohm each. <s><br/> <s>The bridge is excited by a 4V battery. <s><br/> <s> <br/> <s>If the strain gauge is subjected to a strain of 100 Î¼m/m , <s><br/> <s>the magnitude of the bridge output will be <br/> <s>(A) 0 V <br/> <s>(B) 250 Î¼V <br/> <s>(C) 500 Î¼V <br/> <s>(D) 750 Î¼V', 1, 1, 0, 0, '2015-02-24 09:28:44', '2015-02-24 09:28:43'),
(818, 7, 2, 0, 0, 'Find the value of B', 'Ten, real, band-pass message signals, each of bandwidth 3kHz, <s><br/> <s>are to be frequency division multiplexed over a band-pass channel with bandwidth B kHz. <br/> <s>If the guard band in between any two adjacent signals should be of 500 Hz width <s><br/> <s>and there is no need to provide any guard band at the edges of the band-pass channel, <s><br/> <s>the value of B should be at least <br/> <s>(A) 30 <br/> <s>(B) 34.5 <br/> <s>(C) 35 <br/> <s>(D) 35.5', 1, 1, 0, 0, '2015-02-24 09:33:35', '2015-02-24 09:33:34'),
(819, 7, 2, 0, 0, 'Find the error in the reading of the meter ??', 'A 230 V, 5A, 50 Hz single phase house service energy meter has a meter constant of 360 rev/kWhr. <s><br/> <s>The meter takes 50 s for making 51 revolutions of the disc when connected to a 10 kW, <s><br/> <s>unity power factor load. <br/> <s> <s><br/> <s>The error in the reading of the meter is <br/> <s>(A) 0% <br/> <s>(B) <an>0.5% <br/> <s>(C) -2.0% <br/> <s>(D) <an>2.0%', 1, 1, 0, 0, '2015-02-24 09:35:49', '2015-02-24 09:35:48'),
(820, 7, 2, 0, 0, 'Find the minimum number of ray sample in each projection set ??', 'In the process of non-destructive testing of a 10cm diameter cylinder, <s><br/> <s>a cross-sectional (trans-axial) image of the cylinder is reconstructed with the help of <br/> <s>parallel beam computer tomography technique. <s><br/> <s>To realize a spatial resolution of 1mm in the image, <s><br/> <s>the minimum number of ray sample in each projection set <br/> <s>and the minimum number of projection sets required are <br/> <s>(A) 200 and 315 respectively <br/> <s>(B) 100 and 315 respectively <br/> <s>(C) 200 and 629 respectively <br/> <s>(D) 100 and 629 respectively', 1, 1, 0, 0, '2015-02-24 09:43:15', '2015-02-24 09:43:14'),
(821, 7, 2, 0, 0, 'Find the correct statement ??', 'An 8085 executes the following instructions <br/> <s>2710 LXI H, 30A0H <br/> <s>2713 DAD H <br/> <s>2714 PCHL <br/> <s>All addresses and constants are in Hex. <s><br/> <s>Let PC be the contents of the program counter <s><br/> <s>and HL be the contents of the HL register pair just after executing PCHL. <br/> <s> <br/> <s>Which of the following statements is correct <br/> <s>(A) PC = 2715H <br/> <s> <s> <s> <s>HL = 30A0H <br/> <s> <br/> <s>(B) PC = 30A0H <br/> <s> <s> <s> <s>HL = 2715H <br/> <s> <br/> <s>(C) PC = 6140H <br/> <s> <s> <s> <s>HL = 6140H <br/> <s> <br/> <s>(D) PC = 6140H <br/> <s> <s> <s> <s>HL = 2715H', 1, 1, 0, 0, '2015-02-24 09:51:36', '2015-02-24 09:51:35'),
