(826, 7, 0, 0, 0, 'Find the probability that Rajjo studies computer science on Wednesday ??', 'Rajjo studies either computer science or mathematics everyday. <s><br/> <s>If she studies computer science on a day, <s><br/> <s>then the probability that she studies mathematics the next day is 0.6. <s><br/> <s>If she studies mathematics on a day, <s><br/> <s>then the probability that she studies computer science the next day is 0.4. <s><br/> <s> <br/> <s>Given that Rajjo studies computer science on Monday, <s><br/> <s>what is the probability that she studies computer science on Wednesday? <br/> <s>(A) 0.24 <s><br/> <s>(B) 0.36 <s><br/> <s>(C) 0.4 <s><br/> <s>(D) 0.6 ', 3, 1, 0, 0, '2015-02-24 13:45:02', '2015-02-24 13:45:02'),
(827, 7, 30, 0, 0, 'What will be the minimum number of comparisons required ??', ' The minimum number of comparisons required to determine <s><br/> <s>if an integer appears more than n/2 times in a sorted array of n integers is <br/> <s>(A) Î˜ ( n ) <br/> <s>(B) Î˜ ( logn ) <br/> <s>(C) Î˜ ( log* n ) <br/> <s>(D) <s>Î˜ ( 1 )', 1, 1, 0, 0, '2015-02-24 13:53:40', '2015-02-24 13:53:39'),
