(830, 7, 30, 0, 0, 'Choose the correct option.', 'Choose the correct option to fill ? 1 and ? 2 so that the program below prints an input string in reverse order. Assume that the input string is terminated by a newline character. <br/> <s> <s> <s> <s>void reverse ( void ) { <br/> <s> <s> <s> <s> <s> <s> <s>int c; <br/> <s> <s> <s> <s> <s> <s> <s>if ( ?1) reverse ( ) ; <br/> <s> <s> <s> <s> <s> <s> <s>?2 <br/> <s> <s> <s> <s>} <br/> <s> <s> <s> main ( ) { <br/> <s> <s> <s> <s> <s> printf ( <a>quot;Enter Text <a>quot; ) ; printf ( <a>quot; n<a>quot; ) ; <br/> <s> <s> <s> <s> <s> reverse ( ) ; printf ( <a>quot; n<a>quot; ) ; <br/> <s> <s> <s> } <br/> <s> <br/> <s> (A) ?1 is (getchar() != <r> n<r>) <br/> <s> <s> <s> <s> ?2 is getchar (c) ; <br/> <s> <br/> <s>(B) ?1 is (c = getchar()) != <r> n<r>) <br/> <s> <s> <s> <s>?2 is getchar (c) ; <br/> <s> <br/> <s>(C) ?1 is ( c != <r> n<r> ) <br/> <s> <s> <s> <s>?2 is putchar ( c ) <s>; <br/> <s> <br/> <s>(D) ?1 is ((c = getchar()) != <r> n<r>) <br/> <s> <s> <s> <s> ?2 is putchar ( c ) <s>;', 1, 1, 0, 0, '2015-02-24 16:26:38', '2015-02-24 16:26:36'),
