(838, 7, 2, 0, 0, 'What will be the number of bits required for addressing the next level page table??', 'A processor uses 36 bit physical addresses and 32 bit virtual addresses, with a page frame size of 4 Kbytes. <s><br/> <s>Each page table entry is of size 4 bytes. <s><br/> <s>A three level page table is used for virtual to physical address translation, where the virtual address is used as follows <br/> <s> <br/> <s>â€¢ Bits 30-31 are used to index into the first level page table <br/> <s>â€¢Bits 21-29 are used to index into the second level page table <br/> <s>â€¢ Bits 12-20 are used to index into the third level page table, and <br/> <s>â€¢ Bits 0-11 are used as offset within the page <br/> <s> <br/> <s>The number of bits required for addressing the next level page table (or page frame) in the page table entry of the first, second and third level page tables are respectively <br/> <s>(A) 20, 20 and 20 <s><br/> <s>(B) 24, 24 and 24 <s><br/> <s>(C) 24, 24 and 20 <s><br/> <s>(D) 25, 25 and 24 ', 1, 1, 0, 0, '2015-02-25 13:51:36', '2015-02-25 13:51:35'),
(839, 7, 2, 0, 0, 'Find the number of first-level and second-level blocks in the multi-level index ??', 'Consider a file of 16384 records. Each record is 32 bytes long and its key field is of size 6 bytes. <s><br/> <s>The file is ordered on a non-key field, and the file organization is unspanned. <s><br/> <s>The file is stored in a file system with block size 1024 bytes, and the size of a block pointer is 10 bytes. <s><br/> <s> <br/> <s>If the secondary index is built on the key field of the file, and a multi-level index scheme is used to store the secondary index, the number of first-level and second-level blocks in the multi-level index are respectively <br/> <s>(A) 8 and 0 <s><br/> <s>(B) 128 and 6 <s><br/> <s>(C) 256 and 4 <s><br/> <s>(D) 512 and 5 ', 1, 1, 0, 0, '2015-02-25 13:54:47', '2015-02-25 13:54:47'),
