(1533, 62, 0, 0, 0, 'Introduction to The Optimized Brain, with Steven Kotler', '<iframe class="youtube" src="//www.youtube.com/embed/HkTx2xR4MAs "frameborder="0" allowfullscreen ></iframe><br/> Flow is technically defined as an optimal state of consciousness where we feel our best and we perform our best. Steven Kotler runs through the neuroanatomic shifts that make it possible. If your guess is that the brain somehow works harder or faster during flow states, you may be surprised to learn that everything actually slows down thanks to what<r>s called transient hypofrontality. For more videos, here is the playlist http://bigthink.com/playlists/the-optimized-brain-a-workshop-on-flow-states-with-steven-kotler', 8, 1, 0, 0, '2015-03-03 08:24:54', '2015-03-03 08:24:54'),
