(1540, 40, 0, 0, 0, 'Which one of the following assertions is best supported by the below information?', 'After several defeats in wars, Robert Bruce went in exile and wanted to commit suicide. Just before committing suicide, he came across a spider attempting tirelessly to have its net. Time and again, the spider failed but that did not deter it to refrain from making attempts. Such attempts by the spider made Bruce curious. Thus, Bruce started observing the near-impossible goal of the spider toÂ have the net. Ultimately, the spider succeeded in having its net despite several failures. Such act of the spider encouraged Bruce not to commit suicide. And then, Bruce went back again and won many a battle, and the rest is history. <s><br/> <s> Â  <s><br/> <s> Â Which one of the following assertions is best supported by the above information? <s><br/> <s> Â  <s><br/> <s> Â (A) Failure is the pillar of success. <s><br/> <s> Â (B) Honesty is the best policy. <s><br/> <s> Â (C) Life begins and ends with adventures. <s><br/> <s> Â (D) No adversity justifies giving up hope', 3, 1, 0, 0, '2015-03-03 11:19:12', '2015-03-03 11:19:56'),
