(1567, 62, 15, 0, 0, 'CES 2015: IoT-connected home trends', '<iframe class="youtube" src="//www.youtube.com/embed/59PfHxexM0A "frameborder="0" allowfullscreen ></iframe><br/>  The <a>quot;Internet of Things<a>quot; has taken the Consumer Electronics Show by storm. <br/> <s> <br/> <s> One of the biggest trends at this yearâ€™s show is smart home connectivity. <br/> <s> <br/> <s>One of the platforms on display is Muzzley, which allows manufacturers to connect their smart home devices to the IoT world, and provides convenience to customers. <br/> <s> <br/> <s><a>quot;Basically we join all of our manufacturers into one app, so the user now doesnâ€™t need hundreds of different apps to connect different devices,<a>quot; said Muzzley CEO and Co-Founder Eduardo Pinheiro. <br/> <s> <br/> <s>The Muzzley system also learns the userâ€™s behavior which allows it to predict and suggest actions.', 8, 1, 0, 0, '2015-03-06 05:30:55', '2015-03-06 05:30:55'),
(1568, 62, 24, 0, 0, 'Chinese IoT company announces venture in North America', '<iframe class="youtube" src="//www.youtube.com/embed/r388ifT4T6E "frameborder="0" allowfullscreen ></iframe><br/> NIA Wulian, a leading provider of home automation systems in China, announced that the company is launching a joint venture in the U.S. NIA Wulian is focused on the large-scale retail and commercial markets. Steven Nai, chairman of NIA Holdings, said that the company has created a point of separation from competitors. <s><br/> <s> <br/> <s>â€œWhat happens if there is a gas leak in the house? Our system will detect it, sound the alarm, send an alert to you and a third-party response team. Our system will shut off the gas valve and open the windows in the meantime,â€ said Nia. <br/> <s> <br/> <s>NIA Wulian also will focus on connected health products that monitor vital signs and report emergencies. <br/> <s> <br/> <s>â€œTo us itâ€™s not just about smart home, itâ€™s about smart life. Thatâ€™s our philosophy,â€ said Nia.', 8, 1, 0, 0, '2015-03-06 05:32:45', '2015-03-06 05:32:45'),
(1569, 62, 30, 0, 0, 'Which of the following statements are TRUE about an SQL query?', 'P : An SQL query can contain a HAVING clause even if it does not have a GROUP BY clause <br/> <s>Q: An SQL query can contain a HAVING clause only if it has a GROUP BY clause <br/> <s>R : All attributes used in the GROUP BY clause must appear in the SELECT clause <br/> <s>S : Not all attributes used in the GROUP BY clause need to appear in the SELECT clause <br/> <s> <br/> <s>(A) P and R <s> <s> <s> <s> <s> (B) P and S <s> <s> <s> <s> <s> (C) Q and R <s> <s> <s> <s> (D) Q and S', 1, 1, 0, 0, '2015-03-06 05:38:44', '2015-03-06 05:38:44'),
