(1578, 151, 0, 0, 0, 'The Neuroscience of Internet Addiction', '<iframe class="youtube" src="//www.youtube.com/embed/HjJYvLH_FGw "frameborder="0" allowfullscreen ></iframe><br/> Internet lexicon, such as TL;DR (too long; didn<r>t read) speaks to our growing impatience. Nicholas Carr from The Atlantic covered his own struggle to invest his attention into long-form narratives: <br/> <s> <br/> <s>â€œNow my concentration often starts to drift after two or three pages. I get fidgety, lose the thread, begin looking for something else to do. I feel as if Iâ€™m always dragging my wayward brain back to the text. The deep reading that used to come naturally has become a struggle.â€ <br/> <s>Read more at: http://bigthink.com/ideafeed/why-we-cant-stand-slow-walkers', 8, 1, 0, 0, '2015-03-07 07:12:13', '2015-03-07 07:12:13'),
