(1589, 40, 0, 0, 0, 'Students Learn to Write by Tutoring a Robot', '<iframe class="youtube" src="//www.youtube.com/embed/E_iozVysl5g "frameborder="0" allowfullscreen ></iframe><br/> To teach the robot, children first prepare words with small magnetic letters of the sort found on fridges the world over. The robot then writes the word on the tablet screen and the child identifies and corrects errors by rewriting either the whole word or specific letters. Once satisfied with the robot<r>s legibility, the child moves on to the next word. The robot meanwhile analyzes the corrected letters for differences and then in repeat attempts converges towards the child<r>s level of writing. And in the process of teaching, the child gets handwriting practice without realizing it. <br/> <s>Read more http://bigthink.com/ideafeed/struggling-students-learn-to-write-from-robot-learner', 8, 1, 0, 0, '2015-03-08 09:13:24', '2015-03-08 09:13:24'),
