(1611, 151, 0, 0, 0, 'The Future of Banking: A Better Connected World', '<img src="uploads/raveesh/articlePic/2015-03-09_02:38:06pm_future-banking.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> The Future of Banking: <br/> <s> <br/> <s>Have you ever wondered what banking will look like in the next 10 years? Intelligent machines are set to replace humans in our high street banks, cash machines will have video chat capabilities and your bank will play personal shopper texting you deals from partners on products you are likely to buy. In short, the bank as we know it will become a thing of the past instead banks will be replaced by platforms that are run almost entirely by algorithms and robots. <br/> <s> <br/> <s>Via http://www.bbc.com/future/specials/connected-world/huawei-finance', 7, 1, 0, 0, '2015-03-09 14:38:07', '2015-03-09 14:38:07'),
