(1, 8, 2, 'Collap.com V1', ' ', 'Public', 0, 0, '2014-12-05 10:18:39', 0, 0, '0000-00-00 00:00:00'),
(2, 8, 0, 'Random CSE/IT', '<img src="uploads/rahul/projectPic/2015-01-04_06:43:00pm_0320_innovation_630x420.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /> <br/> You got some thing to learn !!!<br/>Welcome', 'Public', 0, 0, '2014-12-05 10:39:27', 0, 0, '0000-00-00 00:00:00'),
(3, 11, 7, 'ASSET Mangament System', ' ', 'Classified', 0, 0, '2014-12-09 01:09:25', 0, 0, '0000-00-00 00:00:00'),
(4, 8, 0, 'Git Tips #SoftwareDevelopment ', ' Git is a free and open source distributed version control system designed to handle everything from small to very large projects with speed and efficiency.<br/><br/>Git is easy to learn and has a tiny footprint with lightning fast performance. It outclasses SCM tools like Subversion, CVS, Perforce, and ClearCase with features like cheap local branching, convenient staging areas, and multiple workflows. ', 'Public', 0, 0, '2014-12-10 16:17:18', 0, 0, '0000-00-00 00:00:00'),
(5, 8, 12, 'MDU: Computer Networks', ' ', 'Public', 0, 0, '2014-12-14 09:28:10', 0, 0, '0000-00-00 00:00:00'),
(6, 12, 0, 'Smart Grids', '<img src="uploads/neeraj/projectPic/2015-01-16_08:14:03am_2014-12-15_04:50:04pm_Smart-Grids.jpeg" style="max-width: 100%;" onError="this.src="img/default.gif"" /> <br/> A smart grid is an electrical grid that uses information and communications technology(ICT) to gather and act on information using a closely knit fabric of sensors, actuators and distributed control system. Such as information about the behaviours of suppliers and consumers, in an automated fashion to improve the efficiency, reliability, economics, and sustainability of the production and distribution of electricity.<br/><br/>This Public Project Aims at collecting Information about the latest advances and available research oportinities in this sector. All updates will be posted as notes.', 'Public', 0, 0, '2014-12-15 16:49:06', 0, 0, '0000-00-00 00:00:00'),
(7, 8, 0, 'Mydesigner', '<img src="uploads/rahul/projectPic/2014-12-19_04:13:15pm_Site-Meet-My-Designer-2-e1413018883474.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> This business will work in both online and offline.<br/><br/>This is dedicated to women only. ', 'Classified', 0, 0, '2014-12-19 16:13:15', 0, 0, '0000-00-00 00:00:00'),
(8, 12, 0, 'Network Functions Virtualisation (NFV)', '<img src="uploads/neeraj/projectPic/2014-12-19_10:38:22pm_Network Virtualisation Approach June 2013 Large.png.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> Network Functions Visualization aims to transform the way that network operators architect networks by evolving standard IT visualization technology to consolidate many network equipment types onto industry standard high volume servers, switches and storage, which could be located in Datacentres, Network Nodes and in the end user premises, as illustrated in Figure 1. It involves the implementation of network functions in software that can run on a range of industry standard server hardware, and that can be moved to, or instantiated in, various locations in the network as required, without the need for installation of new equipment.', 'Deleted', 0, 0, '2014-12-19 22:38:22', 0, 0, '0000-00-00 00:00:00'),
(9, 12, 18, 'Network Functions Virtualisation (NFV)', ' ', 'Public', 0, 0, '2014-12-19 22:56:06', 0, 0, '0000-00-00 00:00:00'),
(10, 12, 0, 'Information and Communications Technology', '<img src="uploads/neeraj/projectPic/2015-01-04_06:53:58pm_ict.png.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /> <br/> This project will present you the Upcoming and latest trends in Information and Communications Technology(ICT) Area Industry', 'Public', 0, 0, '2014-12-26 15:58:11', 0, 0, '0000-00-00 00:00:00'),
(11, 42, 0, 'abc', 'test project', 'Public', 0, 0, '2015-01-05 07:42:40', 0, 0, '0000-00-00 00:00:00'),
(12, 11, 0, 'Computer Library', '<img src="uploads/rajnish/projectPic/2015-01-06_07:42:46am_evolution.png.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> Computer science is the scientific and practical approach to computation and its applications. This project is all about evolution of computer, computer technology, every trends comes to computer history that leads the world in new era. The progression, from mechanical inventions and mathematical theories towards the modern computer concepts and machines, formed a major academic field and the basis of a massive worldwide industry. Stay in touch for all consecutive trends, technology and big challenges arise in computer field. <s><br/> <br/> https://www.facebook.com/pages/Computer-library/1030523760296544', 'Public', 0, 0, '2015-01-06 07:42:46', 0, 0, '0000-00-00 00:00:00'),
(13, 8, 28, 'Collap hands to empower Indian youths.', ' ', 'Public', 0, 0, '2015-01-09 08:55:54', 0, 0, '0000-00-00 00:00:00'),
(14, 8, 0, 'Awesome website over internet', '<img src="uploads/rahul/projectPic/2015-01-09_10:50:46am_b8b47afd17c90ce594ecf8dabc700598.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> Let<r>s search for awesomeness over internet.', 'Public', 0, 0, '2015-01-09 10:50:47', 0, 0, '0000-00-00 00:00:00'),
(15, 8, 0, 'Cool TeK ', '<img src="uploads/rahul/projectPic/2015-01-09_11:45:14am_technology1.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> Let<r>s dive in awesome world of technology around us.....', 'Public', 0, 0, '2015-01-09 11:45:14', 0, 0, '0000-00-00 00:00:00'),
(16, 49, 0, 'BANKING SECTOR', 'NON PERFORMING ASSETS IN BANKING SECTOR', 'Public', 0, 0, '2015-01-10 09:10:44', 0, 0, '0000-00-00 00:00:00'),
(17, 11, 0, 'Memory/Brain Power', '<img src="uploads/rajnish/projectPic/2015-01-10_11:56:09am_Skull-Shining-yoga-pose-creative-chakra-1024x682.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> <br/> Memory is one of the most important parts of our life. With our memories, we can re-experience relationships, emotions, and experiences with loved ones. As we get older, if we don<r>t train our brains through exercises, our power to remember things begins to decrease. Pranayam is one of the best poses to increase the memory and concentration power. It is the yoga exercise in which you take deep breath, keep it inside for some time, then exhale. Our minds work very efficiently when they have an ample supply of oxygen. <s><br/> <s>Â Keep in touch at: http://collap.com/project.php?project_id=17', 'Public', 0, 0, '2015-01-10 11:56:10', 0, 0, '0000-00-00 00:00:00'),
