(30, 40, 0, 'CSE Interview Preparation Questions And Notes', '<img src="uploads/shruti/projectPic/2015-01-20_06:15:46am_interview question.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> This projects gives some collection of best computer science questions. Here everyone can post question like he/she found and it is helpful to them for qualifying interview. Mainly questions included here is core computer science technical questions, programming questions, algorithm, data structure, operating system, computer network questions. However, if you found good aptitude/reasoning question, you can post it here. The target of this project is to help CSE student interview seekers. <br/> <s>However some good are there like Interview Coding Questions from Gayle Laakmann McDowell, you can use. <br/> <s>Anyone can post questions, ask answer, give answer. Lets come together, collaborate and help each other.', 'Public', 0, 0, '2015-01-20 06:15:47', 0, 0, '0000-00-00 00:00:00'),
