(64, 11, 0, 'Success Stories', '<img src="uploads/rajnish/projectPic/2015-02-13_12:34:33pm_career_250x251%255B1%255D.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/> Hello, welcome all to success stories. This is a blog for sharing success stories you know. Everyone can contribute to this project. Let<r>s show some clue hard workers and be motivate from them', 'Classified', 0, 0, '2015-02-13 12:34:33', 0, 0, '0000-00-00 00:00:00'),
(65, 8, 0, 'We want Peace in Asia', '<img src="uploads/rahul/projectPic/2015-02-13_02:42:11pm_kid-earth-peace-asia-oceania-3032098.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /><br/>  To enjoy good health, to bring true happiness to one<r>s family, to bring peace to all, one must first discipline and control one<r>s own mind. If a man can control his mind he can find the way to Enlightenment, and all wisdom and virtue will naturally come to him. <br/> <s>-- Buddha <br/> <s> <s><br/> <s>I refuse to accept the view that mankind is so tragically bound to the starless midnight of racism and war that the bright daybreak of peace and brotherhood can never become a reality... I believe that unarmed truth and unconditional love will have the final word. <br/> <s>--Martin Luther King, Jr. <br/> <s> <br/> <s>Outgoings: <s><br/> <s>Please check <a>quot;outgoings<a>quot; for current out outgoings <br/> <s> <br/> <s>', 'Public', 0, 0, '2015-02-13 14:42:11', 0, 0, '0000-00-00 00:00:00'),
(66, 8, 0, 'Collap v3', 'This is advance collap, with lot of new feature. This will be refactoring of code. <s><br/> <s>As this release is done, we will make collap.com v2 code open source.', 'Public', 0, 0, '2015-02-14 04:21:41', 200000, 40000, '0000-00-00 00:00:00'),
(67, 11, 0, 'Article Ideas', 'Hello everyone, this project is about to new ideas for articles. You have to give some ideas/topic names for articles. As till now, we know all about ourself/skills, you can assign task also for writing articles to specific member. <br/> <s> <br/> <s>Ideas are like chessman moved forward they may be beaten but they may start a winning game. ', 'Private', 0, 0, '2015-02-14 04:26:47', 72000, 20000, '0000-00-00 00:00:00'),
(68, 7, 0, 'TodFodCode', 'TodFodCode', 'Private', 0, 0, '2015-02-17 07:34:09', 0, 0, '0000-00-00 00:00:00'),
(69, 62, 0, 'Greatest Mens of the Century ', '<img src="uploads/mridula/projectPic/2015-02-18_05:36:55am_scienceofreality.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /> <br/> Hello everyone, lets make remembrance and celebrate to Gods of Century. How they are valuable for our life, they changed our life span and make it very easy.', 'Public', 0, 0, '2015-02-18 05:10:54', 0, 0, '0000-00-00 00:00:00'),
(70, 11, 0, 'Sportskeeda: A dating with sports every evening', '<img src="uploads/rajnish/projectPic/2015-02-20_10:17:59am_images.jpg" style="max-width: 100%;" onError="this.src="img/default.gif"" /> <br/>  Are you passionate about sports. <s><br/> <s> Â  <s><br/> <s> Â What you think about sports, what is your favorite sport, dive in sport which you like. <s><br/> <s> Â Lets do pour our own thoughts about your sports game, team, player, rules, prediction and so many as you think. <s><br/> <s> Â Lets bring out your thought open to world. <s><br/> <s> Â  <s><br/> <s> Â Its a opportunity to all of us. Lets join and celebrate.', 'Public', 0, 0, '2015-02-20 10:17:59', 0, 0, '0000-00-00 00:00:00'),
