(12, 8, 22, 0, 5, 'rahul:  Introducing a powerful online platform to collaborate with like minded people and change the world, solving one problem at a time.\nCollap offers a wide range of tools to identify a challenge and assemble your own team to collaborate and crack it. Hereâ€™s to the the joy of collaborative problem solving!', '2015-01-14 19:08:15'),
(13, 7, 25, 0, 1, 'SELECT timestamp, COUNT( * ) AS Cnt FROM user_access_records WHERE timestamp <a>gt;= now( ) - INTERVAL 3 DAY GROUP BY HOUR( timestamp ) , DAY( timestamp ) ORDER BY timestamp', '2015-01-16 09:25:16'),
(14, 7, 22, 0, 5, 'pull the code', '2015-01-19 07:00:41'),
(15, 9, 25, 0, 1, 'Guys, can you widen the Projects tile on the left. It<r>s too narrow and the text is barely visible. Very inconvenient. ', '2015-01-20 03:56:32'),
(16, 9, 28, 0, 5, 'Rahul, there?', '2015-01-20 03:57:24'),
(17, 9, 28, 0, 5, 'This information about the Smart Public Advertisement System is insufficient. ', '2015-01-20 03:57:59'),
(18, 9, 28, 0, 5, 'Tell me. ', '2015-01-20 03:58:02'),
(19, 9, 28, 0, 5, 'Do you wish to make a Provisional Application or a Complete Specification?', '2015-01-20 03:58:37'),
(20, 9, 28, 0, 5, 'Provisional is the application we did last time. It gives you a 1 year window to finish the development process.', '2015-01-20 03:59:23'),
(21, 9, 28, 0, 5, 'Decide and let me know. ', '2015-01-20 03:59:59'),
(22, 9, 28, 0, 1, 'This is the disclosure for Provisional Application or a Complete Specification? ', '2015-01-20 04:00:37'),
(23, 9, 28, 0, 1, 'Disclosure insufficient for Complete Specification. ', '2015-01-20 04:01:14'),
(24, 8, 28, 0, 1, 'dude check outgoings. This is introductioln of the concept', '2015-01-20 11:50:32'),
(25, 9, 28, 0, 1, 'You wanna file the complete specification or provisional?', '2015-01-22 09:41:07'),
(26, 9, 25, 0, 1, 'Guys, the wider Project tiles looks and feels better. Good job! Can we also extend the length of the tile? A little more spacious could make a difference to the feel. ', '2015-01-22 10:05:01'),
(27, 9, 25, 0, 1, 'Despite the widening of the tile, the content is not displayed. I wanted to share the snap of the same, but that functionality is not supported in the comments. Please address the same. ', '2015-01-22 10:09:28'),
(28, 8, 28, 0, 1, 'complete specification', '2015-01-22 11:28:57'),
(29, 7, 25, 0, 1, 'There is outgoings option below the title. Check on that, There you can participate in the outgoings of project....', '2015-01-22 15:23:51'),
(30, 9, 28, 0, 1, 'Ok', '2015-01-23 07:34:02'),
(31, 11, 3, 155, 5, ' ', '2015-01-27 06:24:16'),
(32, 109, 35, 0, 5, 'test', '2015-01-28 14:12:53'),
(33, 8, 28, 0, 5, 'complete specification dude', '2015-01-28 14:21:00'),
(34, 8, 28, 0, 5, 'I will write detailed write up soon...', '2015-01-28 14:21:17'),
(35, 8, 57, 0, 5, 'Hi neeraj can you share you yesterday calculations', '2015-02-01 09:16:38'),
(36, 11, 61, 0, 5, 'hello everyone welcome to this new project..', '2015-02-05 12:13:01'),
(37, 11, 61, 0, 3, 'If anybody interested in this project, Kindly contact me ', '2015-02-05 13:30:38'),
